INSERT INTO episode (id, description, episode_title, is_series, language, name, number, picture, rating, season, wanted, series_id) VALUES ('EP019743701804','Nachmittägliches Service- und Ratgebermagazin mit unterschiedlichen Themen und abwechselnden Gästen.','',_binary '\0','DEU','Kaffee oder Tee?',NULL,NULL,4,NULL,NULL,NULL),('EP015402280663','In der Sendung wird diskutiert, wie sich der Wintertourismus in den Alpen entwickelt hat.','Skitourismus - Freizeitspaß oder ökologischer Alptraum?',_binary '','DEU','Planet Wissen',NULL,NULL,4,NULL,NULL,NULL),('EP019743701803','Nachmittägliches Service- und Ratgebermagazin mit unterschiedlichen Themen und abwechselnden Gästen.','',_binary '\0','DEU','Kaffee oder Tee?',NULL,NULL,4,NULL,NULL,NULL),('EP019743701806','Nachmittägliches Service- und Ratgebermagazin mit unterschiedlichen Themen und abwechselnden Gästen.','',_binary '\0','DEU','Kaffee oder Tee?',NULL,NULL,4,NULL,NULL,NULL),('EP031906530028','David kann sich an die gesamten Vorgänge der letzten Tage absolut nicht erinnern.','Das Geständnis',_binary '','DEU','NOOBees',NULL,NULL,4,NULL,NULL,NULL),('EP019743701805','Nachmittägliches Service- und Ratgebermagazin mit unterschiedlichen Themen und abwechselnden Gästen.','',_binary '\0','DEU','Kaffee oder Tee?',NULL,NULL,4,NULL,NULL,NULL),('EP031906530029','Silvia hat endlich eine Entscheidung getroffen: Sie und David sind nun ein Paar.','Das erste Date',_binary '','DEU','NOOBees',NULL,NULL,4,NULL,NULL,NULL),('EP019426980015','Eine Frau wird brutal ermordet und die Ermittler müssen herausfinden, wer ein Motiv hatte.','Die Ameisenspur; Kaltblütige Rache; Tödlicher Irrtum',_binary '','DEU','Autopsie - Mysteriöse Todesfälle',NULL,NULL,4,NULL,NULL,NULL),('EP019694570200','Neue Abenteuer mit der Schildkröte Franklin und seinen Freunden.','Franklin und die Fahrradparade',_binary '','DEU','Franklin und Freunde',NULL,'https://json.schedulesdirect.org/20141201/image/assets/p14181446_e_h3_aa.jpg',4,NULL,NULL,NULL),('EP019426980016','Die Gerichtsmediziner kommen einem grausamen Versicherungsbetrug auf die Schliche.','Der Arzt deines Vertrauens; Nächtlicher Überfall',_binary '','DEU','Autopsie - Mysteriöse Todesfälle',NULL,NULL,4,NULL,NULL,NULL),('EP017428710404','Über den Wolken am Hardangerfjord! Die Passagiere Ute und Bernd wagen sich mit dem Wasserflugzeug in windige Höhen - wo sie sogleich kräftig durchgeschüttelt werden! Während Norwegens mächtiger Preikestolen Katrin und Oliver an ihre Grenzen bringt.','Im Wasserflugzeug von Fjord',_binary '','DEU','Verrückt nach Meer',NULL,NULL,4,NULL,NULL,NULL),('EP017428710403','Reiseleiter Bernd findet auf einer Fjord-Safari alles, was man für ein Mittagessen braucht.','Die Trolle von Bergen',_binary '','DEU','Verrückt nach Meer',NULL,NULL,4,NULL,NULL,NULL),('EP031906530030','Silvia und David haben beschlossen, ihr Date in einen abgelegenen Teil des Parks zu legen.','Der Personal Trainer',_binary '','DEU','NOOBees',NULL,NULL,4,NULL,NULL,NULL),('EP029326570015','Roquat ist erfolgreich aus dem Königreich geflohen. Guph will den Gürtel des Königs der Nome finden.','Der Gürtel des Nome-Königs',_binary '','DEU','Lost in Oz',NULL,'https://json.schedulesdirect.org/20141201/image/assets/p15615669_e_h12_aa.jpg',4,NULL,NULL,NULL),('EP020064170265','Menschen in der Arktis berichten vom Leben im Norden, von seinem Licht und der klirrenden Kälte.','Reise durch den hohen Norden',_binary '','DEU','Mein Ausland',NULL,NULL,4,NULL,NULL,NULL),('EP020073300009','`Jeder Mensch ein Künstler!`Dies berühmte Motto von Joseph Beuys könnte auch von Bob Ross stammen.','Majestic Peaks',_binary '','DEU','Bob Ross: The Joy of Painting',NULL,NULL,4,NULL,NULL,NULL),('EP019734540083','Während einer Hundeshow machen die Harts Bekanntschaft mit einem Hundebesitzer.','Der Hund, der zuviel wusste',_binary '','DEU','Hart aber herzlich',NULL,'https://json.schedulesdirect.org/20141201/image/assets/p1122406_e_h12_aa.jpg',4,NULL,NULL,NULL),('EP020073300002','Bob malt ein Bild. Es handelt sich um einen See und einen langen Weg vor herbstlicher Kulisse.','Autumn Exhibition',_binary '','DEU','Bob Ross: The Joy of Painting',NULL,NULL,4,NULL,NULL,NULL),('EP029326570021','Guph vertauscht die Bevölkerungen von Smaragdstadt mit der des Nome-Königreichs.','Flucht aus dem Königreich der Nome',_binary '','DEU','Lost in Oz',NULL,'https://json.schedulesdirect.org/20141201/image/assets/p15615675_e_h12_aa.jpg',4,NULL,NULL,NULL),('EP019734540085','Max sagt seiner Tanzpartnerin, dass er gerne ihr Freund sein möchte, nicht aber ihr Ehemann.','Der Tod tanzt im Dreivierteltakt',_binary '','DEU','Hart aber herzlich',NULL,'https://json.schedulesdirect.org/20141201/image/assets/p1122405_e_h3_aa.jpg',4,NULL,NULL,NULL),('EP029942050043','Die Schafe sind irritiert: Auf ihrer Weide ist ein Zelt aufgestellt. Bitzers Beschwerde verpufft.','Camping-Chaos',_binary '','DEU','Zambo - Guetnachtgschichtli',NULL,'https://json.schedulesdirect.org/20141201/image/assets/p3344257_e_h3_ab.jpg',4,NULL,NULL,NULL),('EP030877800002','Ein Kamerateam begleitet Mechaniker beim Versetzen eines zwanzig Tonnen schweren Baggers.','Lift Off',_binary '','DEU','Die Mega-Mechaniker - Retter fürs Große',NULL,NULL,4,NULL,NULL,NULL),('EP019383521592','Fünf Damen treten an, um die Frau mit dem besten Stil zu werden. Dieses Mal mit Christine.','Motto in Düsseldorf: All you need is love - Sei die süßeste Verführung beim ersten Date!, Tag 3: Christine',_binary '','DEU','Shopping Queen',NULL,NULL,4,NULL,NULL,NULL),('EP021543380053','Jeannie bewirbt sich als Sekretärin bei General Peterson, um Tony Karriere zu unterstützen.','Eine Sekretärin für General Peterson',_binary '','DEU','Bezaubernde Jeannie',NULL,'https://json.schedulesdirect.org/20141201/image/assets/p1129176_e_h12_ab.jpg',4,NULL,NULL,NULL),('EP019383521591','Fünf Damen treten an, um die Frau mit dem besten Stil zu werden. Dieses Mal mit Nazmiye.','Motto in Düsseldorf: All you need is love - Sei die süßeste Verführung beim ersten Date!, T