INSERT INTO series (id, description, is_series, language, name, picture, rating, watched) VALUES ('SH030708580000','Kristina Katzer ermittelt zusammen mit ihrem Ex, Kommissar Hundt im Weimarer Revier.',NULL,'DEU','Heiter bis tödlich - Akte Ex','https://s3.amazonaws.com/schedulesdirect/assets/p10432518_i_h12_aa.jpg',4,NULL),('SH029424150000','Die Dokumentationsreihe widmet sich Fragestellungen zur politischen und gesellschaftlichen Lage.',NULL,'DEU','Was Deutschland bewegt','https://s3.amazonaws.com/schedulesdirect/assets/p15385690_st_h12_aa.jpg',4,NULL),('SH019461840000','Das Ländermagazin setzt auf Informationen aus Sachsen, Sachsen-Anhalt und Thüringen.',NULL,'DEU','MDR um 11','https://json.schedulesdirect.org/20141201/image/assets/p10869348_i_h12_aa.jpg',4,NULL),('SH019863440000','In Mathe verstehst du nur Bahnhof? Sebastian Wohlrab und seine Schüler helfen dir weiter.',NULL,'DEU','GRIPS: Mathe','https://s3.amazonaws.com/schedulesdirect/assets/p11026617_b_h3_aa.jpg',4,NULL),('SH018580080000','Der kleine Caillou geht zusammen mit seiner Schwester Rosi jeden Tag auf Entdeckungstour, um Neues zu lernen und zu erleben. Seine Neugier hilft ihm, die Antworten auf seine Fragen zu bekommen.',NULL,'DEU','Caillou','https://json.schedulesdirect.org/20141201/image/assets/p186052_i_h3_aa.jpg',4,NULL),('SH029942050000','Shaun das Schaf lebt gemeinsam mit seiner Herde auf der Weide eines idyllischen Bauernhofs. Er ist jung, unerfahren und noch etwas naiv - aber sehr neugierig und verschmitzt. Er verfügt über einen ganz besonderen `Schaf-Sinn\' und findet auch für die vertracktesten Situationen eine Lösung. Auf dem Hof leben außerdem noch der Hütehund Bitzer, der Bauer und die drei fiesen Schweine, sowie einige andere Tiere. Der Bauer bekommt von dem turbulenten Leben seiner Tiere nichts mit, die sich zwar manchmal in die Wolle kriegen, aber im Großen und Ganzen wie eine glückliche Familie zusammenleben und zusammenhalten.',NULL,'DEU','Zambo - Guetnachtgschichtli','https://json.schedulesdirect.org/20141201/image/assets/p9187264_i_h12_aa.jpg',4,NULL),('SH019656370000','Die Dokumentationsreihe berichtet über Geschichten von exotischen Schauplätzen, außergewöhnlichen Menschen, wenig erforschten Tierarten sowie erstaunlichen Naturphänomenen, und zeigt interessante Forschungsberichte über die Tiefsee.',NULL,'DEU','mare TV kompakt','https://json.schedulesdirect.org/20141201/image/assets/p10944077_b_h12_aa.jpg',4,NULL),('SH019560060000','Die Sendung berichtet über Themen aus den Bereichen Wissenschaft, Technik und Mensch. Auf unterschiedliche Fragen wird versucht, Antworten zu finden und diese auf unkomplizierte und leicht verständliche Weise zu vermitteln.',NULL,'DEU','Abenteuer Leben täglich','https://s3.amazonaws.com/schedulesdirect/assets/p10903651_st_h12_ab.jpg',4,NULL),('SH019579340000','Dokumentationen über Menschen und Geschichten im Sendegebiet des NDR.',NULL,'DEU','die nordstory','https://json.schedulesdirect.org/20141201/image/assets/p10911270_i_h12_aa.jpg',4,NULL),('SH019432910000','Die 13-köpfige Familie Wollny wird bei ihrem Alltag von der Kamera begleitet. Dabei geben sie einen ganz privaten Einblick in sämtliche Situationen, die in einer Großfamilie entstehen. Ob Probleme oder besonders schöne Momente - sie teilen alles.',NULL,'DEU','Die Wollnys - Eine schrecklich große Familie!','https://s3.amazonaws.com/schedulesdirect/assets/p10858681_st_h12_aa.jpg',4,NULL),('SH019855910000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Dortmund.',NULL,'DEU','Lokalzeit aus Dortmund','https://s3.amazonaws.com/schedulesdirect/assets/p11024455_b_h3_ag.jpg',4,NULL),('SH015406570000','Nach Herzenslust Stauden zu shoppen ist für Gartenfreunde das Schönste. In der Gärtnerei Gaißmayer in Illertissen bei Ulm kann man wirklich aus dem Vollen schöpfen. Etwa 3.000 verschiedene Stauden sind im Angebot.',NULL,'DEU','Grünzeug','https://json.schedulesdirect.org/20141201/image/assets/p9127617_b_h12_aa.jpg',4,NULL),('SH018556690000','Die aktuellen Nachrichten und Servicebeiträge zu Themen wie Finanzen, Reisen und Einkaufen werden präsentiert. Außerdem beschäftigt man sich mit Sportbeiträgen und weiteren informativen Tipps.',NULL,'DEU','RTL Aktuell','https://json.schedulesdirect.org/20141201/image/assets/p472488_st_h12_aa.jpg',4,NULL),('SH015402070000','Ratgebermagazin rund um die Gesundheit.',NULL,'DEU','Hauptsache gesund','https://s3.amazonaws.com/schedulesdirect/assets/p9125757_b_h12_aa.jpg',4,NULL),('SH019646190000','Les Gold ist Inhaber von `American Jewelry and Loan\', des größten Pfandhauses von Detroit. Das Geschäft ist bereits in dritter Generation in der Hand der Familie. Die Serie gibt Einblicke in den Alltag des amerikanischen Pfandleihgeschäfts.',NULL,'DEU','Hardcore Pawn - Das härteste Pfandhaus Detroits','https://s3.amazonaws.com/schedulesdirect/assets/p7959226_i_h3_aa.jpg',4,NULL),('SH019580650000','Wöchentliches Wirtschaftsmagazin mit diversen Themen.',NULL,'DEU','MEX. das marktmagazin','https://json.schedulesdirect.org/20141201/image/assets/p10911718_i_h12_aa.jpg',4,NULL),('SH032268380000','Die Strohhüte landen auf der Insel Dressrosa. Nachdem sie von Doflamingos Eroberung des Königreichs erfahren haben, schließen sich die Strohhüte mit den Revolutionären und Prinzessin Viola zusammen, um Doflamingo zu stürzen und die Insel zu retten.',NULL,'DEU','One Piece','https://s3.amazonaws.com/schedulesdirect/assets/p12201877_st_h12_aa.jpg',4,NULL),('SH034253870000','In der Rateshow müssen Kandidatenpaar den Wert verschiedener Gegenstände richtig schätzen. Es geht ganz schön zur Sache, und wem es gelingt, am Ende den wertvollsten Gegenstand ausgewählt zu haben, räumt den Gegenwert in Cash ab.',NULL,'DEU','Kitsch oder Kasse','https://s3.amazonaws.com/schedulesdirect/assets/p17860386_st_h12_aa.jpg',4,NULL),('SH018573670000','Ein Team von forensischen Spezialisten der Polizei in Las Vegas untersucht Tatorte und arbeitet daran, grausame Verbrechen in der Stadt der Sünden aufzulösen.',NUL