,'Babys! Kleines Wunder - großes Glück','https://s3.amazonaws.com/schedulesdirect/assets/p9804879_st_h12_aa.jpg',4,NULL),('SH019970370000','Es war eines der gigantischsten Bauvorhaben der Menschheitsgeschichte. Überall im Dritten Reich und in den von Deutschland besetzten Gebieten wurden 1944 ganze Fabrikanlagen in unterirdische Stollensysteme verlegt, um sie dem Bombenhagel der Alliierten zu entziehen.',NULL,'DEU','Das unterirdische Reich - Die geheimen Welten der Nazis','https://json.schedulesdirect.org/20141201/image/assets/p11065758_i_h12_aa.jpg',4,NULL),('SH019654750000','Aktuelle Tests und Testergebnisse von Produkten und Dienstleistungen werden präsentiert, angefangen von Säften über Elektronikgeräte, Mobilfunkshops, Fluganbieter, der Riester-Rente, Autozubehör und Stromversorger bis hin zu teuren Restaurants.',NULL,'DEU','Ratgeber - Test','https://json.schedulesdirect.org/20141201/image/assets/p10943714_st_h12_ab.jpg',4,NULL),('SH029228150000','Die ehemaligen Hauptdarsteller der Originalserie verbringen gemeinsam ihren Urlaub.',NULL,'DEU','Jersey Shore: Family Vacation','https://json.schedulesdirect.org/20141201/image/assets/p15207885_b_h12_aa.jpg',4,NULL),('SH020868640000','Drei Mediziner wollen allein mit gezielten Ernährungsstrategien Symptome deutlich verbessern und Krankheiten sogar heilen. Die Reihe zeigt, wie mit speziellem Essen schon innerhalb weniger Monate oft mehr erreicht werden kann als mit Tabletten.',NULL,'DEU','Die Ernährungs-Docs','https://json.schedulesdirect.org/20141201/image/assets/p11358042_b_h12_aa.jpg',4,NULL),('SH029042750000','Die Kandidaten wagen sich in einen Hindernislauf, der dafür gemacht wurde, sie möglichst spektakulär und witzig scheitern zu lassen. Pro Folge treten 24 Teilnehmer gegeneinander an, auf den Gewinner warten 50.000 Dollar Preisgeld.',NULL,'DEU','WipeOut - Mach dich nass!','https://s3.amazonaws.com/schedulesdirect/assets/p186368_i_h12_ab.jpg',4,NULL),('SH033209960000',NULL,NULL,'DEU','Alfred Hitchcock präsentiert','https://json.schedulesdirect.org/20141201/image/assets/p184181_st_h12_aa.jpg',4,NULL),('SH023220780000','Das Kinomagazin präsentiert kurz und kompakt die aktuellsten Kinofilme aus aller Welt. Dazu gibt es zu jedem Film wissenswerte Hintergrundinformationen und Einblicke.',NULL,'DEU','Watch Me - das Kinomagazin','https://s3.amazonaws.com/schedulesdirect/assets/p12396287_b_h12_ab.jpg',4,NULL),('SH031429990000','Auf der deutsch-österreichischen Grenze liegt eine seltsam inszenierte Leiche. Ellie Stocker aus Berchtesgaden und Gedeon Winter aus Wien ermitteln. Sie hoch motiviert, er ein abgehalfterter Zyniker.',NULL,'DEU','Der Pass','https://s3.amazonaws.com/schedulesdirect/assets/p16462881_b_h12_aa.jpg',4,NULL),('SH026290490000','Dana Newman präsentiert verschiedene Themen, um vorhandene Englischkenntnisse aufzufrischen. In kleinen Häppchen werden Grammatikregeln wiederholt oder Unterhaltungsthemen wie englischsprachige Musik präsentiert, um den Wortschatz zu erweitern.',NULL,'DEU','English bite-size','https://s3.amazonaws.com/schedulesdirect/assets/p13854651_st_h12_aa.jpg',4,NULL),('SH019560930000','Die siebenköpfige, hochspezialisierte FBI-Eliteeinheit aus erfahrenen Psychologen und Special Agents erstellt Serientäterprofile, um damit Gewaltverbrechern zuvorzukommen. Jeder der Ermittler trägt mit seinem Spezialwissen zur Analyse und Aufklärung der Verbrechen bei und gemeinsam riskieren sie Kopf und Kragen, denn Criminal Minds ist wie ein Spiel gegen einen unberechenbaren Gegner: Jeder Zug ist ungewiss und kann ein schnelles Schachmatt bedeuten.',NULL,'DEU','Criminal Minds','https://s3.amazonaws.com/schedulesdirect/assets/p185123_l_h3_aa.jpg',4,NULL),('SH021115670000','`Deutschland sucht den Kinderstar\' und junge Talente mit kreativen Songideen. Aus über 2.000 Bewerbungen wurden nun 15 junge Musiktalente ausgesucht, die ihre Kompositionen einer prominenten Jury vorstellen dürfen.',NULL,'DEU','Dein Song','https://json.schedulesdirect.org/20141201/image/assets/p11438148_i_h12_aa.jpg',4,NULL),('SH029665690000','Goldsucher Dakota und sein Sohn wollen mithilfe von erfahrenen Tauchern und Bergsteigern das Gold aus dem Boden holen, das sich am Grund des McKinley Creek befindet. Die beiden gehen auf volles Risiko und versuchen, was noch keiner geschafft hat.',NULL,'DEU','Goldrausch: White Water Alaska','https://s3.amazonaws.com/schedulesdirect/assets/p14928011_i_h12_aa.jpg',4,NULL),('SH020154370000','Mit Dieter Nuhr hat einer der profiliertesten deutschen Kabarettisten die Satiresendung übernommen und begrüßt in jeder Episoden bekannte Comedians und Unterhalter.',NULL,'DEU','Nuhr im Ersten','https://json.schedulesdirect.org/20141201/image/assets/p9428555_i_v3_aa.jpg',4,NULL),('SH030366630000','In der Serie präsentiert der Hundetrainer Jochen Bendel Tiere, die medizinische Hilfe oder Hilfe in der Veränderung einer Verhaltensweise benötigen, zum Beispiel wenn ein übergewichtiger Hund abnehmen muss oder eine Katze außer Rand und Band ist.',NULL,'DEU','Letzte Chance für 4 Pfoten','https://s3.amazonaws.com/schedulesdirect/assets/p15862754_st_h12_aa.jpg',4,NULL),('SH018580010000','Chris und Martin Kratt sind Brüder. Der Biologe und der Zoologe widmen ihre Zeit und ihr Leben dem Tierschutz und sind immer zur Stelle, wenn Tiere in Not geraten. Und so reisen sie um die ganze Welt, erleben ein spannendes Abenteuer nach dem anderen und lernen die exotischsten Tiere kennen.',NULL,'DEU','Go Wild! - Mission Wildnis','https://s3.amazonaws.com/schedulesdirect/assets/p8369911_i_v5_aa.jpg',4,NULL),('SH016398250000','In der Sendung müssen zwei Teams aus vorgegebenen Zutaten ein komplettes Menü zaubern. In mehreren Quizrunden können sie sich weitere Zutaten erspielen, mit denen sich vielleicht der kleine, aber feine Unterschied erkochen lässt.',NULL,'DEU','Topfgeldjäger','https://s3.amazonaws.com/schedulesdirect/assets/p9563656_b_h3_aa.jpg',4,NULL),('SH029979830000','Die Dokumentationsreihe begleitet unter anderem den Alltag der Mitarbeiter im Klinikum