','https://json.schedulesdirect.org/20141201/image/assets/p12057821_i_h3_aa.jpg',4,NULL),('SH023720810000','Der Sprössling von Simba und Nala, Kion, übernimmt das Kommando der `Löwengarde\'. Die Gruppe besteht aus klugen und mutigen Tieren der Steppe, die das Königreich beschützen sollen. Kion verstößt gegen die Tradition, weil er keine Löwen aufnimmt.',NULL,'DEU','Die Garde der Löwen','https://s3.amazonaws.com/schedulesdirect/assets/p12371444_i_h3_aa.jpg',4,NULL),('SH019577880000','Die Sendung informiert über das politische und kulturelle Leben in Hamburg und liefert Hintergrundinformationen zu besonderen Ereignissen. Auch der Sport in Hamburg sowie Heimatgeschichten aus dem Land sind Themen der Sendung.',NULL,'DEU','Hamburg Journal','https://json.schedulesdirect.org/20141201/image/assets/p10910696_i_h12_aa.jpg',4,NULL),('SH019897220000','Vier Freunde, ein Ziel: Sie wollen ihren eigenen Style finden und wagen ein spannendes Experiment.',NULL,'DEU','Du bist STYLE!','https://s3.amazonaws.com/schedulesdirect/assets/p11040055_b_h12_aa.jpg',4,NULL),('SH021397950000','Hund Gustav und seine Freunde wohnen in einem idyllischen Blaubeerwald. Dort erleben sie gemeinsam spannende Abenteuer.',NULL,'DEU','Gustavs Welt',NULL,4,NULL),('SH019692200000','Das aktuelle Wochenmagazin quer präsentiert ungewöhnliche Blicke auf das Zeitgeschehen. Kritisch und informativ, bissig und direkt, aber auch unterhaltsam präsentiert Moderator und Kabarettist Christoph Süß die Themen der Woche.',NULL,'DEU','quer','https://s3.amazonaws.com/schedulesdirect/assets/p10958185_b_v3_aa.jpg',4,NULL),('SH019690340000','Die Sendung informiert über Themen aus Politik, Wirtschaft, Gesellschaft und Kultur in der Schweiz.',NULL,'DEU','Schweizweit','https://s3.amazonaws.com/schedulesdirect/assets/p10957679_b_h12_aa.jpg',4,NULL),('SH019369690000','Der erfolgreiche Werbejingle-Komponist Charlie Harper genießt sein Junggesellen-Leben in seinem Haus am Strand von Malibu. Doch dann zieht sein Bruder, der schüchterne, frisch geschiedene Chiropraktiker Alan gemeinsam mit seinem Sohn Jake bei ihm ein. Den beiden gegensätzlichen Brüdern fällt das Zusammenleben nicht immer leicht, doch irgendwie müssen sie sich arrangieren. Als Charlie plötzlich stirbt, kauft der etwas weltfremde Internet-Milliardär Walden Schmidt das Strandhaus und zieht bei Alan und Jake ein. Nun ist es Alan, der seinem neuen, unerfahrenen Mitbewohner in allen Lebenslagen mit Rat und Tat zur Seite steht.',NULL,'DEU','Two and a Half Men','https://s3.amazonaws.com/schedulesdirect/assets/p8218909_b_v3_aa.jpg',4,NULL),('SH033227900000','Ein Single und fünf Menü-Vorschläge, hinter denen sich Blind Dates verbergen.',NULL,'DEU','Dinner Date','https://s3.amazonaws.com/schedulesdirect/assets/p17408304_b_h3_aa.jpg',4,NULL),('SH018442680000','Die am längsten laufende Krimiserie Deutschlands mit verschiedenen Ermittlerteams, die in unterschiedlichen deutschsprachigen Regionen tätig sind.',NULL,'DEU','Tatort','https://s3.amazonaws.com/schedulesdirect/assets/p10416816_b_h3_aa.jpg',4,NULL),('SH019426980000','Spannende Kriminalfälle werden erneut beleuchtet, um die Methoden der Aufklärung zu zeigen. Mithilfe von moderner Technik und erfahrenem Personal in der Gerichtsmedizin können selbst die schwierigsten Fälle geknackt werden.',NULL,'DEU','Autopsie - Mysteriöse Todesfälle','https://s3.amazonaws.com/schedulesdirect/assets/p10856625_b_h12_aa.jpg',4,NULL),('SH006921640000','Der Antiquar Georg Wilsberg ist permanent knapp bei Kasse. Oft muss er seine Freunde finanziell um Hilfe bitten. Um noch etwas dazuzuverdienen, nimmt er Aufträge als Privatdetektiv an. Bald spannt er auch seine Freunde in die Ermittlungen ein.',NULL,'DEU','Wilsberg','https://json.schedulesdirect.org/20141201/image/assets/p530512_i_v5_aa.jpg',4,NULL),('SH021211450000','Als die Erde vor 97 Jahren bei einer nuklearen Katastrophe zerstört und fast die gesamte Menschheit ausgelöscht wurde, haben die wenigen Überlebenden sich auf eine internationale Raumstation, die Ark, gerettet. Dort wurde nun bereits die dritte Generation geboren und Platz sowie Ressourcen werden immer knapper. Also beschließt die Ark, dass extreme Maßnahmen ergriffen werden müssen, um das Überleben der Menschheit zu sichern. 100 jugendliche Straftäter werden auf die Erde entsandt, um herauszufinden, ob der Planet wieder bewohnbar ist. Bereits die Ankunft verläuft jedoch problematisch, und auf der Erde geraten die Jugendlichen schon bald in große Gefahr.',NULL,'DEU','The 100','https://s3.amazonaws.com/schedulesdirect/assets/p9980543_l_h3_aa.jpg',4,NULL),('SH019871220000','Mit Ironie und Absurdität skizziert jede Folge einen Zeitgeist, der Schlagzeilen macht.',NULL,'DEU','(Fast) Die ganze Wahrheit','https://json.schedulesdirect.org/20141201/image/assets/p11005288_i_h3_aa.jpg',4,NULL),('SH019659210000','Das Kulturmagazin des MDR mit Themen aus der Pop- und Hochkultur.',NULL,'DEU','artour','https://json.schedulesdirect.org/20141201/image/assets/p10945152_b_h12_aa.jpg',4,NULL),('SH020305500000','Der Kurs bietet die Möglichkeit, vorhandene Englischkenntnisse aufzufrischen und zu vertiefen. Die Sendungen des Kurses sind rein englischsprachig. Die Begleitbücher geben aber deutschsprachige Hinweise und Anleitungen.',NULL,'DEU','TELEKOLLEG Englisch','https://s3.amazonaws.com/schedulesdirect/assets/p11176247_st_h12_aa.jpg',4,NULL),('SH014788580000','VITAFORM liefert Schuhe, die optischen Charme und fühlbaren Komfort miteinander vereinen.',NULL,'DEU','Vitaform Schuhkollektion','https://s3.amazonaws.com/schedulesdirect/assets/p8858376_st_h12_aa.jpg',4,NULL),('SH016391880000','Die Sendung berichtet wöchentlich über politische Themen und aktuelle Geschehnisse aus aller Welt.',NULL,'DEU','auslandsjournal','https://s3.amazonaws.com/schedulesdirect/assets/p9561764_b_h12_aa.jpg',4,NULL),('SH018558720000','Das Magazin berichtet von aktuellen Ereignissen in der Welt der Prominenten.',NULL,'DEU','Exclusiv - Das Starmagazin','https://s3.amazonaws.com/schedulesdirect/assets/p10458817_b_v3_aa.jpg',4,NULL),('SH019971100000','Zwei völlig unterschiedliche Brüder - der Naturbursche Robbie und der `City Slicker\' Stephen - führen gemeinsam eine Reptilien-Farm in den Everglades in Florida. Stephen wäre lieber in New York geblieben, Robbie fühlt sich auf der Familienfarm wohl.',NULL,'DEU','Swamp Brothers - Zwei Brüder aus\'m Sumpf','https://json.schedulesdirect.org/20141201/image/assets/p8609859_i_v3_aa.jpg',4,NULL),('SH021739210000','Die Sendereihe ist ein als Fernsehspiel in Fortsetzungen angelegter Sprachkurs, der zum Erlernen der französischen Sprache ermuntern und Grundkenntnisse vermitteln oder auffrischen soll. Er wurde als ein Beitrag zum Kulturabkommen entwickelt.',NULL,'DEU','Les Gammas','https://s3.amazonaws.com/schedulesdirect/assets/p11727496_b_h12_aa.jpg',4,NULL),('SH019370140000','Dr. Leonard Leakey Hofstadter und Dr. Sheldon Cooper sind geniale Physiker, arbeiten im selben Institut und teilen sich eine Wohnung. Im Umgang mit der sozialen Umwelt hingegen hat vor allem Sheldon seine Schwierigkeiten. Zu ihrem Freundeskreis gehören Dr. Rajesh Ramayan Koothrappali und der Ingenieur Howard Wolowitz. Als die hübsche Penny in die Wohnung nebenan einzieht, kann sie zunächst nicht viel mit den merkwürdigen Wissenschaftlern, die ihre Freizeit am liebsten im Comicbuchladen und Halo oder World of Warcraft spielend verbringen, anfangen. Nach einer Weile wächst ihr die Gruppe aber ans Herz.',NULL,'DEU','The Big Bang Theory','https://s3.amazonaws.com/schedulesdirect/assets/p185554_l_h3_aa.jpg',4,NULL),('SH019734540000','Der Millionär Jonathan Hart und seine Frau Jennifer, eine abenteuerlustige Journalistin, reisen um die Welt und werden immer wieder unfreiwillig in Kriminalfälle verwickelt. Gemeinsam machen sie es sich zur Aufgabe, diese zu lösen.',NULL,'DEU','Hart aber herzlich','https://s3.amazonaws.com/schedulesdirect/assets/p184377_i_v3_aa.jpg',4,NULL),('SH016889010000','Die Sendung `ZDFzeit\' zeigt Dokumentationen mit einem breiten Spektrum an zeitgeschichtlichen sowie historischen, wirtschaftlichen und politischen Themen.',NULL,'DEU','ZDFzeit','https://s3.amazonaws.com/schedulesdirect/assets/p9745829_b_h3_aa.jpg',4,NULL),('SH020614500000','Highlights und Zusammenfassungen vom Fechten.',NULL,'DEU','Fechten','https://json.schedulesdirect.org/20141201/image/assets/p8366432_b_h12_ab.jpg',4,NULL),('SH029647210000','Die Bundesautobahn 2 zählt zu wichtigsten Verkehrsadern Deutschlands. Die Route verbindet große Industriestandorte im Ruhrgebiet und den Beneluxstaaten mit Osteuropa. Gezeigt werden Menschen, die in der Nähe leben und arbeiten.',NULL,'DEU','A2 - Abenteuer Autobahn','https://s3.amazonaws.com/schedulesdirect/assets/p15494227_b_h12_aa.jpg',4,NULL),('SH029850720000','Die Sendung befasst sich mit den zentralen Fragen und Entwicklungen der Demokratie in einer unruhigen Welt. Sie geht über die Aktualität hinaus und hinterfragt unter anderem Begriffe, die täglich in den Nachrichten vorkommen.',NULL,'DEU','alpha-Demokratie-Weltweit','https://s3.amazonaws.com/schedulesdirect/assets/p15604078_st_h12_aa.jpg',4,NULL),('SH020128250000','Mike Baxter ist der Marketing-Chef einer bekannten Sportartikelfirma und ist geschäftlich viel und gern auf Reisen. Anders als in seinem beruflichem Umfeld, wo er als echter Kerl gilt, ist die Situation für den männlichen Mike allerdings zu Hause. Dort haben nämlich vier Frauen das Sagen.',NULL,'DEU','Last Man Standing','https://s3.amazonaws.com/schedulesdirect/assets/p8679132_l_h3_ab.jpg',4,NULL),('SH019403270000','Die Nachrichtensendung ist speziell für Acht- bis Zwölfjährige ausgelegt, und berichtet über relevante Themen aus Europa und der ganzen Welt. In jeder Sendung stellen deutsche oder französische Schüler Fragen zu einem aktuellen Thema.',NULL,'DEU','Arte Journal Junior','https://s3.amazonaws.com/schedulesdirect/assets/p10850057_b_v3_aa.jpg',4,NULL),('SH029543580000','Dr. Herbert Dreesen ist Veterinär. Gemeinsam mit seinem Team kümmert er sich auf einem Pferdehof im Bergischen Land und in seiner Praxis um kranke und verletzte Tiere. Zugleich gewährt der Tierarzt ein Blick in sein Privatleben.',NULL,'DEU','Praxis Dr. Dreesen - Ein Hof für Tiere','https://s3.amazonaws.com/schedulesdirect/assets/p15443359_st_h12_aa.jpg',4,NULL),('SH023568700000','Man sagt, Menschen aus dem Ruhrgebiet tragen das `Herz auf der Zunge\'. Die Sozialdokumentation begleitet vier Monate lang den teilweise beklemmenden Alltag von Menschen aus dem Ruhrgebiet, die aber immer das Herz am richtigen Fleck tragen.',NULL,'DEU','Hartz und herzlich','https://s3.amazonaws.com/schedulesdirect/assets/p12553832_st_h12_aa.jpg',4,NULL),('SH032357130000','Diskutiert wird mit dem Publikum über ein Streitthema, das aufregt, polarisiert und bewegt.',NULL,'DEU','Wir müssen reden!','https://json.schedulesdirect.org/20141201/image/assets/p16972282_st_h12_aa.jpg',4,NULL),('SH032161810000','Die Siedler der Anastasia-Bewegung sehen aus wie Hippies und Öko-Aussteiger, doch bei so manchem verbirgt sich hinter der grünen Fassade eine völkische, braune Ideologie.',NULL,'DEU','Kontraste - Die Reporter','https://s3.amazonaws.com/schedulesdirect/assets/p16856557_st_h12_aa.jpg',4,NULL),('SH019690030000','Gemeinsam mit dem Fuchs bereist der kleine Prinz in der Serie insgesamt 24 Planeten. Auf dem Weg in ferne Galaxien folgt er der hinterlistigen Schlange, die überall Unheil sät. Der Prinz hilft den Bewohnern, die Gefahren abzuwenden.',NULL,'DEU','Der kleine Prinz','https://json.schedulesdirect.org/20141201/image/assets/p9036350_i_v3_aa.jpg',4,NULL),('SH019617580000','Der kleine Bauernjunge Trenk Tausendschlag lebt im Mittelalter und erlebt einige Abenteuer.',NULL,'DEU','Der kleine Ritter Trenk','https://s3.amazonaws.com/schedulesdirect/assets/p9679011_b_h12_aa.jpg',4,NULL),('SH019383520000','Fünf Kandidatinnen treten an, um die Frau mit dem besten Stil zu werden. Am Anfang der jeweiligen Woche werden die Aufgabe und das Budget bekanntgegeben. Jede der Teilnehmerinnen hat vier Stunden Zeit. Dieses Mal ist Svetlana an der Reihe.',NULL,'DEU','Shopping Queen','https://json.schedulesdirect.org/20141201/image/assets/p10842180_st_h12_aa.jpg',4,NULL),('SH031747090000','Die RTL II-Sozialreportage begleitet die Polizei beim Einsatz in deutschen Brennpunktvierteln und zeigt ihren unermüdlichen Kampf gegen die Kriminalität.',NULL,'DEU','Hartes Deutschland - Leben im Brennpunkt','https://s3.amazonaws.com/schedulesdirect/assets/p16650997_st_h12_ab.jpg',4,NULL),('SH027485190000','Die Dokumentarreihe begleitet die Grenzschützer Spaniens bei ihrer täglichen Verbrechensbekämpfung. Rund um die Uhr sind die Männer und Frauen im Einsatz, um Drogenhändlern, Schlepperbanden und Schmugglern zuvorzukommen.',NULL,'DEU','Border Control - Spaniens Grenzschützer','https://s3.amazonaws.com/schedulesdirect/assets/p13272827_i_h12_aa.jpg',4,NULL),('SH019969210000','In der mittäglichen Service-Sendung wird gekocht, gegärtnert und gebastelt. Im wöchentlichen Wechsel geben die Moderatoren Tipps für ein schöneres Zuhause, lassen Starköche leckere Menüs zubereiten und beantworten mit Experten Zuschauerfragen.',NULL,'DEU','ARD-Buffet','https://json.schedulesdirect.org/20141201/image/assets/p10414039_i_v5_aa.jpg',4,NULL),('SH024603180000','Der elfjährige Lincoln lebt ein chaotisches Leben. Grund dafür sind seine zehn Schwestern.',NULL,'DEU','Willkommen bei den Louds','https://json.schedulesdirect.org/20141201/image/assets/p12753730_i_h12_aa.jpg',4,NULL),('SH026904260000','Die zwei Gastgeber Charlotte und Bear stellen Beziehungen auf die Probe, indem sie Paare und Freunde Tattoos füreinander entwerfen lassen. Sie sehen die Ergebnisse jedoch erst, wenn sie bereits auf der Haut verewigt wurden.',NULL,'DEU','Just Tattoo Of Us','https://s3.amazonaws.com/schedulesdirect/assets/p13823506_i_h12_aa.jpg',4,NULL),('SH033831270000','Das Boss Baby braucht Hilfe von Tim, seinem Bruder und Verbündeten. Er tut sich schwer die richtige Work-Life-Balance zu finden, und das Familienleben mit seinem Job beim Baby Corp. Hauptquartier unter einen Hut zu bekommen.',NULL,'DEU','The Boss Baby: wieder im Geschäft','https://s3.amazonaws.com/schedulesdirect/assets/p15289801_i_h12_ac.jpg',4,NULL),('SH020657010000','Frank Reagan ist Chef der Polizei von New York. Der Witwer folgt damit seinem Vater, der diese Behörde früher ebenfalls leitete und mit seinem Wissen und seinen Kontakten immer wieder hilfreich zur Seite steht. Der Kampf gegen das Verbrechen ist für die Reagans also kein bloßer Job sondern eine regelrechte Familienangelegenheit. Denn auch Franks Tochter Erin und seine Söhne Daniel und Jamison sind schon Träger der typischen blauen Polizeiuniformen.',NULL,'DEU','Blue Bloods - Crime Scene New York','https://s3.amazonaws.com/schedulesdirect/assets/p8130493_i_h12_ab.jpg',4,NULL),('SH019691990000','Das Magazin berichtet über Entwicklungen in Politik, Gesellschaft und Kultur Sloweniens.',NULL,'DEU','Slowenien Magazin','https://s3.amazonaws.com/schedulesdirect/assets/p10958089_b_h3_ab.jpg',4,NULL),('SH015401980000','Bei Tele-Gym werden verschiedene Gymnastikübungen vor der Kamera präsentiert. Die Athleten fordern die Zuschauer vor dem Bildschirm auf die Übungen mitzumachen. Es gibt Sendungen mit verschiedenen Schwerpunkten, wie beispielsweise Rückentraining.',NULL,'DEU','Tele-Gym','https://s3.amazonaws.com/schedulesdirect/assets/p9125740_b_h12_aa.jpg',4,NULL),('SH032474630000','Die meisten französischen Großstädte - und insbesondere Paris - befinden sich seit den letzten Terroranschlägen in ständiger Alarmbereitschaft.',NULL,'DEU','Alarm! Bombenentschärfer im Einsatz','https://s3.amazonaws.com/schedulesdirect/assets/p15596837_i_h12_aa.jpg',4,NULL),('SH024268150000','In der medizinischen Ratgebersendung behandelt Dr. Johannes Wimmer vom Universitätskrankenhaus Hamburg alltagsrelevante Themen rund um Medikamente und Gesundheit. Er gibt Tipps, wie sich die Zuschauer im Medizindschungel zurechtfinden.',NULL,'DEU','Dr. Wimmer: Wissen ist die beste Medizin','https://json.schedulesdirect.org/20141201/image/assets/p12876075_i_h3_aa.jpg',4,NULL),('SH026720770000','Die Sendung informiert über aktuelle Ratgeber- und Wirtschaftsthemen aus der Region Berlin und Brandenburg. Im Mittelpunkt des Reportage-Magazins steht der hohe Nutzwert für die Verbraucher und ihre Sparmöglichkeiten im Allgemeinen.',NULL,'DEU','Super.Markt','https://s3.amazonaws.com/schedulesdirect/assets/p14050639_st_h12_aa.jpg',4,NULL),('SH006921700000','Die Kommissare des Polizeirufs 110 haben immer Fälle, die einer Aufklärung bedürfen. Dabei ermitteln die Polizisten eine ganze Bandbreite an Verbrechen mit den unterscheidlichsten Motiven: von Beziehungstat, Verzweiflungsakt oder Racheakt. Die Ermittler finden immer heraus, was sich hinter den Fassaden und Gartenzäunen abspielt.',NULL,'DEU','Polizeiruf 110','https://s3.amazonaws.com/schedulesdirect/assets/p466463_b_v3_aa.jpg',4,NULL),('SH025072440000','Der Physiker und ehemalige Astronaut Professor Dr. Ulrich Walter ergründet die Geheimnisse in den Tiefen des Universums. Was die Faszination am ungewissen Weiten auslöst, versucht er, mittels der Wissenschaft herauszufinden.',NULL,'DEU','Spacetime','https://s3.amazonaws.com/schedulesdirect/assets/p13261579_st_h12_aa.jpg',4,NULL),('SH034164950000','Der Moderator stellt neue, teilweise noch unbekannte Erfindungen vor und spricht mit den klugen Köpfen hinter den Innovationen. Manche der Erfindungen sind kurios, andere zukunftsweisend und bahnbrechend; innovative Geschichten haben sie alle.',NULL,'DEU','Big Brains - Geniale Erfindungen','https://s3.amazonaws.com/schedulesdirect/assets/p17819629_st_h12_aa.jpg',4,NULL),('SH029099400000','Die Kandidaten der Spielshow nehmen an einer großen WG-Party in Prag teil und müssen dort gegeneinander antreten. Aufgeteilt in drei Teams müssen sie verrückte und aufregende Aufgaben lösen, um hohe Preisgelder zu gewinnen.',NULL,'DEU','The Challenge','https://json.schedulesdirect.org/20141201/image/assets/p13755455_i_h3_aa.jpg',4,NULL),('SH032666900000',NULL,NULL,'DEU','DMAX News','https://s3.amazonaws.com/schedulesdirect/assets/p17121862_st_h12_aa.jpg',4,NULL),('SH019758060000','Das Wirtschaftsmagazin wirft einen eigenständigen Blick auf das Wirtschaftsleben in der Schweiz und im Ausland. Mit zahlreichen Hintergrundberichten, anschaulichen Grafiken und ausführlichen Reportagen werden aktuelle Themen vorgestellt.',NULL,'DEU','ECO','https://json.schedulesdirect.org/20141201/image/assets/p10984244_i_h12_aa.jpg',4,NULL),('SH030263450000','In der Serie bekommen Besitzer von potenziell wertvollen Gegenständen die Chance, diese an professionelle Händler und Sammler zu veräußern. Unter diesen Sachen befindet sich alles, was ein Zuhause inklusive Garage hergibt.',NULL,'DEU','Die Superhändler - 4 Räume, 1 Deal','https://s3.amazonaws.com/schedulesdirect/assets/p15813130_st_h12_ac.jpg',4,NULL),('SH021288230000','Die Vierlinge Nicky, Ricky, Dicky und Dawn haben außer ihrem Geburtsdatum und ihren Eltern nicht viel gemeinsam. Da lässt der Streit unter Geschwistern nicht lange auf sich warten. Doch wenn es sein muss, halten die vier Geschwister zusammen.',NULL,'DEU','Nicky, Ricky, Dicky & Dawn','https://s3.amazonaws.com/schedulesdirect/assets/p10916406_i_v3_aa.jpg',4,NULL),('SH034340700000',NULL,NULL,'DEU','75 Jahre Zerstörung Dresdens','https://s3.amazonaws.com/schedulesdirect/assets/p17912660_st_h12_aa.jpg',4,NULL),('SH019734590000','Patrick Jane ist ein TV-Star und vermeintlicher Zauberer. Er gibt vor, mit Geistern kommunizieren zu können. Doch nachdem der Verbrecher Red John seine Frau und seine Tochter ermordert, hängt er die Karriere als Mentalist an den Nagel. Nach einigen Jahren in der geschlossenen Anstalt beschließt Jane, den Mörder seiner Familie zur Strecke zu bringen. Dafür arbeitet er als Berater des California Bureau of Investigation. Mit seiner bemerkenswerten Menschenkenntnis und Auffassungsgabe schafft er es, knifflige Fälle spielerisch zu lösen. Dabei helfen ihm Teresa Lisbon, Kimball Cho, Wayne Rigsby und Grace Van Pelt. Sein wahres Ziel, Red John zu finden, verliert er nie aus den Augen.',NULL,'DEU','The Mentalist','https://s3.amazonaws.com/schedulesdirect/assets/p186597_l_h3_aa.jpg',4,NULL),('SH019374330000','Unterhaltsam und informativ geht das Magazin aktuellen, skurrilen und alltäglichen Phänomenen auf den Grund. Menschen mit besonderen Fähigkeiten, Orte mit besonderen beziehungsweise mysteriösen Bedeutungen werden vorgestellt. Die Sendung erklärt außerdem in kurzen Filmbeiträgen nützliche Erfindungen, interessante Redewendungen, stellt neue Trends aus dem Internet vor und prüft den Wahrheitsgehalt allgemein bekannter Tatsachen. Weitere Elemente sind unter anderem waghalsigen Elemente, das `Wort der Woche\', die `Zahl des Tages\' sowie viele praktische Tipps und Anleitungen zum Nachmachen, Nacherleben und Nachbauen.',NULL,'DEU','Galileo','https://s3.amazonaws.com/schedulesdirect/assets/p10838152_b_h3_aa.jpg',4,NULL),('SH026983580000','Die Serie zeigt die spektakulärsten und tödlichsten Kämpfe des Zweiten Weltkriegs unter Wasser.',NULL,'DEU','Kriegshölle unter Wasser','https://s3.amazonaws.com/schedulesdirect/assets/p12747367_i_h12_aa.jpg',4,NULL),('SH019980690000','Wissenschaftler stellen dar, warum mancherlei Experimente anders ausgehen als geplant. Dazu zeigen verrückte und waghalsige Videos, auf welche Art und Weise man sich blamieren, verletzen, erniedrigen und auch komplett lächerlich machen kann.',NULL,'DEU','Science of Stupid: Wissenschaft der Missgeschicke','https://json.schedulesdirect.org/20141201/image/assets/p11068138_i_h12_aa.jpg',4,NULL),('SH015933460000','Die Kommissare, ein alteingesessener oberbayerischer Ermittler und sein Kollege aus der Großstadt, könnten unterschiedlicher nicht sein. Dennoch ergänzen sie sich, wenn es darum geht, besonders knifflige Fälle in der Umgebung von Rosenheim zu lösen.',NULL,'DEU','Die Rosenheim-Cops','https://s3.amazonaws.com/schedulesdirect/assets/p9370385_b_v3_aa.jpg',4,NULL),('SH022554840000','Das Küstenmotorschiff `Henr