4,NULL),('SH020041940000','Die Enten SwaySway und Buhdeuce leben auf dem größtenteils mit Wasser bedeckten Planeten Teichea und liefern Brot an ihre treuen Kunden aus. Dabei geraten sie immer wieder in federsträubende Situationen.',NULL,'DEU','Die Brotpiloten','https://s3.amazonaws.com/schedulesdirect/assets/p10500437_i_v5_aa.jpg',4,NULL),('SH015443360000','Christian Ehring zeigt den Irrsinn der Woche in diesem politischen Satiremagazin mit ironischen Beiträgen und Reportagen.',NULL,'DEU','extra 3','https://s3.amazonaws.com/schedulesdirect/assets/p9145343_b_h12_aa.jpg',4,NULL),('SH018442530000','Abenteuer der Tierarzt-Familie Hansen und der Familie Grieshaber.',NULL,'DEU','Tiere bis unters Dach','https://json.schedulesdirect.org/20141201/image/assets/p10416787_i_h12_aa.jpg',4,NULL),('SH015445920000','Das Filmmagazin stellt die wichtigsten Neustarts und Themen aus der Filmwelt vor. Das Magazin zeigt Porträts und Interviews mit Schauspielern und Regisseuren. Es werden die Tops und Flops kritisiert und von den spannendsten Festivals berichtet.',NULL,'DEU','kinokino','https://s3.amazonaws.com/schedulesdirect/assets/p9146320_b_h12_aa.jpg',4,NULL),('SH018201690000','Wegen eines tragischen Todesfalls in der Familie kehrt Katharina Lenz in ihre Heimat zurück und übernimmt die Leitung des sanierungsbedürftigen Gestüts.',NULL,'DEU','Das Glück dieser Erde','https://s3.amazonaws.com/schedulesdirect/assets/p10319266_b_h3_aa.jpg',4,NULL),('SH021754930000','Spektakuläre Tieraufnahmen und faszinierende Landschaften: Die Doku-Reihe nimmt den Zuschauer mit auf eine Reise durch die vielfältigen Nationalparks Nordamerikas. In Gebirgen, Schluchten und Flüssen bis hin zu den arktischen Gletschern zeigt die Serie die beeindruckende Flora und Fauna der amerikansichen Naturschutzgebiete, vom Grand Canyon über die Everglades bis hin zum arktischen Polarkreis.',NULL,'DEU','Amerikas Naturwunder','https://json.schedulesdirect.org/20141201/image/assets/p11733546_st_h12_aa.jpg',4,NULL),('SH019375120000','Die Moderatoren präsentieren die aktuellsten Nachrichten und Themen, die die Welt bewegen.',NULL,'DEU','Prosieben Spätnachrichten','https://s3.amazonaws.com/schedulesdirect/assets/p10838387_b_h12_aa.jpg',4,NULL),('SH033956960000','Eine neue Generation Shinobis betritt die Bühne - angeführt von Narutos und Hinatas Sohn, Boruto.',NULL,'DEU','Boruto','https://s3.amazonaws.com/schedulesdirect/assets/p14008893_i_s2_aa.jpg',4,NULL),('SH026861390000','Seit 1955 informiert das österreichische Nachrichtenjournal am Vorabend über die aktuellen Geschehnisse und Ereignisse auf der ganzen Welt. Außerdem werden Expertenanalysen und Entwicklungen auf den Finanzmärkten vorgestellt.',NULL,'DEU','ZIB','https://s3.amazonaws.com/schedulesdirect/assets/p14109433_st_h12_aa.jpg',4,NULL),('SH024229090000','Die Sendung zeigt aktuelle Berichte aus Bayern, Hintergründe zu brisanten Themen und Geschichten, die unter die Haut gehen. Außerdem werden aktuelle Ratgeber zu Kultur- und Musikveranstaltungen gezeigt sowie Gäste in das Studio eingeladen.',NULL,'DEU','Abendschau','https://json.schedulesdirect.org/20141201/image/assets/p12853352_b_h12_aa.jpg',4,NULL),('SH020364790000','Exzentrische Schauspieler, ein selbstverliebter Show-Star und ein neuer Produzent, der überall mitmischt: Diese Dinge gehören zum Arbeitsalltag von Liz Lemon, der Drehbuchautorin der Comedy-Sendung `The Girlie Show\'. Dabei kommt sich die Mitdreißigerin regelmäßig mit ihrem Vorgesetzten Jack Donaghy in die Haare. Donaghy ist sehr daran interessiert, das TV-Format umzustrukturieren. Als er den aufgedrehten Tracy Jordan mit ins Boot holt, wird die Sendung in `TGS with Tracy Jordan\' umbenannt. Wenngleich sich Liz und Jack häufig streiten, entsteht zwischen ihnen eine tiefe Freundschaft.',NULL,'DEU','30 Rock','https://json.schedulesdirect.org/20141201/image/assets/p185203_l_h3_aa.jpg',4,NULL),('SH019973300000','Die interaktive Fernsehsendung, bei der die Zuschauer via Chat während der Live-Sendung Fragen an die Gäste im Studio gestellt werden können.',NULL,'DEU','heute+','https://json.schedulesdirect.org/20141201/image/assets/p11066742_i_h12_aa.jpg',4,NULL),('SH019571620000','Micky Maus und seine Freunde helfen Kindern, Rechnen und Kombinieren zu verstehen. Im `Micky Maus Wunderhaus\' steht ein Computer, der für Micky und seine Freunde eine Aufgabe stellt, die es zu lösen gilt.',NULL,'DEU','Disneys Micky Maus Wunderhaus','https://s3.amazonaws.com/schedulesdirect/assets/p186176_i_v5_aa.jpg',4,NULL),('SH019586670000','Die Nachrichtensendung mit den aktuellsten Neuigkeiten aus Politik, Gesellschaft und Kultur aus und für Brandenburg. Moderiert wird die Sendung von Tatjana Jury.',NULL,'DEU','Brandenburg aktuell','https://json.schedulesdirect.org/20141201/image/assets/p10914762_i_h12_aa.jpg',4,NULL),('SH018456820000','Klara Degen, die Sekretärin von Kommissar Paul Kleinert löst die schwierigsten Fälle der Polizei.',NULL,'DEU','Alles Klara','https://json.schedulesdirect.org/20141201/image/assets/p10422581_i_h12_ab.jpg',4,NULL),('SH026160800000','Was ursprünglich in der industriellen Reinigung verwendet wurde, ist inzwischen auch für den Haushalt weiterentwickelt worden. Moderne Geräte sollen den Alltag im Haushalt wesentlich effektiver gestalten und zugleich weniger Aufwand verursachen.',NULL,'DEU','Reinigungslösungen von ABACUS','https://s3.amazonaws.com/schedulesdirect/assets/p13787797_st_h12_aa.jpg',4,NULL),('SH022416050000','Sammy und Ray sind zwei Wasserschildkröten, die glücklich mit ihren Freunden und Verwandten unter Wasser leben. Um stets vor Feinden geschützt zu sein, bewohnen sie ein Korallenriff. Als Leittier und Mentor der Gemeinschaft gibt Sammy sein Wissen an seine Enkelin Ella weiter. Ella ist aber viel zu abenteuerlustig, um auf den Rat ihres Opas zu hören und sich nur im sicheren Riff aufzuhalten. Gemeinsam mit ihrem besten Freund Ricky, dem quirligen Krakenmädchen Annabel, dem stets miesgelaunten Pipo und dem redseligen Teufelsfisch Harald erkunden die jungen Meeresbewohner den Ozean und erleben dabei jede Menge Abenteuer.',NULL,'DEU','Sammy: Kleine Flossen, große Abenteuer','https://s3.amazonaws.com/schedulesdirect/assets/p11005558_b_h12_ad.jpg',4,NULL),('SH023294490000','Die Serie begleitet Hauskäufer bei ihrer Suche nach dem idealen Eigenheim in den Rocky Mountains.',NULL,'DEU','Haus gesucht in den Rocky Mountains','https://json.schedulesdirect.org/20141201/image/assets/p11836675_i_h12_aa.jpg',4,NULL),('SH015403810000','Das Magazin beobachtet, hinterfragt, erklärt und bewertet die aktuelle Medienberichterstattung.',NULL,'DEU','Zapp','https://json.schedulesdirect.org/20141201/image/assets/p9126507_i_h12_aa.jpg',4,NULL),('SH024546270000','Die Region Südtirol beginnt am Brennerpass an der Grenze zu Österreich. Die Reise führt durch den Gebirgszug der Dolomiten, durch den Vinschgau, macht Station in der Metropole Bozen und der Kurstadt Meran und endet am Kalterer See.',NULL,'DEU','Südtirol','https://s3.amazonaws.com/schedulesdirect/assets/p13006043_b_h12_aa.jpg',4,NULL),('SH025829710000','Rund um die Uhr befinden sich etwa 20 Millionen Schiffscontainer auf den Meeren weltweit. Damit verbunden ist eine kaum vorstellbare Logistikleistung. Die Sendung blickt hinter die Kulissen der Branche, in der unter enormem Zeitdruck gearbeitet wird.',NULL,'DEU','Mega Shippers - Die Profis vom Frachthafen','https://s3.amazonaws.com/schedulesdirect/assets/p12910858_i_h12_aa.jpg',4,NULL),('SH019640170000','Nach einem Überfall strandet eine Gruppe von Wissenschaftlern, Zivilisten und Soldaten an Bord des außerirdischen Forschungsschiffes Destiny. Unter der Leitung von Dr. Nicholas Rush und Colonel Everett Young stellen sie fest, dass sich das Schiff auf einem offenbar vorprogrammierten Kurs durch das Weltall befindet und ein Verlassen nur während der eingeplanten Zwischenstopps möglich ist, die sie zu immer neuen Planeten und Spezies führen.',NULL,'DEU','Stargate Universe','https://s3.amazonaws.com/schedulesdirect/assets/p7829886_b_v5_aa.jpg',4,NULL),('SH033425940000','Prominente Rategäste treten gegen die drei besten deutschen `Quizduell\'-Spieler an.',NULL,'DEU','Quizduell - Olymp','https://s3.amazonaws.com/schedulesdirect/assets/p13014615_i_h3_aa.jpg',4,NULL),('SH034164830000','Die Camping-Industrie bietet alles; vom spartanischen VW-Bus bis hin zum luxuriösen Heim auf Rädern. Das Gefühl der Freiheit und des Abenteuers lockt die Urlauber; die Sendung dokumentiert die Erfahrungen begeisterter und leidenschaftlicher Camper.',NULL,'DEU','Mein Zuhause hat vier Räder','https://json.schedulesdirect.org/20141201/image/assets/p17819493_st_h12_aa.jpg',4,NULL),('SH032951670000','Typische Mädchendinge wie Regenbögen und insbesondere Einhörner haben Alice noch nie interessiert. Doch dann wird ein echtes Einhorn zu ihrem allerbesten Freund. Dieses stellt sicher, dass Alice ein bisschen Spaß in ihrem Leben hat.',NULL,'DEU','Immer dieses Einhorn','https://s3.amazonaws.com/schedulesdirect/assets/p15842701_i_h12_ab.jpg',4,NULL),('SH019799660000','Das Tiermagazin des MDR stellt jede Woche ein Tierheim mit einigen seiner Bewohner vor, die eine neue Bleibe suchen.',NULL,'DEU','Tierisch tierisch','https://s3.amazonaws.com/schedulesdirect/assets/p11002087_b_h12_aa.jpg',4,NULL),('SH019672560000','Offenes journalistisches Format mit Themen aus Kultur und Wissenschaft.',NULL,'DEU','scobel','https://json.schedulesdirect.org/20141201/image/assets/p10950695_i_h3_aa.jpg',4,NULL),('SH032352750000','Die meisten französischen Großstädte - und insbesondere Paris - befinden sich seit den letzten Terroranschlägen in ständiger Alarmbereitschaft. Bombenentschärfer leben nach Tausenden von Aufrufen in ständiger Bereitschaft, verdächtige Objekte zu sichern und zu untersuchen. Sie inspizieren sensible und gefährdete Orte. Dafür stehen ihnen die modernsten Mittel zur Verfügung. Die Dokumentation begleitet das Bombenkommando bei seiner gefährlichen Arbeit und taucht in die Geschichte und das täglich.',NULL,'DEU','Alarm! Bombenentschärfer im Einsatz','https://s3.amazonaws.com/schedulesdirect/assets/p16969147_st_h12_aa.jpg',4,NULL),('SH020705430000','Der Kater mit Hut erlebt jede Menge Abenteuer mit seien Nachbarn und Sally, dem Fisch.',NULL,'DEU','Der Kater mit Hut','https://s3.amazonaws.com/schedulesdirect/assets/p8192813_i_h3_aa.jpg',4,NULL),('SH020140110000','Zusammenfassungen, Highlights und Rückblicke aus der Welt des Darts.',NULL,'DEU','Darts','https://json.schedulesdirect.org/20141201/image/assets/p3509440_i_h12_aa.jpg',4,NULL),('SH026964070000','Schon zu Highschool-Zeiten ist Flint Lockwood begeistert von der Wissenschaft und träumt davon, ein großer und genialer Erfinder zu werden. Doch wirklich erfolgreich ist der Nachwuchserfinder noch nicht, seine Experimente gehen meist schief.',NULL,'DEU','Cloudy With a Chance of Meatballs','https://s3.amazonaws.com/schedulesdirect/assets/p13542280_i_v5_ab.jpg',4,NULL),('SH019961850000','Ein mysteriöser Außerirdischer in menschlicher Gestalt namens `Doktor\' reist in seinem Raumschiff durch Zeit und Raum. Dabei erforscht er unterschiedliche Lebensformen, kann Ereignisse in der Vergangenheit beeinflussen und trifft auf kuriose Gestalten. Damit er sich im Universum nicht zu einsam fühlt, lädt er regelmäßig verschiedene Begleiter auf sein Raumschiff ein, die mit ihm weiterreisen. Doch er hat auch Feinde, die gelegentlich seinen Weg kreuzen, ihm jedoch nichts anhaben können. Denn der `Doktor\' besitzt die Fähigkeit, sich komplett zu regenerieren.',NULL,'DEU','Doctor Who','https://s3.amazonaws.com/schedulesdirect/assets/p185271_b_v5_ai.jpg',4,NULL),('SH027846800000','In den `Goldenen 20er Jahren\', einer Zeit des Umbruchs, wird der junge Kommissar Gereon Rath aus Köln nach Berlin versetzt. Seine Ermittlungen in der Reichshauptstadt führen ihn in einen Sumpf aus Drogen, Korruption, Kunst und Extremismus.',NULL,'DEU','Babylon Berlin','https://s3.amazonaws.com/schedulesdirect/assets/p14585508_st_h12_aa.jpg',4,NULL),('SH015402960000','Zoogeschichten aus München: Alltag, Sorgen und Erfolge der Zoobewohner und ihrer Pfleger. Die Zuschauer bekommen einen Einblick in den Alltag der Tierpfleger, ihre Beziehung zu ihren Schützlingen und erfahren mehr über die verschiedenen Tierarten.',NULL,'DEU','Nashorn, Zebra & Co.','https://s3.amazonaws.com/schedulesdirect/assets/p9126166_b_h3_aa.jpg',4,NULL),('SH019646300000','Die Doku-Serie zeigt authentische Bilder von verheerenden Unglücken und Naturkatastrophen, meist von Augenzeugen zufällig aufgenommen. Ex-Football-Profi Ron Pitts dokumentiert die Zerstörungen und die dramatischen Folgen für die Betroffenen.',NULL,'DEU','Zerstört in Sekunden','https://json.schedulesdirect.org/20141201/image/assets/p195575_i_h12_aa.jpg',4,NULL),('SH034267470000','Neuseelands Vulkane haben einzigartige Landschaften und Tierwelten erschaffen. In Auckland, der Wirtschaftsmetropole Neuseelands, die auf rund 50 schlafenden Vulkanen gebaut wurde, haben sich Forscher in Lavahöhlen begeben.',NULL,'DEU','Vulkane in Neuseeland','https://s3.amazonaws.com/schedulesdirect/assets/p17868288_st_h12_aa.jpg',4,NULL),('SH027546560000','Pat der Hund würde alles dafür tun, um seine Besitzerin Lola glücklich zu machen. Mit seinem überragenden Hundeintellekt gelingt es ihm immer wieder, Spannung in ihrer beider Alltag zu bringen.',NULL,'DEU','Pat der Hund','https://s3.amazonaws.com/schedulesdirect/assets/p14056615_i_h3_aa.jpg',4,NULL),('SH019883970000','Peppa, das kleine Schweinemädchen im roten Kleid, ist neugierig und klug und stürzt sich in fast jedes neue Abenteuer. Sie liebt Schokoladenkuchen, Geburtstag feiern, Kostümfeste, Geheimnisse jeder Art, Fahrrad fahren und picknicken.',NULL,'DEU','Peppa Pig','https://s3.amazonaws.com/schedulesdirect/assets/p274928_i_h12_aa.jpg',4,NULL),('SH019585710000','Das Nachrichtenmagazin für Nordrhein-Westfalen.',NULL,'DEU','WDR aktuell','https://s3.amazonaws.com/schedulesdirect/assets/p10914395_b_h12_aa.jpg',4,NULL),('SH017118930000','Kriminalhauptkommissar Oliver Radek und seine Kollegen Mina Amiri, Sandra Reiß und Daniel Prinz arbeiten beim Berliner Landeskriminalamt. Ihre Aufgabe ist es, vermisste Personen wieder ausfindig zu machen.',NULL,'DEU','Letzte Spur Berlin','https://s3.amazonaws.com/schedulesdirect/assets/p9842727_b_h3_aa.jpg',4,NULL),('SH034269680000','Der talentierte Polizeikommissar Caïn sitzt seit einem selbst verschuldeten Motorradunfall im Rollstuhl. Während seiner Ermittlungen in Marseille nutzt der zynische Beamte seine Behinderung clever aus, um Gesetze und Regeln zu umgehen.',NULL,'DEU','Kommissar Caïn','https://s3.amazonaws.com/schedulesdirect/assets/p10144008_i_h3_aa.jpg',4,NULL),('SH016391900000','Ein Wissenserlebnis-Magazin, das alltagspraktische Themen behandelt. Dabei stehen Fragen im Mittelpunkt, die aus eigenen Erlebnissen entstehen, wie das Phänomen der Sommerstürme.',NULL,'DEU','Terra Xpress','https://s3.amazonaws.com/schedulesdirect/assets/p9561766_i_v3_aa.jpg',4,NULL),('SH019683710000','Garfield, der faulste Kater der Welt ist zurück und erlebt noch mehr witzige Abenteuer. Dabei fallen Garfields schrullige Missgeschicke hier in der Regel derber und bizarrer aus als in der Vergangenheit.',NULL,'DEU','Garfield','https://json.schedulesdirect.org/20141201/image/assets/p7889800_i_h3_aa.jpg',4,NULL),('SH015402100000','Täglich werden in Deutschland etwa 130 Erfindungen patentiert. Darunter sind viele Ideen, die im Haushalt helfen und der Gesundheit dienen sollen. Das Magazin stellt die genialen Erfindungen vor, die das Licht der Öffentlichkeit nicht scheuen müssen.',NULL,'DEU','Einfach genial!','https://json.schedulesdirect.org/20141201/image/assets/p9125767_i_v5_aa.jpg',4,NULL),('SH018580260000','Käpt\'n Barnius, Professor Tintling und der Arzt Peso Pinguin leben gemeinsam mit ihren fünf Teamkollegen in einer Forschungsstation. Von dort aus erkunden sie den Ozean und retten Meeresbewohner, die sich in Gefahr befinden. Die Oktonauten erforschen auch das Verhalten der Tiere. Bei ihren Expeditionen begegnen ihnen viele außergewöhnliche Geschöpfe.',NULL,'DEU','Die Oktonauten','https://s3.amazonaws.com/schedulesdirect/assets/p8287494_i_v5_aa.jpg',4,NULL),('SH019749960000','Wissensquiz, das die Alltagstauglichkeit prominenter Kandidaten auf die Probe stellt.',NULL,'DEU','Meister des Alltags','https://s3.amazonaws.com/schedulesdirect/assets/p10980346_b_h12_aa.jpg',4,NULL),('SH016391740000','Martina Seiffert, erste Hauptkommissarin der Soko, behält in kritischen Situationen stets den Überblick und die Zusammenstellung des Teams macht es möglich, dass auch die raffiniertesten Verbrechen aufgeklärt werden.',NULL,'DEU','SOKO Stuttgart','https://s3.amazonaws.com/schedulesdirect/assets/p9561680_b_h12_ae.jpg',4,NULL),('SH019704300000','Das Magazin berichtet über aktuelle Ereignisse in der Stadt Berlin und im Land Brandenburg. Außerdem stellt es informative Themen vor, präsentiert Trends, Tipps und lädt Prominente ein.',NULL,'DEU','zibb','https://s3.amazonaws.com/schedulesdirect/assets/p10962621_b_h12_ab.jpg',4,NULL),('SH022829460000','Die Frankenschau aktuell berichtet werktags aus der Region. Jeden Tag sind wir in Ober-, Mittel- und Unterfranken unterwegs, um über die neuesten Ereignisse zu bereichten. Zudem werden Hintergrundinformationen zu verschiedenen Themen gezeigt.',NULL,'DEU','Frankenschau aktuell','https://json.schedulesdirect.org/20141201/image/assets/p12202111_b_h12_aa.jpg',4,NULL),('SH018438240000','Die aktuellen finanziellen Nachrichten von der Frankfurter Börse.',NULL,'DEU','Börse vor acht','https://s3.amazonaws.com/schedulesdirect/assets/p10415619_b_h3_aa.jpg',4,NULL),('SH022376780000','Oft können Verbrechen nur durch Untersuchung der Tatorte und mit Hilfe von hochmodernen Technologien aufgeklärt werden. Die Serie zeigt spektakuläre und bizarre Fälle, bei denen die forensische Untersuchung den entscheidenden Durchbruch ermöglichte.',NULL,'DEU','Die Forensiker: Profis am Tatort','https://s3.amazonaws.com/schedulesdirect/assets/p233203_i_h3_aa.jpg',4,NULL),('SH021765130000','Tarek und Christina El Moussa wollen mit dem Kauf, der Renovierung und dem Verkauf von Immobilien das große Geld machen. Doch jedes Projekt birgt das Risiko, sich zum großen Flop zu entwickeln.',NULL,'DEU','Die Super-Makler - Top oder Flop?','https://s3.amazonaws.com/schedulesdirect/assets/p9806566_i_h12_ab.jpg',4,NULL),('SH019579440000','Reportagen über ungewöhnliche Menschen und ungewöhnliche Orte in Norddeutschland.',NULL,'DEU','die nordreportage','https://s3.amazonaws.com/schedulesdirect/assets/p10911280_b_h12_aa.jpg',4,NULL),('SH028499440000','Seit der Eröffnung im Jahre 1969 hat sich Arthurs oldschool Donutladen ebenso wenig verändert wie sein Besitzer. Seine neue Aushilfe, der wortgewandte Franco, konfrontiert ihn jedoch mit dem multikulturellen Chicago des 21. Jahrhunderts.',NULL,'DEU','Superior Donuts','https://s3.amazonaws.com/schedulesdirect/assets/p13617649_b_h12_aa.jpg',4,NULL),('SH019560630000','Die Moderatoren berichten über topaktuelle Themen aus den Bereichen Politik, Wirtschaft, Gesellschaft sowie Kultur. Außerdem werden zahlreiche nützliche Verbrauchertipps für den Alltag und die Chance auf einen Gewinn geboten.',NULL,'DEU','SAT.1-Frühstücksfernsehen','https://json.schedulesdirect.org/20141201/image/assets/p10904244_st_h12_aa.jpg',4,NULL),('SH020448950000','In dieser Serie werden Hollywood-Stars und ihr persönlicher Werdegang vorgestellt.',NULL,'DEU','Hollywood Profile','https://json.schedulesdirect.org/20141201/image/assets/p402165_st_h12_aa.jpg',4,NULL),('SH023915840000','Die Reihe beschäftigt sich mit relevanten Themen und Entscheidungen aus Politik und Wirtschaft.',NULL,'DEU','DokThema','https://json.schedulesdirect.org/20141201/image/assets/p12718660_i_h12_aa.jpg',4,NULL),('SH019467710000','Der Polit-Talk: Als `Bürgermoderatorin\' vertritt Ines Klein die Interessen der Zuschauer, die sich über Briefe, E-Mail sowie Straßenumfragen zum Thema der Woche äußern und den prominenten Talk-Gästen Fragen stellen können.',NULL,'DEU','Fakt ist','https://s3.amazonaws.com/schedulesdirect/assets/p10871447_b_h3_aa.jpg',4,NULL),('SH009541760000','Anne Will diskutiert mit ihren Gästen über politische Prozesse, wirtschaftliche Zusammenhänge und gesellschaftliche Trends. Sie bietet ihnen und den Zuschauern die Plattform für eine gesellschaftspolitische Meinungsbildung.',NULL,'DEU','Anne Will','https://s3.amazonaws.com/schedulesdirect/assets/p571700_b_v5_aa.jpg',4,NULL),('SH019451610000','Einblicke in den Alltag fremder Kulturen, die Arbeit außergewöhnlicher Menschen aus aller Welt und vieles mehr erwartet die Zuschauer in der Dokumentarreihe, die auf spannende Art und Weise die verschiedensten Themen beleuchtet.',NULL,'DEU','360° - Geo Reportage','https://json.schedulesdirect.org/20141201/image/assets/p200805_i_h3_aa.jpg',4,NULL),('SH034254190000','Der Moderator Marco Schreyl diskutiert über gesellschaftlich relevante, aktuelle Themen. Um die Themen zu beleuchten, plaudert er mit wechselnden Gästen und konsultiert ein vierköpfiges Panel aus Fachexperten und Prominenten.',NULL,'DEU','Marco Schreyl','https://s3.amazonaws.com/schedulesdirect/assets/p17860659_st_h12_aa.jpg',4,NULL),('SH020062820000','Talkshowmaster Michel Friedman lädt zu einer wöchentlichen Talkrunde ein. Der Showmaster lässt keine Ausreden gelten, wenn er in seiner Sendung mit Gästen aus Politik, Wirtschaft und Gesellschaft über aktuelle Themen diskutiert.',NULL,'DEU','Studio Friedman','https://json.schedulesdirect.org/20141201/image/assets/p11092212_st_h12_aa.jpg',4,NULL),('SH030629550000','Max, ein 11-jähriger Rapper, entdeckt dank Dirigent Daniel Barenboim klassische Musik.',NULL,'DEU','Max & Maestro','https://json.schedulesdirect.org/20141201/image/assets/p14998461_st_h12_ab.jpg',4,NULL),('SH017566090000','Lottoziehung am Mittwoch.',NULL,'DEU','Lotto am Mittwoch: Die Gewinnzahlen','https://s3.amazonaws.com/schedulesdirect/assets/p10044372_b_h3_aa.jpg',4,NULL),('SH020373850000','Der 13-jährige Henry Hart aus der Kleinstadt Smellview hat ein Geheimnis vor seinen Freunden und seiner Familie. Er erlebt als `Kid Danger\' gemeinsam mit dem Superhelden Captain Man viele aufregende Abenteuer.',NULL,'DEU','Henry Danger','https://json.schedulesdirect.org/20141201/image/assets/p10891879_i_h3_aa.jpg',4,NULL),('SH019743790000','Die Detektive McGarret und Danno, Teil einer Elitepolizei in Hawaii, bekämpfen die Kriminalität auf der tropischen Insel. Bei ihrer Mission werden sie von dem erfahrenen Polizisten Chin Ho Kelly und seiner schönen Nichte Kono unterstützt.',NULL,'DEU','Hawaii Five-0','https://s3.amazonaws.com/schedulesdirect/assets/p8130405_l_h3_aa.jpg',4,NULL),('SH026515980000','Micky, Donald, Goofy, Donald und Pluto veranstalten mit ihren transformierbaren Vehikeln ein Wettrenennen rund um die Welt. Währenddessen eröffnen Minnie und Daisy ein neues Geschäft und lösen die Probleme anderer Menschen.',NULL,'DEU','Micky und die flinken Flitzer','https://s3.amazonaws.com/schedulesdirect/assets/p13569321_i_h12_aa.jpg',4,NULL),('SH030162510000','Die Moderatoren präsentieren die schönen Bilder und Basteleien, die die Zuschauer geschickt haben.',NULL,'DEU','Baumhaus','https://s3.amazonaws.com/schedulesdirect/assets/p15762448_b_h12_aa.jpg',4,NULL),('SH019227910000','Shaun das Schaf lebt gemeinsam mit seiner Herde auf der Weide eines idyllischen Bauernhofs. Er ist jung, unerfahren und noch etwas naiv - aber sehr neugierig und verschmitzt. Er verfügt über einen ganz besonderen `Schaf-Sinn\' und findet auch für die vertracktesten Situationen eine Lösung. Auf dem Hof leben außerdem noch der Hütehund Bitzer, der Bauer und die drei fiesen Schweine, sowie einige andere Tiere. Der Bauer bekommt von dem turbulenten Leben seiner Tiere nichts mit, die sich zwar manchmal in die Wolle kriegen, aber im Großen und Ganzen wie eine glückliche Familie zusammenleben und zusammenhalten.',NULL,'DEU','Shaun, das Schaf','https://s3.amazonaws.com/schedulesdirect/assets/p186454_i_h3_aa.jpg',4,NULL),('SH021958510000','Die Serie handelt von weibliche Straftäterinnenn, die durch ihre Tat einen Menschen getötet haben. Sie kommen selbst zu Wort und erzählen, warum sie gemordet haben.',NULL,'DEU','Snapped: Wenn Frauen töten','https://s3.amazonaws.com/schedulesdirect/assets/p189681_b_h12_ag.jpg',4,NULL),('SH019577860000','30 Minuten regionale Information und Unterhaltung aus dem Land.',NULL,'DEU','Nordmagazin','https://json.schedulesdirect.org/20141201/image/assets/p10910686_i_h12_aa.jpg',4,NULL),('SH019559640000','Die Schwestern Prue, Piper und Phoebe entfesseln, ohne es zu ahnen, Zauberkräfte, die sie zu den mächtigsten Hexen aller Zeiten machen. Mit den neuerrungenen Kräften bekämpfen sie das Böse und beschützen Unschuldige.',NULL,'DEU','Charmed - Zauberhafte Hexen','https://json.schedulesdirect.org/20141201/image/assets/p184399_i_h3_aa.jpg',4,NULL),('SH016394760000','Jede Woche treten Hobbyköche gegeneinander an. Dabei steht ihnen jede Woche ein prominenter Kochprofi von Johannes B. Kerners Köchen zur Seite. Sechs Kandidaten sind es am Anfang und zum Schluss sind es nur noch zwei Kandidaten.',NULL,'DEU','Die Küchenschlacht','https://s3.amazonaws.com/schedulesdirect/assets/p9562465_b_h12_aa.jpg',4,NULL),('SH019577940000','Hallo Niedersachsen ist das Regionalmagazin des Norddeutschen Rundfunks für das Land Niedersachsen. Die Fernsehsendung informiert über das politische und kulturelle Leben sowie besondere Ereignisse in Niedersachsen.',NULL,'DEU','Hallo Niedersachsen','https://s3.amazonaws.com/schedulesdirect/assets/p10910723_b_h12_aa.jpg',4,NULL),('SH025247490000','Die Sendung informiert über Baufinanzierung, Immobilien und außergewöhnliche Architektur. Aktuelle Entwicklungen sowie nützliche Hinweise werden zu den verschiedenen Themen rund um das Eigenheim vorgestellt.',NULL,'DEU','Ratgeber - Bauen und Wohnen','https://json.schedulesdirect.org/20141201/image/assets/p13349318_st_h12_aa.jpg',4,NULL),('SH020149790000','Der `Late Movie\', das sind sinnliche Geschichten über Liebe, Verführung und Leidenschaft mit wechselnden Darstellern und Themen.',NULL,'DEU','SPORT1 Late-Movie','https://s3.amazonaws.com/schedulesdirect/assets/p11121612_st_h12_aa.jpg',4,NULL),('SH018439100000','Kriminalgeschichten rund um das Polizeirevier im Hamburger Kiez.',NULL,'DEU','Großstadtrevier','https://s3.amazonaws.com/schedulesdirect/assets/p10415876_b_h12_ac.jpg',4,NULL),('SH024553550000','Ein Agumon flieht aus der Digi-Welt und begegnet Marcus, mit dem es sich anfreundet. Die Polizei sucht nach Agumon und will es zurück in die Digi-Welt bringen. Marcus verteidigt seinen neuen Freund und bekommt das Angebot, für die `DATS\' zu arbeiten.',NULL,'DEU','Digimon: Data Squad','https://s3.amazonaws.com/schedulesdirect/assets/p8576791_st_h12_aa.jpg',4,NULL),('SH031676090000','In der folgenden Sendung erzählen, parodieren und kommentieren die besten Kolumnisten, Komiker sowie Kabarettisten. Außerdem wird die Show von der neuen Hausband `hr1-Loungers\' mit einigen der energetischsten Musiker der `hr-Bigband\' unterstützt.',NULL,'DEU','Die Florian Schroeder Satire Show','https://s3.amazonaws.com/schedulesdirect/assets/p15099263_i_s2_aa.jpg',4,NULL),('SH019576450000','Die schüchterne Anna arbeitet als Werbetexterin in einer Werbeagentur und verliebt sich in den Juniorchef der Agentur, Jonas. Doch dieser ist bereits mit ihrer verfeindeten Halbschwester verlobt, die ihr das Leben zur Hölle macht.',NULL,'DEU','Anna und die Liebe','https://s3.amazonaws.com/schedulesdirect/assets/p7910953_st_h12_aa.jpg',4,NULL),('SH020415830000','Innerhalb von fünf Minuten werden alltägliche, wissenswerte Fakten behandelt. Dabei werden die unterschiedlichsten Themen beleuchtet, kurz und bündig zusammengefasst und veranschaulicht.',NULL,'DEU','Galileo To Go','https://s3.amazonaws.com/schedulesdirect/assets/p11217939_st_h12_aa.jpg',4,NULL),('SH020075070000','Englisch ist eine Weltsprache. Du brauchst sie im Urlaub, im Unterricht und immer mehr auch im Alltag. Wir helfen dir dabei, die englische Sprachwelt zu erschließen.',NULL,'DEU','GRIPS Englisch','https://s3.amazonaws.com/schedulesdirect/assets/p11094534_st_h12_aa.jpg',4,NULL),('SH029319530000','Das globale Bahnnetz hat eine glorreiche Vergangenheit. Aber hat es auch eine Zukunft? Dieser Frage geht der Film am Beispiel der legendären Eisenbahngesellschaft Indian Railways nach. 23 Millionen Gäste befördert die Indian Railways jeden Tag. In den nach Geschlechtern getrennten Vorort-Zügen von Mumbai trifft Korrespondentin Barbara Lüthi Frauen, die sich freie und sichere Fahrt erkämpfen. Manchmal entstehen im Zug sogar Freundschaften fürs Leben.',NULL,'DEU','Bahnhöfe dieser Welt - Nächster Halt Zukunft','https://s3.amazonaws.com/schedulesdirect/assets/p15323766_st_h12_aa.jpg',4,NULL),('SH027581960000','Aus dem Nachrichtenstudio wird über aktuelle Ereignisse aus Deutschland und der Welt informiert.',NULL,'DEU','Nachrichten','https://s3.amazonaws.com/schedulesdirect/assets/p14454310_st_h12_aa.jpg',4,NULL),('SH019570090000','M*A*S*H ist ein Feldlazarett der US Army. Dort leistet ein bunt zusammengewürfelter Haufen seinen Dienst im Korea-Krieg 1950. Unter diesen Umständen erlebt Captain Pierce und sein Team einen wahnsinnigen Alltag.',NULL,'DEU','M*A*S*H','https://s3.amazonaws.com/schedulesdirect/assets/p183880_i_v5_aa.jpg',4,NULL),('SH030682620000','Jeden Nachmittag, wenn der Zoo schließt, machen auch Zacki, das australische Frischwasserkrokodil, und seine Freunde Feierabend. Sie öffnen heimlich ihre Käfige und nehmen das Zoo-Mobil in Richtung Heimat, wo sie viele Abenteuer erleben.',NULL,'DEU','Zacki und die Zoobande','https://s3.amazonaws.com/schedulesdirect/assets/p14471392_i_h12_aa.jpg',4,NULL),('SH017566160000','In der schleswig-holsteinischen Provinz ermittelt die toughe Kommissarin Jana Winter mit kühlem Kopf. Sie klärt grausame Kriminalfälle und tragische Ereignisse auf und muss sich nebenbei privaten Schwierigkeiten stellen.',NULL,'DEU','Unter anderen Umständen','https://s3.amazonaws.com/schedulesdirect/assets/p10044444_b_h3_aa.jpg',4,NULL),('SH017875850000','Die rbb Reporter berichten aus Berlin und dem Land Brandenburg.',NULL,'DEU','Die rbb Reporter','https://s3.amazonaws.com/schedulesdirect/assets/p10172520_b_h12_aa.jpg',4,NULL),('SH019585890000','Wissenschaftsjournalistin Bernice Notenboom unternimmt eine Forschungsreise rund um den Globus.',NULL,'DEU','Wo das Klima auf der Kippe steht - Eine Reise zu den Wendepunkten des Klimawandels','https://json.schedulesdirect.org/20141201/image/assets/p10914421_i_h3_aa.jpg',4,NULL),('SH019369320000','Mike und Molly sind ein übergewichtiges Pärchen, das sich bei den anonymen `Overeaters\'-Treffen, einer Selbsthilfegruppe für Menschen mit Essstörungen, kennenlernt und ineinander verliebt. Mike ist ein herzensguter Polizist, der ernsthaft versucht, seine Pfunde loszuwerden. Molly ist Lehrerin und eine wahre Power-Frau, findet es aber nicht so leicht, sich auf das Abnehmen zu konzentrieren. Sie lebt mit ihrer jüngeren Schwester und Mutter zusammen, die beide trotz eines guten Appetits gemeinerweise keine Probleme mit ihrer Figur haben. Gemeinsam wollen Mike und Molly ihrem Gewicht den Kampf ansagen und sich gegenseitig unterstützen - nicht nur beim Abnehmen.',NULL,'DEU','Mike & Molly','https://json.schedulesdirect.org/20141201/image/assets/p8130329_i_h12_aa.jpg',4,NULL),('SH024563410000','Immer wieder tauchen auf Bildern Objekte auf, die auf den ersten Blick nicht zu erklären sind. Die Dokumentarserie geht diesen weltweiten Phänomenen auf den Grund und versucht, plausible Erklärungen dafür zu finden.',NULL,'DEU','Rätselhafte Phänomene','https://s3.amazonaws.com/schedulesdirect/assets/p11488371_i_h12_aa.jpg',4,NULL),('SH026022910000','Einige Tiere leben auf einer Schmusedecke und müssen gemeinsam ihre Probleme bewältigen. So braucht der Fisch unbedingt Wasser, das Ei des Huhns steckt fest und der böse Fuchs will alle anderen Tiere fressen.',NULL,'DEU','Meine Schmusedecke','https://s3.amazonaws.com/schedulesdirect/assets/p13705532_i_h12_aa.jpg',4,NULL),('SH018556470000','Der `Bachelor\' ist auf der Suche nach seiner Traumfrau, die er aus 22 Bewerberinnen auswählen darf.',NULL,'DEU','Der Bachelor','https://json.schedulesdirect.org/20141201/image/assets/p10457956_st_h12_aa.jpg',4,NULL),('SH018582270000','Die Sendung gehört zu den erfolgreichsten Politik-Magazinen im deutschen Fernsehen. Alle drei Wochen berichten die Moderatoren über soziale Missstände und politische Fehltritte. Reporter recherchieren dort, wo es eigentlich keinen Zutritt gibt und decken auf, was häufig vertuscht und verschwiegen wird. Dabei kritisieren die Journalisten die Regierung ebenso wie die Opposition, die Gewerkschaften ebenso wie die Arbeitgeber. Das Themenspektrum reicht von der Ausbeutung der Arbeitnehmer über den Irakkrieg bis hin zum Chaos im Klassenzimmer. Das Ziel ist, nicht nur zu kritisieren, sondern auch die Verantwortlichen mit stichhaltigen Argumenten zu konfrontieren.',NULL,'DEU','Panorama','https://json.schedulesdirect.org/20141201/image/assets/p10467766_i_h3_aa.jpg',4,NULL),('SH034185720000','Die Sendung dokumentiert, wie verzweifelte Menschen Klarheit in ihre Vergangenheit bringen wollen. Sie konfrontieren ihre ehemaligen Liebhaber, Freunde oder Familienmitglieder und fragen sie nach der ungeschminkten Wahrheit.',NULL,'DEU','Ghosted: Verliebt und verschwunden','https://json.schedulesdirect.org/20141201/image/assets/p17259249_i_h12_aa.jpg',4,NULL),('SH031010990000','Zwei Mal am Tag begrüßen Sie die Moderatorinnen und Moderatoren aus dem Bonner Studio - um 17.30 Uhr mit einer 30-minütigen Zusammenfassung und um 23.00 Uhr mit einer umfassenden 60-minütigen Rückschau auf den Tag.',NULL,'DEU','phoenix der tag','https://s3.amazonaws.com/schedulesdirect/assets/p16266031_b_h12_aa.jpg',4,NULL),('SH009160030000','Die Talksendung beleuchtet aktuelle politische Themen, wobei es die Moderatorin schafft, komplexe politische Sachverhalte für das Wahlvolk verständlich zu machen. Die Gäste der Sendung sind meist Politiker aus Deutschland und der Welt.',NULL,'DEU','maybrit illner','https://json.schedulesdirect.org/20141201/image/assets/p796173_i_h3_aa.jpg',4,NULL),('SH014726380000','Starke Frauen stehen vor den Trümmern ihres Lebens und wollen sich beruflich sowie privat selbstverwirklichen. Dabei zentrieren sich unterschiedliche Beziehungsgeschichten, Intrigen, Karrieren und Familienchaos um das Hotel Drei Könige, das zugehörige Restaurant Carlas sowie das Mietshaus Rosenhaus. Inmitten des Geschehens steht immer eine Frau mit einer Vision und dem aufrichtigen Wunsch nach einem glücklichen Leben.',NULL,'DEU','Rote Rosen','https://s3.amazonaws.com/schedulesdirect/assets/p8832396_b_h12_aa.jpg',4,NULL),('SH025353820000','In dieser Sendung dreht sich alles ums Essen, um Ernährung und den damit verbundenen Genuss. Jede Folge widmet sich einem anderen Thema, zum Beispiel welche Speisen weltweit am beliebtesten sind oder welche Extreme erreicht werden.',NULL,'DEU','Top Ten! Der Geschmacks-Countdown','https://s3.amazonaws.com/schedulesdirect/assets/p13401823_st_h12_aa.jpg',4,NULL),('SH020034900000','Diese Top-Piloten sind mit verschiedensten Flugzeugtypen vertraut. Ihr Job ist es, Flugzeuge sicherzustellen, wenn ein Käufer nicht bezahlt. In Detektivarbeit machen sie die Flugzeuge ausfindig und bringen sie ihrem Eigentümer zurück.',NULL,'DEU','Inkasso Air - Die Flugzeug-Eintreiber','https://json.schedulesdirect.org/20141201/image/assets/p8399068_i_h12_ah.jpg',4,NULL),('SH019379490000','Die Familie Griffin lebt in der Kleinstadt Quahog auf Rhode Island. Angeführt wird der ganz normale amerikanische Haushalt von Peter und Lois, den Eltern von drei Kindern: Chris, Meg und Stewie. Außerdem haben sie einen sprechenden Hund, Brian, der in Wahrheit das Oberhaupt der Familie ist. Mit derbem und politisch unkorrektem Humor, Musical-Einlagen und Parodien stolpern die Mitglieder der Familie von einem Missgeschick ins nächste. Louis versucht, ganz im Sinne einer fürsorglichen Mutter, die Fehler ihres Mannes auszubügeln. Meg steckt mitten in der Pubertät und Chris ist eine nicht allzu intelligente künstlerische Seele - ganz im Gegenteil zu Baby Stewie, der hochintelligent und böse zugleich ist. Nur der Hund Brian schafft es tatsächlich, das Chaos zu überblicken und einen kühlen Kopf zu bewahren.',NULL,'DEU','Family Guy','https://s3.amazonaws.com/schedulesdirect/assets/p184483_i_v3_ab.jpg',4,NULL),('SH019658810000','Thomas Ranft und Fridolin Frosch - das Maskottchen der Sendung - liefern Informationen, wie sich das Wetter in Hessen und der Welt entwickelt.',NULL,'DEU','alle wetter!','https://s3.amazonaws.com/schedulesdirect/assets/p10944959_b_h12_aa.jpg',4,NULL),('SH027610270000','Das Wissensquiz stellt die Alltagstauglichkeit berühmter Kandidaten auf die Probe. In Zweierteams werden Fragen aus dem täglichen Leben beantwortet. Dabei sind Kreativität und Ideenreichtum gefragt. Der Sieger spendet den Gewinn an einen guten Zweck.',NULL,'DEU','Meister des Alltags','https://s3.amazonaws.com/schedulesdirect/assets/p14467638_st_h12_aa.jpg',4,NULL),('SH030515820000','Während der Abwesenheit ihres Vaters Dracula möchte die jugendliche Mavis beweisen, dass sie alle Fähigkeiten besitzt, das Hotel zu leiten. Die drei Freunde Hank N Stein, Pedro und Wendy Blob stehen ihr dabei stets zur Seite. Während Mavis die Hotelführung eher liberal angeht und der Spaß im Vordergrund steht, ist ihre Tante Lydia deutlich strenger...',NULL,'DEU','Hotel Transsilvanien - Die Serie','https://s3.amazonaws.com/schedulesdirect/assets/p14199341_i_h12_aa.jpg',4,NULL),('SH019664330000','Viele Millionen Menschen verreisen in jedem Jahr, da geht schon mal ein Koffer verloren. Die Gepäckstücke werden dann eingelagert. Wenn sie nicht reklamiert werden, kommen sie bei Auktionen unter den Hammer. In manchen sind auch wertvolle Dinge.',NULL,'DEU','Baggage Battles - Die Koffer-Jäger','https://json.schedulesdirect.org/20141201/image/assets/p8967410_i_h3_aa.jpg',4,NULL),('SH015405600000','Magazin zu den Themen Bergsport, Wandern und Abenteuer, das sich daneben auch mit zahlreichen Trendsportarten beschäftigt und lohnenswerte Ausflugsziele vorstellt.',NULL,'DEU','Biwak','https://s3.amazonaws.com/schedulesdirect/assets/p9127252_b_h12_aa.jpg',4,NULL),('SH024091100000','Im Zuschauer-Talk haben 100 Zuschauer das Wort und diskutieren mit Politikern und Experten. Die Sendung ist das Forum für ehrliche Ansichten, für Fragen, Sorgen und Hoffnungen zu aktuellen Themen - live im Fernsehstudio und über Social Media.',NULL,'DEU','Ihre Meinung','https://s3.amazonaws.com/schedulesdirect/assets/p12798319_b_v3_aa.jpg',4,NULL),('SH023435380000','Katja Neumann muss sich als unerfahrene Chefsekretärin in der `Sonnenschein Toast AG\' behaupten. Sie wurde durch Zufall eingestellt und leidet zunächst unter ihrem cholerischen Chef und ihren Kollegen. Doch bald ändert sich einiges in der Firma.',NULL,'DEU','Sekretärinnen - Überleben von 9 bis 5','https://s3.amazonaws.com/schedulesdirect/assets/p12482401_st_h12_ab.jpg',4,NULL),('SH015444020000','Im Mittelpunkt stehen turbulente, spannende, witzige und romantische Geschichten rund um die Irrungen und Wirrungen von Freundschaft, Liebe und Familie am Hotel Fürstenhof.',NULL,'DEU','Sturm der Liebe','https://s3.amazonaws.com/schedulesdirect/assets/p9145515_b_v5_aa.jpg',4,NULL),('SH018580840000','Shawn Spencer verfügt über eine außergewöhnliche Beobachtungsgabe. Er achtet auf jedes noch so kleine Detail in seiner Umgebung und bemerkt Dinge, die sonst oft niemandem auffallen. Das führt dazu, dass er in Fernsehberichten von Verbrechen oft schnell Hinweise entdeckt und der Polizei so bei der Aufklärung des Falles hilft. Als er jedoch eines Tages selbst unter Mordverdacht gerät, muss er sich etwas einfallen lassen. Er gibt sich als Hellseher aus, der die Hinweise durch übersinnliche Wahrnehmungen erhalten habe. Er kann den Fall lösen und gründet daraufhin mit seinem Freund Gus die Agentur `Psych\'. Fortan hilft er der Polizei mit seinen angeblich hellseherischen Fähigkeiten immer wieder bei der Lösung schwieriger Fälle.',NULL,'DEU','Psych','https://json.schedulesdirect.org/20141201/image/assets/p185254_i_h12_ae.jpg',4,NULL),('SH019585950000','Magazinsendung, die sich mit Themen aus den Bereichen Gesundheit, Geld und Ernährung beschäftigt.',NULL,'DEU','Servicezeit','https://s3.amazonaws.com/schedulesdirect/assets/p10914446_b_h12_aa.jpg',4,NULL),('SH019962420000','Der New Yorker Polizist Theodoros Kojak erledigt seine Fälle so, wie er es für richtig hält. Mit zynischem Humor spürt der glatzköpfige Grieche die Schlupfwinkel dunkler Elemente selbst auf Partys der High Society auf.',NULL,'DEU','Kojak - Einsatz in Manhattan','https://s3.amazonaws.com/schedulesdirect/assets/p184158_i_v5_aa.jpg',4,NULL),('SH021903090000','Wer hat die Brille erfunden? Woher kommt die Brez\'n? Oder: Warum heißt die Sternschnuppe Sternschnuppe? Diese oder ähnliche Fragen stellt Willi den zwei Schulklassen aus zwei Städten in seinem unterhaltsamen Quiz-Quark-Club.',NULL,'DEU','Willis Quiz Quark Club','https://json.schedulesdirect.org/20141201/image/assets/p11802755_i_h12_aa.jpg',4,NULL),('SH019952770000','Die Moderatorin Funda Vanroy entführt den Zuschauer auf eine Reise rund um den Globus. Facettenreiche und unglaubliche Themen, die uns im täglichen Leben beeinflussen, werden recherchiert und vorgestellt.',NULL,'DEU','Galileo 360°','https://json.schedulesdirect.org/20141201/image/assets/p11060269_i_h12_aa.jpg',4,NULL),('SH016391980000','Das tägliche Frühstücksfernsehen informiert über aktuelle Ereignisse aus Politik, Gesellschaft und Kultur. Darüber hinaus informiert ein Sportblock über die tagesaktuellen Geschehnisse aus der Sportwelt. Abgerundet wird die Sendung mit Interviews.',NULL,'DEU','ZDF-Morgenmagazin','https://s3.amazonaws.com/schedulesdirect/assets/p9561785_b_h3_aa.jpg',4,NULL),('SH019098250000','Die Dokumentationen untersuchen verschiedene geschichtliche Themen.',NULL,'DEU','Geschichte im Ersten','https://s3.amazonaws.com/schedulesdirect/assets/p10723643_b_v5_aa.jpg',4,NULL),('SH0174