n Amanda Bentley und Notfallchirurg Doktor Jesse Travis unter die Arme.',NULL,'DEU','Diagnose: Mord','https://s3.amazonaws.com/schedulesdirect/assets/p184251_i_v5_aa.jpg',4,NULL),('SH015402030000','Das Magazin informiert aktuell, regional und unterhaltsam über medizinische Themen, Gesundheitsvorsorge und neue Therapieformen.',NULL,'DEU','rbb Praxis','https://s3.amazonaws.com/schedulesdirect/assets/p9125748_b_h12_ab.jpg',4,NULL),('SH034258460000',NULL,NULL,'DEU','VIA MILANO styled by Astrid Rudolph Sale','https://s3.amazonaws.com/schedulesdirect/assets/p17862797_st_h12_aa.jpg',4,NULL),('SH019831610000','Im Wechsel diskutieren Ursula Heller und Sigmund Gottlieb in dieser politischen Talksendung mit Verantwortlichen, Experten und Betroffenen aus Politik, Wirtschaft und Gesellschaft.',NULL,'DEU','Münchner Runde','https://s3.amazonaws.com/schedulesdirect/assets/p11014452_b_h12_aa.jpg',4,NULL),('SH019855870000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus dem Ruhrgebiet.',NULL,'DEU','Lokalzeit Ruhr','https://s3.amazonaws.com/schedulesdirect/assets/p11024446_b_h12_aa.jpg',4,NULL),('SH024889700000','Die Dokumentationsreihe beschäftigt sich mit seltsamen wissenschaftlichen Phänomenen und erklärt sie. Sie zeigt, dass es auf dem Planeten Erde einige sehr seltsame Dinge gibt.',NULL,'DEU','Wunder der Wissenschaft','https://s3.amazonaws.com/schedulesdirect/assets/p13166218_st_h12_aa.jpg',4,NULL),('SH019560340000','Der Naval Crime Investigative Service wird dann gerufen, wenn Verbrechen begangen werden, die gegen den Uniform Code of Military Justice verstoßen und innerhalb der Navy stattfinden. Das Hauptquartier befindet sich in Washington D.C. und steht unter der Leitung von Special Agent Leroy Jethro Gibbs. Er selbst ist ein Veteran aus dem Irak-Krieg und hat mit moderner Technik wenig zu tun. Aus diesem Grund ermittelt er gemeinsam mit einem Elite-Team, bestehend aus dem Ballistik-Experten Tony DiNozzo, dem Technikspezialisten Tim McGee, der Fo