025933580000','Elena hat ihr Königreich Avalor vor einer bösen Zauberin gerettet. Doch nun muss die Sechzehnjährige lernen, wie man ein Königreich regiert. Sie erlebt viele Abenteuer, bei denen sie erfährt, dass ihre neue Rolle als Oberhaupt eine Menge fordert.',NULL,'DEU','Elena von Avalor','https://s3.amazonaws.com/schedulesdirect/assets/p12975383_i_h12_aa.jpg',4,NULL),('SH003332690000','Das Nachrichten- und Unterhaltungsmagazin beschäftigt sich mit tagesaktuellen Themen, dem Wetter, bietet nützliche Verbrauchertipps und berichtet über das Geschehen rund um den Globus. Außerdem bietet die Sendung jede Menge VIP, Klatsch und Tratsch von Prominenten und lädt die Stars und Sternchen ins Studio ein, um die Themen der Woche zu besprechen. Das Informationsmagazin berichtet zudem über die aktuellen Errungenschaften in der Welt des Sports, hat Aktionen und Gewinnspiele und eine Wettervorschau für Deutschland.',NULL,'DEU','Guten Morgen Deutschland','https://json.schedulesdirect.org/20141201/image/assets/p397377_st_h12_aa.jpg',4,NULL),('SH016397840000','Markus Lanz lädt prominente Gäste und Experten aus allen Bereichen des öffentlichen Lebens zu seiner bunten Talkrunde ein. In der Regel sind es vier Gäste, die einzeln vorgestellt werden und ihre persönlichen Erfahrungen zu den Themen einbringen.',NULL,'DEU','Markus Lanz','https://s3.amazonaws.com/schedulesdirect/assets/p793628_b_h3_aa.jpg',4,NULL),('SH032966600000',NULL,NULL,'DEU','#phoenix_freistil','https://s3.amazonaws.com/schedulesdirect/assets/p17286652_st_h12_aa.jpg',4,NULL),('SH022444510000','`Crime Town USA\' zeigt schockierende Verbrechen, die jemals in US-amerikanischen Kleinstädten von Kriminellen begangen wurden. Die zuständigen Gesetzeshüter geben einen Einblick in das Vorgehen der Polizeiarbeit.',NULL,'DEU','Crime Town USA - Verbrechen im Hinterland','https://s3.amazonaws.com/schedulesdirect/assets/p7980386_st_h12_aa.jpg',4,NULL),('SH021430130000','Zwei pensionierte Kommissare werden vom Polizeipräsidenten in 