000','Der Seeweg von Arabien über Indien nach China ist einer der ältesten Handelswege der Menschheit: Über Tausende Seemeilen erstreckt er sich, vorbei an drei Kontinenten. Handelsgüter dieser Seidenstraße der Meere, wie Gewürze und chinesisches Porzellan, haben die europäische Kultur nachhaltig beeinflusst. Die Reihe folgt den Spuren der arabischen Entdecker, die vor zweitausend Jahren begannen, mit ihren schnellen und wendigen Schiffen die Seewege Richtung Osten zu erkunden.',NULL,'DEU','Seefahrer des Orients','https://json.schedulesdirect.org/20141201/image/assets/p13551016_i_h12_aa.jpg',4,NULL),('SH016999660000','Diana liebt Eiskunstlaufen, aber sie hat noch nie versucht, eine professionelle Laufbahn als Eiskunstläuferin einzuschlagen. Eines Abends trainiert sie heimlich auf einer Eisbahn und wird vom Marketing Manager der Steinkamp-Gruppe entdeckt.',NULL,'DEU','Alles was zählt','https://s3.amazonaws.com/schedulesdirect/assets/p9790472_b_h12_ae.jpg',4,NULL),('SH026031750000','In der Wissenschaftssendung werden unterschiedliche wissenschaftliche Themen verständlich erklärt.',NULL,'DEU','Quarks','https://json.schedulesdirect.org/20141201/image/assets/p13710060_i_h12_aa.jpg',4,NULL),('SH022939520000','Das werktägliche Regionalmagazin mit aktuellen Informationen und Reportagen für Südbayern.',NULL,'DEU','Abendschau - Der Süden','https://s3.amazonaws.com/schedulesdirect/assets/p12261673_st_h12_aa.jpg',4,NULL),('SH019585610000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Duisburg. Die regionalen Nachricht rund um Duisburg sprechen Themen in Bereichen Gesellschaft, Politik, Wirtschaft und Kultur an.',NULL,'DEU','Lokalzeit aus Duisburg','https://s3.amazonaws.com/schedulesdirect/assets/p10914347_b_h12_aa.jpg',4,NULL),('SH021893360000','Doozers sind kleine grüne Männchen, die in kleinen Gemeinden auf der ganzen Welt leben.',NULL,'DEU','Jim Hensons: Doozers','https://s3.amazonaws.com/schedulesdirect/assets/p10239013_i_v5_aa.jpg',4,NULL),