und seine erste Mission vorzubereiten. Denn auf der Erde wurde ein Klingone gefunden, der schwer verletzt ist und schnellstmöglich in seine Heimat gebracht werden muss. Während ihrer Raumfahrt erforscht die Besatzung die unendlichen Weiten des Weltalls und ebnet den Weg für einen interstellaren Völkerbund. Dabei stehen dem Captain sein Hund Porthos, die vulkanische Wissenschaftsoffizierin T\'Pol, der Chefingenieur Trip sowie der medizinische Offizier Dr. Phlox zur Seite.',NULL,'DEU','Star Trek: Enterprise','https://s3.amazonaws.com/schedulesdirect/assets/p184749_b_h3_aa.jpg',4,NULL),('SH019722060000','Die faszinierenden Landschaften von Afrika.',NULL,'DEU','Afrikas Naturparadiese','https://json.schedulesdirect.org/20141201/image/assets/p530295_i_h3_aa.jpg',4,NULL),('SH019580930000','Die -hessenschau- ist das Regionalmagazin im Fernsehen des Hessischen Rundfunks und ist die erfolgreichste und populärste Sendung im hr-fernsehen. Täglich wird aktuell über Politik, Kultur, Wirtschaft und Unterhaltendes aus Hessen berichtet.',NULL,'DEU','hessenschau','https://json.schedulesdirect.org/20141201/image/assets/p10911776_i_h3_aa.jpg',4,NULL),('SH029782290000','Cricket und seine Familie ziehen vom Land in die Großstadt, was zu erst einen großen Kulturschock auslöst. Doch Cricket ist optimistisch und naiv, was ihn schnell neue Freunde finden lässt. Zusammen erleben sie viele Abenteuer in der großen Stadt.',NULL,'DEU','Big City Greens','https://s3.amazonaws.com/schedulesdirect/assets/p14788469_b_h12_aa.jpg',4,NULL),('SH028840320000','Acht Prominente treten gegeneinander an, um Deutschlands bester Promi-Bäcker zu werden. In insgesamt zwölf Prüfungen müssen die Teilnehmer ihr Können unter Beweis stellen, der Sieger gewinnt 10.000 Euro für einen guten Zweck.',NULL,'DEU','Das große Promibacken','https://s3.amazonaws.com/schedulesdirect/assets/p15089415_st_h12_aa.jpg',4,NULL),('SH022917380000','Von Aschaffenburg bis Passau, von Kempten bis Hof - Bayern hat viele Facetten. Die Reihe zeigt diese Vielfalt an bezaubernden Reisezielen, fast vergessenem Handwerk und bis heute erhaltenen Traditionen.',NULL,'DEU','Wir in Bayern','https://s3.amazonaws.com/schedulesdirect/assets/p11027370_i_h12_aa.jpg',4,NULL),('SH025691860000','Berge, Gletscher und die weiten Ebenen Neuseelands erinnern an Nordamerika oder Europa. Beim zweiten Blick jedoch zeigt sich, dass die Tier- und Pflanzenwelt dieser Inseln am Ende der Welt erstaunlich anders sind und extrem Skurriles zu bieten haben.',NULL,'DEU','Wildes Neuseeland','https://s3.amazonaws.com/schedulesdirect/assets/p12837422_i_h3_aa.jpg',4,NULL),('SH032012090000','Die Nachrichtensendung berichtet von den aktuellsten regionalen und internationalen Ereignissen. Andreas Brückner stellt eine engagierte Redaktion vor, die tagtäglich Themen recherchiert und für informativen Inhalt sorgt.',NULL,'DEU','MDR aktuell','https://s3.amazonaws.com/schedulesdirect/assets/p12219300_b_h12_aa.jpg',4,NULL),('SH019855860000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus dem Münsterland.',NULL,'DEU','Lokalzeit Münsterland','https://s3.amazonaws.com/schedulesdirect/assets/p11024439_b_h12_aa.jpg',4,NULL),('SH030024180000','Shouyou Hinatas beobachtet zufällig ein Spiel der Karasuno Oberschule bei den nationalen Meisterschaften im Volleyball. Sofort ist er fasziniert von dem Sport und will selbst ein erfolgreicher Spieler werden. Er gründet eine Mannschaft.',NULL,'DEU','Haikyu!!','https://s3.amazonaws.com/schedulesdirect/assets/p10986000_b_h12_ac.jpg',4,NULL),('SH022280060000','In der Welt der Savanne Kenias bringt jeder Tag wichtige Erfahrungen für Lolulu und Malalua. Die Serie erzählt die Erlebnisse der beiden Massai-Kinder, zeigt ihre Herausforderungen und wie sie und ihre Familien in der Savanna überleben können.',NULL,'DEU','Die Abenteuer von Lolulu und Malalua','https://json.schedulesdirect.org/20141201/image/assets/p11950084_i_v5_aa.jpg',4,NULL),('SH019694710000','Deutschlands erste regelmäßige Nachrichtensendung für Kinder präsentiert Themen mit aktuellem Bezug und Hintergrundinformationen perfekt für Kinder und Jugendliche aufbereitet und garantiert verständlich.',NULL,'DEU','logo! Die Welt und ich','https://s3.amazonaws.com/schedulesdirect/assets/p10959077_b_h12_aa.jpg',4,NULL),('SH018574450000','Stefan Vollmer ist ein Lehrer mit unkonventionellen Methoden. Nach 10-jähriger Auszeit fängt er an der Willy-Brandt-Gesamtschule an und bekommt eine Problemklasse zugeteilt. Die Klasse macht es ihm nicht leicht, wieder in seinen Beruf einzusteigen.',NULL,'DEU','Der Lehrer','https://json.schedulesdirect.org/20141201/image/assets/p10464444_st_h12_aa.jpg',4,NULL),('SH014788370000','Die neuesten Produkte aus der Welt der Diamanten erfüllen den Raum mit einem luxuriös-edlen Flair.',NULL,'DEU','Welt der Diamanten','https://s3.amazonaws.com/schedulesdirect/assets/p8858238_st_h12_aa.jpg',4,NULL),('SH015406530000','Die Reihe präsentiert regionale Naturporträts und international produzierte Tier- und Naturfilme.',NULL,'DEU','Expeditionen ins Tierreich','https://json.schedulesdirect.org/20141201/image/assets/p9127609_i_h12_aa.jpg',4,NULL),('SH023501130000','Die Dokumentarserie blickt hinter die Kulissen der Entstehungsprozesse verschiedener militärischer Ausrüstungen, vom Schweizer Taschenmesser bis hin zum F-16 Kampfflugzeug.',NULL,'DEU','Battle Factory','https://s3.amazonaws.com/schedulesdirect/assets/p11356512_b_h12_aa.jpg',4,NULL),('SH023708800000','Connor, Amaya und Greg sind ganz normale Kinder. Doch als sie eines Tages ihre besonderen Pyjamas bekommen und Tieramulette aktivieren, werden sie zu drei Superhelden und erleben spannende Abenteuer, bei denen sie eine Menge lernen.',NULL,'DEU','PJ Masks - Pyjamahelden','https://s3.amazonaws.com/schedulesdirect/assets/p12115698_i_h12_aa.jpg',4,NULL),('SH019647040000','Diese Top-Piloten sind mit verschiedensten Flugzeugtypen vertraut. Ihr Job ist es, Flugzeuge sicherzustellen, wenn ein Käufer nicht bezahlt. In Detektivarbeit machen sie die Flugzeuge ausfindig und bringen sie ihrem Eigentümer zurück.',NULL,'DEU','Airplane Repo - Die Inkasso-Piloten','https://json.schedulesdirect.org/20141201/image/assets/p8399068_i_h12_ah.jpg',4,NULL),('SH019672500000','Das werktägliche Kulturmagazin mischt sich in kulturelle und gesellschaftspolitische Fragen ein. `Kulturzeit\' bietet ergänzende Hintergrundinformationen, Porträts und Gespräche zu aktuellen und brisanten Fragen.',NULL,'DEU','Kulturzeit','https://json.schedulesdirect.org/20141201/image/assets/p10950682_i_h12_aa.jpg',4,NULL),('SH033089030000',NULL,NULL,'DEU','Mr. Magoo','https://json.schedulesdirect.org/20141201/image/assets/p16671396_i_h12_aa.jpg',4,NULL),('SH029165460000','Hector hat ein Problem: Er hat gerade seine Jugendliebe Louise wieder getroffen, und sich wie damals Hals über Kopf verliebt. Allerdings führt er seit Jahren eine glückliche Beziehung mit Jérémie, mit dem gemeinsam er plant, ein Kind zu adoptieren.',NULL,'DEU','Ich liebe euch!','https://s3.amazonaws.com/schedulesdirect/assets/p15235729_st_h12_aa.jpg',4,NULL),('SH015403000000','Alle Verantwortlichen und Tierpfleger im Stuttgarter Zoo wollen ihren Tieren das Leben so angenehm wie möglich machen. `Eisbär, Affe & Co.\' erzählt die Zoogeschichten aus Stuttgart.',NULL,'DEU','Eisbär, Affe & Co.','https://s3.amazonaws.com/schedulesdirect/assets/p9126187_b_v3_ab.jpg',4,NULL),('SH027291760000','Mit exakt abgestimmtem Bastelequipment will `Crafter\'s Companion\' die Freude am Basteln steigern.',NULL,'DEU','Crafter\'s Companion - einfach kreativ','https://s3.amazonaws.com/schedulesdirect/assets/p14307411_st_h12_aa.jpg',4,NULL),('SH019743700000','Nachmittägliches Service- und Ratgebermagazin mit Themen aus den Bereichen Haushalt, Finanzen, Handwerk, Computer, Ernährung, Recht und Gesundheit. Zahlreiche Experten diskutieren diese Themen im Studio.',NULL,'DEU','Kaffee oder Tee?','https://s3.amazonaws.com/schedulesdirect/assets/p10978247_b_h12_aa.jpg',4,NULL),('SH022513700000','Sie sind die Experten ihrer Fachbereiche und kommen zum Einsatz, wenn es für andere zu gefährlich wird: Mitarbeiter verschiedener Rettungskräfte werden im Einsatz begleitet, zum Beispiel die Wasserschutzpolizei oder Feuerwehrleute.',NULL,'DEU','Auf Streife - Die Spezialisten','https://s3.amazonaws.com/schedulesdirect/assets/p12055424_st_h12_aa.jpg',4,NULL),('SH019641710000','Die Sendung beschäftigt sich mit den Themen der Promis und der Reichen und Schönen. Annemarie Warnkross nimmt die verschiedensten Ereignisse genauer unter die Lupe und scheut auch nicht davor, den Promis persönliche Fragen zu stellen.',NULL,'DEU','red','https://s3.amazonaws.com/schedulesdirect/assets/p10938653_st_h12_aa.jpg',4,NULL),('SH022240140000','Die Macher von `Drachenzähmen leicht gemacht\' präsentieren eine Serie, in der sich Hicks und Ohnezahn in riesige neue Abenteuer stürzen.',NULL,'DEU','Dragons: Auf zu neuen Ufern','https://s3.amazonaws.com/schedulesdirect/assets/p11845187_i_v3_aa.jpg',4,NULL),('SH019560090000','Donald Eppes ist ein Special Agent beim FBI, der seinen Bruder, den Mathematikprofessor Charlie, bittet, ihm bei der Aufklärung seiner komplizierteren Fälle zu helfen. Don hat für seine Karriere einen Großteil seines Privatlebens opfern müssen, das sich inzwischen fast völlig um seinen Beruf dreht. Nur seine Familie ist ihm wichtiger als seine Arbeit beim FBI, vor allem Charlie, obwohl er dessen Art und Weise, wie er die Welt sieht, wohl nie verstehen wird.',NULL,'DEU','Numb3rs - Die Logik des Verbrechens','https://json.schedulesdirect.org/20141201/image/assets/p185069_i_h3_aa.jpg',4,NULL),('SH024891640000','Hier werden die schlimmsten Flugkatastrophen und deren Gründe nach Auswertung aller Fakten realistisch nachgestellt, mit authentischen Tonaufzeichnungen und Interviews von Überlebenden, Spezialisten, Augenzeugen und Famlienmitgliedern der Opfer.',NULL,'DEU','Mayday','https://s3.amazonaws.com/schedulesdirect/assets/p203985_i_v5_aa.jpg',4,NULL),('SH019578090000','Reportagereihe mit Dokumentationen über Menschen, die sich der Natur besonders verbunden fühlen.',NULL,'DEU','NaturNah','https://s3.amazonaws.com/schedulesdirect/assets/p10910775_b_h12_aa.jpg',4,NULL),('SH034077640000','Gezeigt werden die aktuellen Wettkämpfe der International Biathlon Union (IBU).',NULL,'DEU','Biathlon','https://s3.amazonaws.com/schedulesdirect/assets/p17775811_i_h12_aa.jpg',4,NULL),('SH018630230000','Hinter die Kulissen gucken, Einblicke in den Zoo bekommen, die dem normalen Besucher verborgen bleiben - `Giraffe, Erdmännchen & Co.\' erzählt täglich Geschichten aus dem Zoo Frankfurt und dem Opel-Zoo. Der Zooalltag steht dabei im Mittelpunkt.',NULL,'DEU','Giraffe, Erdmännchen & Co.','https://s3.amazonaws.com/schedulesdirect/assets/p10491459_i_h12_aa.jpg',4,NULL),('SH032450610000','Zwei Jahre nach dem God Blader\'s Cup macht sich das wilde Kind Aiga Akaba, das in der Natur aufgewachsen ist, auf den Weg, um Gegner zu bekämpfen, um stärker zu werden und Valt Aoi zu besiegen.',NULL,'DEU','Beyblade: Burst Turbo','https://s3.amazonaws.com/schedulesdirect/assets/p15992095_b_s2_aa.jpg',4,NULL),('SH032924290000','Ein hartnäckiges, zehnjähriges Mädchen gibt Antworten auf die wichtigen Fragen des Lebens. Beispielsweise was zu tun ist, wenn man eine Jacke geschenkt bekommt, die einem nicht gefällt oder warum Karpfenfischen eine Männerdomäne ist.',NULL,'DEU','Die Regeln von Floor','https://s3.amazonaws.com/schedulesdirect/assets/p15322787_i_s2_aa.jpg',4,NULL),('SH019578260000','Die Thundermans scheinen auf den ersten Blick eine normale Familie zu sein. Doch der Schein trügt, denn jeder der Thundermans hat eine oder mehrere Superkräfte. Phoebe besitzt die selben Superkräfte wie Max. Sie wird zum Superheld, er zum Bösewicht.',NULL,'DEU','Die Thundermans','https://s3.amazonaws.com/schedulesdirect/assets/p10259786_i_v5_aa.jpg',4,NULL),('SH026338280000','Der britische Tierarzt Julian Norton praktiziert in der Tierklinik, die durch den Landtierarzt und `Der Doktor und das liebe Vieh\'-Buchautoren James Herriot Bekanntheit erlangte. Diese Dokumentationsreihe begleitet Norton und sein Praxisteam.',NULL,'DEU','Der Tierarzt von Yorkshire','https://s3.amazonaws.com/schedulesdirect/assets/p12105706_i_h12_aa.jpg',4,NULL),('SH018433120000','Die Sendung vertieft die Informationen über tagesaktuelle Ereignisse und zeigt Zusammenhänge sowie Hintergründe. Häufig gibt es mehrere Beiträge zu einem Thema, in denen unterschiedliche Aspekte beleuchtet werden. Oft ergänzt ein Interview mit einem Experten oder ein Schaltgespräch mit einem Reporter die Filmberichte. In der Regel gibt es zum wichtigsten Thema des Tages einen Kommentar. Das Spektrum der Themen umfasst neben den aktuellen Hintergrundberichten auch längere Reportagen, die nicht an den Tag gebunden sind. Kultur und Kino runden die Sendung ab. Beiträge aus der Politik überwiegen aber in der Berichterstattung, gefolgt vom Themenkomplex Wirtschaft.',NULL,'DEU','Tagesthemen','https://s3.amazonaws.com/schedulesdirect/assets/p10414050_b_h3_aa.jpg',4,NULL),('SH019562270000','Jonathan Smith kehrt als Engel auf die Erde zurück. Er erhält von Gott den Auftrag, den Menschen Liebe, Verständnis, Rücksichtnahme und Achtung beizubringen. Obwohl er überirdische Kräfte besitzt, kommt er meistens ohne sie aus.',NULL,'DEU','Ein Engel auf Erden','https://json.schedulesdirect.org/20141201/image/assets/p400821_i_v3_ab.jpg',4,NULL),('SH019460040000','Zwei Familien in Ost-Berlin, die gegensätzlicher nicht sein könnten: die Kupfers, die als mächtiges Rad im DDR-System funktionieren und die Hausmanns, die aus dem eher kritischen Milieu stammen. Da verliebt sich Martin Kupfer in Julia Hausmann.',NULL,'DEU','Weissensee','https://json.schedulesdirect.org/20141201/image/assets/p10073837_i_h3_ab.jpg',4,NULL),('SH029154870000','Die Ninja beschützen die königliche Familie und verhindern, dass Lord Garmadon wiederbelebt wird.',NULL,'DEU','Ninjago - Garmadons Motorrad-Gang','https://s3.amazonaws.com/schedulesdirect/assets/p15219501_st_h12_aa.jpg',4,NULL),('SH019667870000','Planet Schule schlägt ein neues Kapitel auf. Das Projekt bietet modernes, mediengestütztes Lernen und Unterrichten - für Lehrer, für Schüler und Bildungsinteressierte. Dafür erweitern und aktualisieren wir kontinuierlich unser Angebot.',NULL,'DEU','Planet Schule','https://s3.amazonaws.com/schedulesdirect/assets/p10948934_b_h12_ab.jpg',4,NULL),('SH021776960000','Die Dokumentation blickt hinter die Kulissen von Hochsicherheitsgefängnissen in den USA. Dabei wird sowohl der Alltag der Insassen als auch die oftmals gefährliche Arbeit des Sicherheitspersonals gezeigt.',NULL,'DEU','Hard Time','https://s3.amazonaws.com/schedulesdirect/assets/p242718_i_v3_aa.jpg',4,NULL),('SH023434500000','Der belgische Detektiv Hercule Poirot tut alles, was in seiner Macht steht, um komplexe Verbrechen auf der Grundlage weniger Hinweise aufzudecken. Er wird bei seiner täglichen Arbeit von seinen treuen Assistenten unterstützt.',NULL,'DEU','Agatha Christies Poirot','https://s3.amazonaws.com/schedulesdirect/assets/p466168_i_h3_al.jpg',4,NULL),('SH019577750000','Der Meeresschwamm SpongeBob Schwammkopf lebt in einer umgebauten Ananas in der Unterwasserstadt Bikini Bottom. Er ist sehr freundlich, aber auch etwas naiv. Seine Freizeit verbringt er meist mit seinem besten Freund Patrick, einem Seestern.',NULL,'DEU','SpongeBob Schwammkopf','https://s3.amazonaws.com/schedulesdirect/assets/p184854_i_h12_aa.jpg',4,NULL),('SH015402260000','`nano\' ist das wochentäglich ausgestrahlte Wissenschaftsmagazin. Die Redaktion achtet auf eine hohe Aktualität und Wissenschaftlichkeit der Beiträge ebenso wie auf den praktischen Nutzen der vorgestellten Erkenntnisse.',NULL,'DEU','nano','https://json.schedulesdirect.org/20141201/image/assets/p9125869_i_v3_aa.jpg',4,NULL),('SH019700570000','Thomas Lang präsentiert Streitigkeiten zwischen Nachbarn, die sich einfach richtig auf die Nerven gehen. Dabei kommt es auch vor, dass der Streit ausartet und die Parteien zu den skurrilsten Methoden der Rache zurückgreifen.',NULL,'DEU','Höllische Nachbarn','https://s3.amazonaws.com/schedulesdirect/assets/p10961320_st_h12_aa.jpg',4,NULL),('SH018438190000','Das Boulevardmagazin berichtet über die Highlights der aktuelle Nachrichten und Promi Ereignisse. Kamila Senjo oder Mareile Höppner moderieren die wichtigsten Themen von Heute.',NULL,'DEU','Brisant','https://s3.amazonaws.com/schedulesdirect/assets/p10415610_b_h3_aa.jpg',4,NULL),('SH019124220000','Im Mittelpunkt des Wissenformats stehen faszinierende Erkenntnisse über Körper und Geist. Dr. med. Susanne Holst nimmt sich zentraler Fragen an, wie: Was ist der Mensch aus der Sicht der Wissenschaft? Wie hängen Körper, Psyche und Verhalten zusammen?',NULL,'DEU','Wissen vor acht - Mensch','https://s3.amazonaws.com/schedulesdirect/assets/p10733353_b_h3_aa.jpg',4,NULL),('SH019568620000','In informativen Beiträgen werden in diesem Wissensmagazin Antworten auf Fragen geboten, die sich jeder schon einmal gestellt hat. Die Themen rangieren von Nützlichem und Spektakulärem bis hin zu Amüsantem und Alltäglichem.',NULL,'DEU','n-tv Wissen','https://json.schedulesdirect.org/20141201/image/assets/p10907375_b_h12_aa.jpg',4,NULL),('SH030833490000','Die sechs heldenhaften Hunde Chase, Marshall, Rocky, Zuma, Rubble und Skye führen mit Hilfe ihres Trainers Ryder verschiedene Missionen in ihrem Wohnort durch. Von Katzen auf Bäumen bis zu Zügen, die feststecken, ist alles dabei.',NULL,'DEU','Paw Patrol - Helfer auf vier Pfoten','https://json.schedulesdirect.org/20141201/image/assets/p12113918_i_h12_aa.jpg',4,NULL),('SH019561530000','Der Rechtsanwalt Ingo Lenßen untersucht mit seinem Team aus Detektiven fiktive Kriminalfälle. Dabei wird er meist mit dem Aufklären von mittelschweren Straftaten und Verbrechen beauftragt. Und manchmal gerät auch er selbst ins Visier der Verbrecher.',NULL,'DEU','Lenßen & Partner','https://json.schedulesdirect.org/20141201/image/assets/p9019903_st_h12_aa.jpg',4,NULL),('SH026888200000','Der Traum vom Haus mit Blick auf einen See bleibt für viele leider aus finanziellen Gründen unerfüllt. Die Sendung begleitet Familien auf der Suche nach ihrem Traumhaus am Wasser und zeigt, dass man auch mit einem kleinen Budget fündig werden kann.',NULL,'DEU','Lakefront - Haus am See gesucht','https://s3.amazonaws.com/schedulesdirect/assets/p10975488_i_h12_ab.jpg',4,NULL),('SH019560640000','Die Serie begleitet Polizisten bei ihren alltäglichen Einsätzen, die auf realen Fällen basieren. Dabei sind sie rund um die Uhr im Einsatz. Gezeigt werden Fälle von gewalttätigen Auseinandersetzungen, häuslicher Gewalt sowie Drogenmissbrauch. Die Bandbreite an Polizeiarbeit ist enorm. Sie beschränkt sich nicht nur auf die Bekämpfung von Verbrechen. Die Beamten auf Streife helfen auch verwirrten Menschen wie etwa Rentnern, die ihre Adresse vergessen haben oder Jugendlichen, die in ihrem pubertären Leichtsinn Vorbilder brauchen.',NULL,'DEU','Auf Streife','https://s3.amazonaws.com/schedulesdirect/assets/p10904248_b_h3_ab.jpg',4,NULL),('SH019836710000','Todd Hoffmann und seine sechs Mann starke Crew wollen in der Wildnis Alaskas, nahe der kanadischen Grenze, nach Gold schürfen. Sie hoffen auf Reichtümer. Der Alltag der Goldsucher in der verlassenen Gegend ist jedoch alles andere als leicht.',NULL,'DEU','Die Schatzsucher - Goldrausch in Alaska','https://s3.amazonaws.com/schedulesdirect/assets/p8825082_i_v3_ab.jpg',4,NULL),('SH015403480000','Das Wissensmagazin beschäftigt sich mit den aktuellen Nachrichten der Woche und erläutert die jeweiligen Hintergründe. Daneben gibt es in jeder Sendung auch Reisen ins Unbekannte und werden Mythen des Alltags aufgeklärt.',NULL,'DEU','W wie Wissen','https://json.schedulesdirect.org/20141201/image/assets/p9126340_i_v3_aa.jpg',4,NULL),('SH019759590000','Einzigartige Charaktere aus ganz Großbritannien erkunden die exzentrischen, seltsamen und bizarren Facetten des Alltags. Mit dabei sind Teenager-Delinquent Vicky, die Pflegekraft Lou, der Patient Andy sowie der homosexuelle Daffyd.',NULL,'DEU','Little Britain','https://s3.amazonaws.com/schedulesdirect/assets/p185674_b_h3_aa.jpg',4,NULL),('SH019569840000','Phineas Flynn und sein Stiefbruder Ferb Fletcher überlegen jeden Tag ihrer Sommerferien aufs Neue, was sie gegen die Langeweile tun können. Meist stellen sie dann verrückte Sachen an, die nicht selten zum totalen Chaos führen. Ein gefundenes Fressen für Candace, die Schwester der beiden, die keine Gelegenheit auslässt, ihre Brüder bei Mama anzuschwärzen - was ihr allerdings meist misslingt.',NULL,'DEU','Phineas und Ferb','https://s3.amazonaws.com/schedulesdirect/assets/p186178_i_h12_aa.jpg',4,NULL),('SH031277290000','Eine Sendung.',NULL,'DEU','Helden der Nacht','https://s3.amazonaws.com/schedulesdirect/assets/p16379708_b_h3_aa.jpg',4,NULL),('SH027786700000','Rechtsanwältin Karen E. Laine und ihre Tochter, die Immobilienexpertin Mina Starsiak sind ein unschlagbares Team. In ihrer Heimatstadt Indianapolis verwandeln sie heruntergekommene Häuser mit kleinem Budget in Traumhäuser.',NULL,'DEU','Good Bones - Mutter, Tochter, Home-Makeover','https://s3.amazonaws.com/schedulesdirect/assets/p12588321_i_h12_ac.jpg',4,NULL),('SH019808820000','Christy Plunkett bekam ihre Tochter Violet mit 16 Jahren und hat einen Sohn namens Roscoe gemeinsam mit ihrem Ex-Mann. Seit einem Jahr ist Christy nun trocken und hat immer noch schwer mit ihrer Sucht zu kämpfen. Sie arbeitet als Kellnerin in einem Restaurant und hat eine Affäre mit ihrem verheirateten Chef. Eines Tages fasst sie den Entschluss, ihr Leben umzukrempeln und besucht sogar Treffen der Anonymen Alkoholiker. Hilfe bekommt sie ausgerechnet von ihrer Mutter Bonnie. Sie war selbst alkoholsüchtig und drogenabhängig und konnte sich daher nur wenig um Tochter Christy kümmern, als die ein Kind war. Nun will sie das wiedergutmachen und versucht, das Vertrauen ihrer Tochter wiederzugewinnen. Bonnie will endlich damit anfangen, eine gute Mutter für Christy zu sein, Chaos inklusive.',NULL,'DEU','Mom','https://s3.amazonaws.com/schedulesdirect/assets/p9978206_l_h3_aa.jpg',4,NULL),('SH017428710000','Die Serie bietet ihren Zuschauern Eindrücke vom Leben und den Arbeitsabläufen der Crew an Bord eines Kreuzfahrtschiffes, das die schönsten Urlaubsziele der Welt ansteuert. Kapitän Morten Hansen verbreitet dabei stets gute Laune.',NULL,'DEU','Verrückt nach Meer','https://s3.amazonaws.com/schedulesdirect/assets/p9987914_b_h12_aa.jpg',4,NULL),('SH021867870000','Die Dokumentation erforscht das All auf neue Art und Weise: Mit Hilfe von CGI-Animationen werden Planeten, Monde, Schwarze Löcher, Sterne und ganze Galaxien Schicht für Schicht enthüllt. Dadurch kann ihre Struktur und ihre Herkunft erklärt werden.',NULL,'DEU','Strip the Cosmos','https://s3.amazonaws.com/schedulesdirect/assets/p11170255_i_h12_aa.jpg',4,NULL),('SH022890250000','Mitch Buchannon ist ein erfahrener Rettungsschwimmer, der mit seinem Team den Strand von Malibu überwacht. An dem stark besuchten Badestrand müssen die Rettungsschwimmer spannende Einsätze und romantische Abenteuer bestehen.',NULL,'DEU','Baywatch - Die Rettungsschwimmer von Malibu','https://s3.amazonaws.com/schedulesdirect/assets/p183964_b_h3_ad.jpg',4,NULL),('SH022690770000','Die viereinhalb Freunde: Das sind Kalle, Fred, Steffi, Radieschen und der eigenwillige Hund Dandy. Zusammen bilden sie das Detektivbüro `Kalle & Co\'. Und weil Kalle die Detektei gegründet hat, ist er auch der Chef. Er will immer wieder Fälle lösen.',NULL,'DEU','4 1/2 Freunde','https://s3.amazonaws.com/schedulesdirect/assets/p12135082_b_h12_aa.jpg',4,NULL),('SH019932500000','Der Kriminelle Neal Caffrey versteht es meisterhaft, seine Verfolger immer wieder auszutricksen, bis er eines Tages von dem FBI-Agenten Peter Burke festgenommen wird. Doch statt im Gefängnis zu landen, wird er zum Partner des Agenten.',NULL,'DEU','White Collar','https://s3.amazonaws.com/schedulesdirect/assets/p7806806_l_h3_aa.jpg',4,NULL),('SH018485680000','Geschichten aus dem Leipziger Zoo - Alltag, Sorgen, und Erfolge der Zoobewohner und ihrer Pfleger. In erster Linie geht es natürlich um die Tiere, aber auch um die Menschen, die sie besuchen kommen und um jene, die den Zoobetrieb in Gang halten.',NULL,'DEU','Elefant, Tiger & Co','https://s3.amazonaws.com/schedulesdirect/assets/p10432305_b_v5_aa.jpg',4,NULL),('SH032008990000','Die vier neugierigen Dinosaurierfreunde Rocky, Bill, Tiny und Mazu erforschen das Geheimnis des Gigantosaurus, des größten und wildesten Dinosauriers überhaupt. Zudem stellen sie sich ihren Ängsten und erleben gemeinsam viele Abenteuer.',NULL,'DEU','Gigantosaurus','https://s3.amazonaws.com/schedulesdirect/assets/p16345968_b_h12_ab.jpg',4,NULL),('SH019775860000','Mit der Unterstützung seines zehnköpfigen Teams löst der Privatdetektiv Carsten Stahl zahlreiche Kriminalfälle. Seine Kollegen bilden Teams, um die Verbrecher möglichst schnell zu überführen.',NULL,'DEU','Privatdetektive im Einsatz','https://s3.amazonaws.com/schedulesdirect/assets/p10991610_i_h3_aa.jpg',4,NULL),('SH014726400000','Der Alltag der Ärzte und Schwestern in der Sachsenklinik wird hauptsächlich von den Schicksalen und Leiden ihrer Patienten bestimmt. Neben der Behandlung der Menschen entladen sich Konflikte des Klinikalltags auch mal im Privatleben des Personals.',NULL,'DEU','In aller Freundschaft','https://s3.amazonaws.com/schedulesdirect/assets/p8832399_b_h12_aa.jpg',4,NULL),('SH019774950000','Servicemagazin des NDR, mit Tipps und Tricks zu alltäglichen Themen.',NULL,'DEU','Mein Nachmittag','https://json.schedulesdirect.org/20141201/image/assets/p10990972_i_h12_ab.jpg',4,NULL),('SH014792920000','Die Experten dieser Sendung präsentieren Dosen von `Lock & Lock\' zur Aufbewahrung von Lebensmitteln. Sie sind luft-, wasser- und aromadicht, denn das Schließen dieser Dosen funktioniert mit einem Silikonring und einem vierfachen Klickverschluss.',NULL,'DEU','Lock & Lock','https://s3.amazonaws.com/schedulesdirect/assets/p8860172_st_h12_aa.jpg',4,NULL),('SH016396210000','Live-Magazin mit landespolitischem Charakter. Ein aktueller Blick durchs Land, das Regionale steht hier im Mittelpunkt. Menschen, Land und Leute kommen zu Wort, werden unter die Lupe genommen oder porträtiert.',NULL,'DEU','drehscheibe','https://s3.amazonaws.com/schedulesdirect/assets/p9562824_b_h12_ab.jpg',4,NULL),('SH034259390000','Ein junges Mädchen erkrankt an Leukämie und entwickelt eine beeindruckende Charakterstärke.',NULL,'DEU','Sterben ist nicht so mein Ding!','https://json.schedulesdirect.org/20141201/image/assets/p14449400_i_h12_aa.jpg',4,NULL),('SH034194920000','Seit in vielen Handwerksberufen die Meisterpflicht Vergangenheit ist, wird gepfuscht wie nie zuvor. Für die Kunden wird das meist teuer; die Sendung verfolgt die vermeintlichen `Bauprofis\' mit versteckter Kamera bei der Arbeit.',NULL,'DEU','Aufgepasst, der Profi kommt! - Handwerk zwischen Hit und Horror','https://s3.amazonaws.com/schedulesdirect/assets/p17834040_st_h12_aa.jpg',4,NULL),('SH020904420000','`Conny\' Niedrig und `Bernie\' Kuhnt sind zwei Kriminalkommissare von der Kriminalpolizei Recklinghausen. Bei den authentisch nachgespielten Ermittlungen arbeiten die beiden im Team, um die Verbrechen rund um Duisburg zu bekämpfen.',NULL,'DEU','Niedrig und Kuhnt - Kommissare ermitteln','https://json.schedulesdirect.org/20141201/image/assets/p452307_st_h12_aa.jpg',4,NULL),('SH029354590000','Die Ärzte, Pfleger, Physiotherapeuten, Reinigungskräfte und das Küchenteam des Waldkrankenhauses in Eisenberg werden begleitet. Die Sendung wirft einen Blick in eine ganz eigene Klinikwelt und stößt auf Patienten und ihre Geschichten.',NULL,'DEU','Die Waldklinik - Echte Fälle, echte Gefühle, echte Menschen','https://s3.amazonaws.com/schedulesdirect/assets/p15349127_st_h12_aa.jpg',4,NULL),('SH019576310000','Fünf angehende Ärzte und ihre Mentoren arbeiten, streiten und lieben sich im Seattle Grace Hospital. Als Assistenzärzte sind Meredith Grey, Cristina Yang, George O\'Malley, Izzie Stevens und Alex Karev zwar auf viel 