antwortlich. Mittels Forensik, Gentechnik und Gerichtsmedizin lösen die Beamten des CSI knifflige Fälle. Horatio ist für sein fotografisches Gedächtnis und seinen trockenen Charme bekannt. An seiner Seite ermitteln die Ballistikerin Calleigh Duquesne, der belesene Tim Speedle, DNA-Spezialistin Alexx Woods und Eric Delko, Spezialist für die Auswertung von Fingerabdrücken sowie Experte im Drogenmillieu.',NULL,'DEU','CSI: Miami','https://s3.amazonaws.com/schedulesdirect/assets/p184820_i_h3_aa.jpg',4,NULL),('SH034278480000','Dokumentation über die Big Wave-Surfer.',NULL,'DEU','Olympische Spiele: Shredding Monsters','https://json.schedulesdirect.org/20141201/image/assets/p17873987_st_h12_aa.jpg',4,NULL),('SH028642530000','Die Serie zeigt Bauprojekte, deren Umsetzung bis vor wenigen Jahrzehnten undenkbar erschien.',NULL,'DEU','Project Impossible','https://s3.amazonaws.com/schedulesdirect/assets/p13972158_b_h12_aa.jpg',4,NULL),('SH021143370000','Jährlich sucht Heidi Klum mit von ihr ausgewählten Gastjuroren nach dem Topmodel Deutschlands. Zwölf junge Frauen kämpfen um den Titel und einen Modelvertrag. Dabei müssen sie mehrere Tests bestehen und Aufträge ergattern.',NULL,'DEU','Germany\'s next Topmodel','https://json.schedulesdirect.org/20141201/image/assets/p11448962_st_h12_aa.jpg',4,NULL),('SH019979900000','Jimmie DeRamus betreibt mit seiner Familie seit über 25 Jahren das Pfandleihhaus `Silver Dollar Pawn & Jewelry Center\' in Louisiana. Sie finden ständig neue Kostbarkeiten und seltene Gegenstände. Es werden sogar Bustouren mit Führung angeboten.',NULL,'DEU','Cajun Pawn Stars','https://s3.amazonaws.com/schedulesdirect/assets/p8984592_b_v3_ab.jpg',4,NULL),('SH019714520000','Aktuelles, was die Region bewegt, News vom Tag aus Berlin und Brandenburg, Tipps für den Abend in Mark und Metropole sowie Streiflichter aus den Nachbarländern.',NULL,'DEU','rbb um 6 - Das Ländermagazin','https://json.schedulesdirect.org/20141201/image/assets/p10967016_i_h12_aa.jpg',4,NULL),('SH024296700000','Eddie Huang und seine Familie stammen ursprünglich aus Taiwan und leben den Großteil ihres Lebens in Chinatown in Washington D.C. 1995 zieht Eddie jedoch zusammen mit seinem Vater Louis, seiner Mutter Jessica und seinen zwei Geschwistern Emery und Evan nach Orlando, Florida. Dort will seine Familie ein Restaurant mit Cowboy-Flair eröffnen. Der darauffolgende Kulturschock ist unvermeidbar. Nicht zuletzt ist der chinesische Bevölkerungsanteil Floridas zu dieser Zeit ein äußerst überschaubarer und der Rest der Bevölkerung propagiert in erster Linie westliche Werte - vom amerikanischen Traum ganz zu schweigen. Auch in der Schule und in der Nachbarschaft machen die kulturellen Unterschiede den Anfang nicht gerade leicht.',NULL,'DEU','Fresh Off the Boat','https://s3.amazonaws.com/schedulesdirect/assets/p10777606_l_h3_aa.jpg',4,NULL),('SH019842690000','Fox Mulder arbeitet als Special Agent beim FBI, hat dort aber den Ruf als Verschwörungstheoretiker inne. Als kleiner Junge hat er miterlebt, wie seine Schwester von Außerirdischen entführt wurde. Seitdem glaubt er an deren Existenz und beschäftigt sich mit paranormalen Phänomenen. Er arbeitet in der Abteilung für X-Akten, Kriminalfälle, die nicht erklärbar sind. Eines Tages bekommt er Dana Scully als Partnerin gestellt. Sie ist das Gegenteil von Mulder, skeptisch und unterkühlt. Gemeinsam arbeiten die beiden an mysteriösen Fälle, von Killer-Insekten bis hin zu Mutanten. Zeitgleich verfolgen sie die Aufdeckung einer Regierungsverschwörung, die versucht, die Existenz außerirdischen Lebens zu verschleiern.',NULL,'DEU','Akte X - Die unheimlichen Fälle des FBI','https://s3.amazonaws.com/schedulesdirect/assets/p183870_b_v5_aa.jpg',4,NULL),('SH014791700000','In der Sendung werden Blumenzwiebeln, Zimmerpflanzen, Stauden, Sträucher und mehr vorgestellt.',NULL,'DEU','Keyzers Blumenwelt','https://s3.amazonaws.com/schedulesdirect/assets/p8859810_st_h12_aa.jpg',4,NULL),('SH019769290000','Übertragungen von aktuellen Wettbewerben aus der Welt des Radsports.',NULL,'DEU','Radsport','https://s3.amazonaws.com/schedulesdirect/assets/p361948_i_h12_aa.jpg',4,NULL),('SH029820540000','Gezeigt werden Dokumentationen zu verschiedenen Themen.',NULL,'DEU','phoenix plus','https://s3.amazonaws.com/schedulesdirect/assets/p15586965_st_h12_aa.jpg',4,NULL),('SH029035350000','TV-Koch Roland Trettl heißt Singles aus ganz Deutschland in seinem Restaurant willkommen. Die Kandidaten werden je nach Vorlieben und Abneigungen gepaart und lernen sich zum ersten Mal bei einem Dinner im Restaurant kennen.',NULL,'DEU','First Dates - Ein Tisch für zwei','https://s3.amazonaws.com/schedulesdirect/assets/p15179177_st_h12_aa.jpg',4,NULL),('SH018558610000','Das Magazin zeigt von Montag bis Freitag aktuelle Nachrichten zur Mittagszeit. Die Moderatorin präsentiert Informationen aus aller Welt, mit einem Schwerpunkt auf Deutschland, und spricht außerdem über Servicethemen, Lifestyle sowie das Neueste aus der Welt der Stars und Sternchen. Abgerundet wird das Sendungsprogramm mit spannenden Reportagen, die mitunter eine solche Brisanz haben, dass sie politische und wirtschaftliche Akteure zum Handeln veranlassen, und Mini-Dokumentationen, die verblüffende Einblicke in den Alltag der Deutschen geben.',NULL,'DEU','Punkt 12 - Das RTL-Mittagsjournal','https://s3.amazonaws.com/schedulesdirect/assets/p10458783_st_h12_ab.jpg',4,NULL),('SH019579470000','Verbrauchermagazin, das sich auf Produkttests und die kritische Berichterstattung konzentriert. `Markt\' gibt praktische Tipps in allen Alltagsfragen, deckt dubiose Geschäftspraktiken auf und mischt sich ein, wenn Zuschauer Ärger mit Firmen haben.',NULL,'DEU','Markt','https://s3.amazonaws.com/schedulesdirect/assets/p10911289_b_h12_aa.jpg',4,NULL),('SH019855780000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Aachen.',NULL,'DEU','Lokalzeit aus Aachen','https://s3.amazonaws.com/schedulesdirect/assets/p11024416_b_h12_ab.jpg',4,NULL),('SH031349300000','Von `Herr der Ringe\' bis zu `Harry Potter\' - die Sendung blickt auf die imposantesten Filmkulissen.',NULL,'DEU','Wilde Drehorte','https://s3.amazonaws.com/schedulesdirect/assets/p14886652_i_s2_aa.jpg',4,NULL),('SH030277930000','Acht attraktive Singles wollen sich auf einer Insel näherkommen und einen romantischen Urlaub im Paradies miteinander verbringen. Doch die Idylle wird gestört, als sämtliche Ex-Partner auftauchen und die Datingshow ordentlich aufmischen.',NULL,'DEU','Ex on the Beach US','https://json.schedulesdirect.org/20141201/image/assets/p15326276_i_h12_aa.jpg',4,NULL),('SH023583940000','Reporter Daniel Aßmann recherchiert Kosten des Alltags und befragt Fachleute. Er erfährt, wie hoch die Spannen zwischen Herstellerpreisen und den Preisen im Geschäft sein können. Er geht in Fabriken und Verkaufsräume, um sich zu informieren.',NULL,'DEU','Ausgerechnet','https://s3.amazonaws.com/schedulesdirect/assets/p12560582_b_h12_aa.jpg',4,NULL),('SH019855850000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Ostwestfalen-Lippe.',NULL,'DEU','Lokalzeit OWL','https://s3.amazonaws.com/schedulesdirect/assets/p11024436_b_h3_ab.jpg',4,NULL),('SH023428360000','Der Lehrgang Informatik und Technologie vermittelt nützliches Wissen für Beruf und Alltag.',NULL,'DEU','TELEKOLLEG Informatik','https://s3.amazonaws.com/schedulesdirect/assets/p12479646_st_h12_aa.jpg',4,NULL),('SH034152480000','In der Sendung treten wöchentlich fünf Restaurantchefs gegeneinander an. Es gilt zu beweisen, welches Lokal das beste ist. Kriterien sind unter anderem das Essen, die Atmosphäre und der Service. Dem Gewinner winken 5.000 Euro Preisgeld.',NULL,'DEU','Mein Lokal, Dein Lokal - Der Profi kommt','https://s3.amazonaws.com/schedulesdirect/assets/p10451847_st_h12_ad.jpg',4,NULL),('SH025542980000','Der riesige Grizzlybär Grizzy wird von einer Horde nervtötender Lemminge geneckt.',NULL,'DEU','Grizzy und die Lemminge','https://s3.amazonaws.com/schedulesdirect/assets/p13330553_i_v3_aa.jpg',4,NULL),('SH019468800000','Das Magazin informiert die Zuschauer etwa in Sachen Politik, Kultur und Alltagsleben.',NULL,'DEU','MDR Thüringen Journal','https://s3.amazonaws.com/schedulesdirect/assets/p10871952_b_h12_ab.jpg',4,NULL),('SH019690300000','Das Magazin aus Österreich informiert über aktuelle Ereignisse und außergewöhnliche Schicksale. Nach der Top-Story mit einer aktuellen Reportage und einem weiterführenden Hintergrundbericht folgt das Schwerpunktthema der Woche.',NULL,'DEU','Thema','https://s3.amazonaws.com/schedulesdirect/assets/p10957673_b_h12_aa.jpg',4,NULL),('SH019671360000','In den USA mieten manche Privatpersonen Lagerräume für ihre Sachen an. Nach drei Monaten unbezahlter Miete kommt der Inhalt des Lagers zur Auktion. Allerdings dürfen die Interessenten den Lagerraum nur kurz von außen sehen, bevor sie bieten.',NULL,'DEU','Storage Wars - Die Geschäftemacher','https://s3.amazonaws.com/schedulesdirect/assets/p8354064_i_v5_ab.jpg',4,NULL),('SH026088950000','Die Sendung zeigt die neuesten Nachrichten aus dem Südwesten, mit Schwerpunkt Rheinland-Pfalz.',NULL,'DEU','SWR Aktuell Rheinland-Pfalz','https://json.schedulesdirect.org/20141201/image/assets/p13749524_b_v3_aa.jpg',4,NULL),('SH016917320000','Die Experten dieser Sendung präsentieren innovative Osterdekorationen.',NULL,'DEU','Osterdekorationen','https://s3.amazonaws.com/schedulesdirect/assets/p9755935_st_h12_aa.jpg',4,NULL),('SH019388320000','Im 16. Bezirk New Yorks kümmert sich die Polizeieinheit Special Victim Unit um ganz besonders schreckliche Verbrechen. Die Einheit beschäftigt sich hauptsächlich mit Verbrechen wie Vergewaltigungen, häusliche Gewalt, Kindesmissbrauch oder Entführungen. Detective Elliot Stabler, Olivia Benson und John Munch leiten das Team. Sie sind stets bemüht, ihre persönlichen Tragödien und Schicksale außen vor zu lassen, was allerdings nicht immer gelingt. Gemeinsam mit der Staatsanwaltschaft, Polizeicaptains, dem FBI sowie Medizinern sind sie auf der Jagd nach Sexualstraftätern und Kinderschändern.',NULL,'DEU','Law & Order: Special Victims Unit','https://s3.amazonaws.com/schedulesdirect/assets/p184536_l_h3_aa.jpg',4,NULL),('SH020082860000','In dieser Talkshow beantworten der Moderator und unterschiedlichen Experten die Fragen der Anrufer.',NULL,'DEU','Tagesgespräch','https://s3.amazonaws.com/schedulesdirect/assets/p11097051_b_h3_aa.jpg',4,NULL),('SH019576780000','Ben L. Matlock ist ein erfolgreicher Anwalt, der auch als Detektiv arbeitet. Unterstützt wird er dabei von dem jungen Privatdetektiv Tyle Hudson und Tochter Charlene. Mit Beobachtungsvermögen lösen sie selbst die aussichtslosesten Fälle.',NULL,'DEU','Matlock','https://s3.amazonaws.com/schedulesdirect/assets/p184228_l_h3_aa.jpg',4,NULL),('SH016520760000','Das Dokumentationsformat hat den Anspruch, gesellschaftlich und politisch relevante Themen aufzugreifen. Dabei soll, auch mit investigativen Ansätzen, immer ein direkter Bezug zum Alltag der Zuschauer hergestellt werden.',NULL,'DEU','ZDFzoom','https://s3.amazonaws.com/schedulesdirect/assets/p9610305_b_v3_aa.jpg',4,NULL),('SH020303920000','In den kältesten Regionen Nordamerikas gibt es eine der ungewöhnlichsten Transportbranchen der Welt. In diesen Gegenden können einige Orte und Firmen nur innerhalb weniger Monate mit Fahrzeugen erreicht werden - die Stunde der `Ice Road Truckers\'.',NULL,'DEU','Ice Road Truckers - Gefahr auf dem Eis','https://s3.amazonaws.com/schedulesdirect/assets/p185608_i_h12_aa.jpg',4,NULL),('SH019642530000','Die Dokumentationsreihe stellt die fünf weltweit herausragendsten Baumaschinen, Schiffe und Flugzeuge vor. Die Meisterwerke werden näher betrachtet und ihr Ursprung sowie ihr Einsatz erforscht.',NULL,'DEU','Die fünf Besten','https://json.schedulesdirect.org/20141201/image/assets/p9315756_i_h12_aa.jpg',4,NULL),('SH017428530000','Dokumentationsreihe, in der die Autoren des Senders jeweils einem konkreten gesellschaftlichen Thema auf den Grund gehen. Die Reihe zeigt dabei `die Rechercheschritte, bietet Lösungen an und unterstützt so die Orientierung in einer komplexeren Welt\'.',NULL,'DEU','45 Min','https://s3.amazonaws.com/schedulesdirect/assets/p9987883_b_h12_ab.jpg',4,NULL),('SH019742880000','Spektakuläre Aufnahmen aus dem Weltall im Nachtprogramm des BR. Die schönste Serie, die es zur Zeit im Fernsehen gibt, befand der Spiegel, als am 1. Juni 1994 im Nachtprogramm des Bayerischen Fernsehens die Space Night das erste Mal auf Sendung ging.',NULL,'DEU','Space Night','https://s3.amazonaws.com/schedulesdirect/assets/p10977813_b_h12_aa.jpg',4,NULL),('SH028157990000','Der Panzer ist eine Idee, so alt wie der Krieg. Anlässlich des 100. Jahrestages der ersten großen Panzerschlacht begibt sich die Sendung auf die Spur dieser Idee - von den Ursprüngen bis in die Neuzeit - und wagt einen Blick in die Zukunft.',NULL,'DEU','Panzer!','https://s3.amazonaws.com/schedulesdirect/assets/p14780968_st_h12_aa.jpg',4,NULL),('SH027020390000','Der kanadische Chefkoch Roger Mooking reist durch die USA, um alles über das Barbecue zu lernen. Er möchte verstehen, was Amerikaner daran so fasziniert, warum es sich so großer Beliebtheit erfreut und worauf es wirklich ankommt.',NULL,'DEU','Man Fire Food - Barbecue Roadtrip durch die USA','https://s3.amazonaws.com/schedulesdirect/assets/p9389343_i_h12_ad.jpg',4,NULL),('SH029397090000','Vor Urzeiten haben Kräfte aus dem Erdinneren den Inselstaat Neuseeland im Pazifik isoliert und verändern sein Äußeres kontinuierlich. Auch die Tiere müssen sich den oft beschwerlichen Gegebenheiten der Natur anpassen und sich gegen Rivalen behaupten.',NULL,'DEU','Neuseeland - Rivalen der Urzeit','https://s3.amazonaws.com/schedulesdirect/assets/p15378081_st_h12_aa.jpg',4,NULL),('SH027538200000','Der Alltag in der Wildnis ist für Tiere von ständigem Kampf geprägt. Um Nahrung zu finden und das Überleben ihrer Jungen zu sichern, wenden Tiere zahlreiche Strategien, Taktiken und Tricks an.',NULL,'DEU','Die Waffen der Tiere','https://s3.amazonaws.com/schedulesdirect/assets/p12876863_i_v3_aa.jpg',4,NULL),('SH025063190000','Ärzte und Pflegepersonal eines Krankenhauses geben Einblick in ihren beruflichen Alltag. Doch neben den professionellen Höhen und Tiefen werden auch persönliche Schicksale dokumentiert. Gelegentlich muss die Polizei zur Unterstützung gerufen werden.',NULL,'DEU','Klinik am Südring','https://s3.amazonaws.com/schedulesdirect/assets/p13254823_st_h12_aa.jpg',4,NULL),('SH018661100000','Dr. Temperance `Bones\' Brennan ist eine grandiose forensische Anthropologin am staatlichen Jeffersonian Institute in Washington. Der Umgang mit ihren Mitmenschen fällt ihr allerdings recht schwer. Gemeinsam mit dem Ermittler und ehemaligen Scharfschützen Seeley Booth untersucht sie für das FBI Fälle, die einige Jahrzehnte oder noch weitaus länger zurückliegen. Aus diesem Grund sind die Beteiligten meist schon tot und Knochen sind oft die einzigen Zeugen.',NULL,'DEU','Bones - Die Knochenjägerin','https://json.schedulesdirect.org/20141201/image/assets/p185129_i_h12_ae.jpg',4,NULL),('SH034194680000','Flüsse, Kanäle und Seengebiete prägen seit Jahrhunderten die Kultur Europas. Unterwegs auf Wasserwegen entdeckt die Dokumentationsreihe fünf europäische Regionen vom Wasser aus. Es geht von der Camargue bis ins französische Zentralmassiv.',NULL,'DEU','Stromaufwärts! Europas Wasserwege','https://s3.amazonaws.com/schedulesdirect/assets/p17833902_st_h12_aa.jpg',4,NULL),('SH029913070000','Olivia ist nach Heartlake City gezogen und versucht sich darin, neue Kontakte zu knüpfen. Ihr erster neuer Freund ist ein Welpen, das sie und den halben Ort zeimlich auf Trab hält. Währenddessen begegnet sie auch vier Mädchen.',NULL,'DEU','Friends - Freundinnen auf Mission','https://s3.amazonaws.com/schedulesdirect/assets/p15596354_b_h12_ac.jpg',4,NULL),('SH019694470000','Magazin für Vorschulkinder, das seine Zuschauer einlädt, zu den Themen einer Sendung zu malen und zu basteln. Für ausgewählte Einsendungen gibt es eine Online-Galerie, in der die Fans die Bilder von Kindern bestaunen können.',NULL,'DEU','ENE MENE BU - und dran bist du','https://s3.amazonaws.com/schedulesdirect/assets/p10958956_b_h12_aa.jpg',4,NULL),('SH030923770000','Die kleine Lokomotive Thomas und seine Freunde erleben spannende Abenteuer auf der Insel Sodor.',NULL,'DEU','Thomas & seine Freunde','https://json.schedulesdirect.org/20141201/image/assets/p15865104_i_h12_aa.jpg',4,NULL),('SH019855800000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Bonn.',NULL,'DEU','Lokalzeit aus Bonn','https://s3.amazonaws.com/schedulesdirect/assets/p11024418_b_h12_ab.jpg',4,NULL),('SH032932480000','Die Dokumentation widmet sich dem russischen Geheimdienst KGB und seiner Rolle im Kalten Krieg.',NULL,'DEU','Schwert und Schild - Russlands Geheimdienste','https://s3.amazonaws.com/schedulesdirect/assets/p16718256_st_h12_ac.jpg',4,NULL),('SH019647440000','Der Häusermarkt in Phoenix, Arizona, boomt und ist dementsprechend hart umkämpft. Immobilien-Experten liefern sich bei Auktionen heiße Bietwettkämpfe mit der Konkurrenz, um die besten Objekte zu ergattern - und diese dann mit Gewinn zu verkaufen.',NULL,'DEU','House Hunters - Die Immobilien-Jäger','https://json.schedulesdirect.org/20141201/image/assets/p9290257_i_h12_aa.jpg',4,NULL),('SH019559820000','Der erfolgreiche und angesehene Krimiautor und alleinerziehender Vater Richard Castle stellt schockiert fest, dass zwei Morde tatsächlich nach dem Vorbild seines Romans verübt wurden. Von da an will er nicht nur über erfundene Verbrechen schreiben, sondern der Polizei und insbesondere der Ermittlungsbeamtin Kate Beckett bei der Aufklärung verschiedener Fälle helfen. Die beiden bilden ein ausgesprochen effektives Ermittlerteam, auch wenn Castle eine Auge auf Kate geworfen hat, die gegen seinen Charme immun zu sein scheint.',NULL,'DEU','Castle','https://s3.amazonaws.com/schedulesdirect/assets/p188601_l_h3_aa.jpg',4,NULL),('SH027227490000','Raubtiere sind zum Töten geboren, das Jagen ist tief in ihren Genen verankert. Doch die Taktiken, derer sich die verschiedenen Spezies bedienen, sind völlig unterschiedlich. Die Serie beleuchtet die unterschiedlichen Jagdstrategien.',NULL,'DEU','Tierische Instinkte','https://s3.amazonaws.com/schedulesdirect/assets/p12155427_i_h3_aa.jpg',4,NULL),('SH019567660000','Die `Outback-Trucker\' sind in ihren gigantischen, bis zu 50 Meter langen Lastwagen in ganz Australien unterwegs. Die Fahrten führen oft über unbefestigte Pisten und bergen unvorhersehbare Gefahren. Die Doku-Serie begleitet harte Jungs bei der Arbeit.',NULL,'DEU','Outback Truckers','https://s3.amazonaws.com/schedulesdirect/assets/p9629919_i_h12_ab.jpg',4,NULL),('SH019433120000','Die Doku-Soap begleitet Mädchen, die in jungen Jahren zu Müttern werden. Die jungen Frauen werden während der Schwangerschaft sowie nach der Geburt begleitet.',NULL,'DEU','Teenie-Mütter - Wenn Kinder Kinder kriegen','https://s3.amazonaws.com/schedulesdirect/assets/p10858728_st_h12_aa.jpg',4,NULL),('SH019360070000','Im Leben der Familie Simpson ist immer etwas los. Der liebenswerte, aber vom Pech verfolgte, schusselige und ziemlich faule Vater Homer Simpson arbeitet in einem Atomkraftwerk und versucht, seine Familie bestmöglich über Wasser zu halten. Seine Frau Marge ist als Mutter und Hausfrau die gute Seele im Hause Simpson und versucht stets, sowohl in der Familie als auch in der Gesellschaft die moralischen Grundwerte zu verbessern. Die Eltern haben alle Hände voll zu tun mit ihren drei Kindern. Bei dem zehnjährigen Bart weiß man nie, welchen Streich er als nächstes ausheckt. Die achtjährige hochintelligente und ehrgeizige Lisa ist eine Weltverbesserin, die in der Schule oft als Streber gehänselt wird. Vervollständigt werden die Simpsons von Baby Maggie. Das Leben der Familie und der anderen Bewohner der US-Kleinstadt Springfield ist geprägt vom alltäglichen Chaos und ganz normalen Wahnsinn der Gesellschaft.',NULL,'DEU','Die Simpsons','https://s3.amazonaws.com/schedulesdirect/assets/p183872_i_v5_ac.jpg',4,NULL),('SH018558660000','Deutschlands Boulevard-Sendung Nummer eins berichtet informativ, unterhaltsam und ehrlich über die unterschiedlichsten Themenbereiche und ist dabei humorvoll, provokant und investigativ. Dabei berichtet die Moderation stets über aktuelle Themen, wie etwa über Mietnomaden in Mallorca, Behördenpannen in der Justizvollzugsanstalt oder die Knöllchen-Quote bei Politessen und Polizisten. Das Magazin begleitet außerdem Singles bei ihrer Partnersuche, führt Wahrheitstests durch und unterstützt Dorfbewohner beim Abnehmen.',NULL,'DEU','Explosiv - Das Magazin','https://s3.amazonaws.com/schedulesdirect/assets/p10458792_st_h12_ab.jpg',4,NULL),('SH027570840000','Marinette wird von ihrer Mutter aufs Land geschickt, um bei ihren Großeltern und ihrer Tante Susan zu wohnen. Das Mädchen sträubt sich vorerst gegen alles, was das neue Leben mit sich bringt. Doch dann findet sie Gefallen an den täglichen Abenteuern.',NULL,'DEU','Marinette','https://s3.amazonaws.com/schedulesdirect/assets/p13614769_i_h12_aa.jpg',4,NULL),('SH031826890000','Es werden Themen rund um Verbraucher, Gesundheit, Ernährung, Reise, Haus und Garten beleuchtet. Die Sendung gibt Ausflugs- sowie Freizeittipps und geht unter anderem der Frage nach, welche Produkte und Dienstleistungen etwas taugen.',NULL,'DEU','Die Ratgeber','https://json.schedulesdirect.org/20141201/image/assets/p16692178_st_h12_ab.jpg',4,NULL),('SH020285730000','Tier- und Naturdokumentationen aus Deutschland und aus aller Welt.',NULL,'DEU','Abenteuer Wildnis','https://json.schedulesdirect.org/20141201/image/assets/p11168468_b_h12_aa.jpg',4,NULL),('SH019580070000','Tägliches Boulevard-Magazin im hr-Fernsehen.',NULL,'DEU','maintower','https://s3.amazonaws.com/schedulesdirect/assets/p10911548_b_h12_aa.jpg',4,NULL),('SH019461870000','Das Mittagsmagazin informiert über Themen aus der Region, Deutschland und der ganzen Welt.',NULL,'DEU','MDR um 2','https://json.schedulesdirect.org/20141201/image/assets/p10869363_b_h12_aa.jpg',4,NULL),('SH015403140000','Das Reisemagazin stellt norddeutsche Landschaften, menschliche Originale, Spaß und Sport vor.',NULL,'DEU','Nordtour','https://s3.amazonaws.com/schedulesdirect/assets/p9126241_b_h12_aa.jpg',4,NULL),('SH027288610000','Die Sendung zeigt Deutschland von unten - sie dokumentiert die geheimnisvolle Parallelwelt im Untergrund. Es werden faszinierende, oft unwirkliche Bilder aus Deutschlands Unterwelten gezeigt.',NULL,'DEU','Deutschland von unten','https://s3.amazonaws.com/schedulesdirect/assets/p14305717_b_h12_aa.jpg',4,NULL),('SH015442760000','Die Bewohner der Lindenstraße kommen aus allen gesellschaftlichen Schichten. Die bunten Charaktere erzählen ihre Geschichten, die von Liebe, Ehe und Tod sowie von Homosexualität, Drogenmissbrauch und Gewalt geprägt sind.',NULL,'DEU','Lindenstraße','https://s3.amazonaws.com/schedulesdirect/assets/p9145197_b_v3_aa.jpg',4,NULL),('SH028765600000','Polizisten und andere Ermittler werfen einen Blick zurück auf Ereignisse in ihrem Berufsleben. Unter anderem erzählen sie von spektakulären Verfolgungsjagden, sprechen über unvorhergesehene Geständnisse und dreiste Betrugsfälle.',NULL,'DEU','Achtung Kontrolle! Wir kümmern uns drum','https://s3.amazonaws.com/schedulesdirect/assets/p3592113_i_h12_ab.jpg',4,NULL),('SH019855810000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Südwestfalen.',NULL,'DEU','Lokalzeit Südwestfalen','https://s3.amazonaws.com/schedulesdirect/assets/p11024424_b_h12_aa.jpg',4,NULL),('SH016391700000','Viele Ereignisse des 20. Jahrhunderts sind nicht bis ins letzte geklärt. Noch immer gibt es spannende Fragen vergangener Jahrzehnte. Das Magazin im ZDF, enthüllt Geheimnisse der Geschichte.',NULL,'DEU','ZDF-History','https://s3.amazonaws.com/schedulesdirect/assets/p9561670_b_h12_af.jpg',4,NULL),('SH033280480000',NULL,NULL,'DEU','Der Zweite Weltkrieg in Zahlen','https://s3.amazonaws.com/schedulesdirect/assets/p17221985_i_h12_aa.jpg',4,NULL),('SH032818040000','Auf und ab, hoch und runter - Aufzüge, Rolltreppen, Seilbahnen und Co. Ihre Erfinder hatten ein Ziel.',NULL,'DEU','Hightech für den Alltag','https://s3.amazonaws.com/schedulesdirect/assets/p17200159_st_h12_aa.jpg',4,NULL),('SH019750050000','Unglaubliche Geschichten, die sich hinter den Kulissen des scheinbar Alltäglichen ereignen.',NULL,'DEU','MENSCH LEUTE','https://s3.amazonaws.com/schedulesdirect/assets/p10980370_b_h12_aa.jpg',4,NULL),('SH019462120000','Die MDR-Wetterfrösche werfen einen Blick auf das aktuelle Wetter und die Aussichten.',NULL,'DEU','Wetter für 3','https://s3.amazonaws.com/schedulesdirect/assets/p10869451_b_h12_ab.jpg',4,NULL),('SH016381360000','Der Moderator stellt in Form von kurzen filmisch nachgestellten Rekonstruktionen ungeklärte Kriminalfälle vor, in denen polizeilich ermittelte Fakten präsentiert werden. Außerdem werden Phantomfotos, Abbildungen markanter Gegenstände oder Personenbilder von Menschen, nach denen gefahndet wird, gezeigt. Zuschauer können ihre Hinweise daraufhin per Telefon oder im Internet abgeben. Durchschnittlich können rund 40 Prozent der ausgestrahlten Fälle im Nachhinein gelöst werden.',NULL,'DEU','Aktenzeichen XY... ungelöst','https://s3.amazonaws.com/schedulesdirect/assets/p9557491_b_h12_aa.jpg',4,NULL),('SH031484860000','Zeitnah und in aller Ausführlichkeit berichtet die Sendung über die aktuellsten Ereignisse aus Politik und Gesellschaft - national und international. In Vordergrund stehen Vor-Ort-Berichterstattungen und Studiogespräche mit Experten des Gebiets.',NULL,'DEU','phoenix vor ort','https://s3.amazonaws.com/schedulesdirect/assets/p10969221_i_h12_ab.jpg',4,NULL),('SH017030430000','Das Leben in einer Berliner WG bringt viel Drama mit sich. Liebe, Eifersucht, und Partys stehen für die Bewohner an erster Stelle. Die Charaktere, die zusammentreffen, können unterschiedlicher nicht sein und dennoch leben sie unter einer Decke.',NULL,'DEU','Berlin - Tag & Nacht','https://json.schedulesdirect.org/20141201/image/assets/p9805853_st_h12_aa.jpg',4,NULL),('SH028067710000','Die Schweiz braucht sich hinter den exotischen Naturparadiesen dieser Welt nicht zu verstecken. So klein sie auch ist, ihre abwechslungsreiche Natur ist einzigartig. Die Reihe porträtiert vier verschiedene Regionen der Schweiz.',NULL,'DEU','Wunderwelt Schweiz','https://s3.amazonaws.com/schedulesdirect/assets/p14726071_st_h12_aa.jpg',4,NULL),('SH018486130000','Dr. Kleist, seine Kinder aus erster Ehe und seine neue Frau erleben die Höhen und Tiefen des Lebens. Ihr Familienalltag ist mit Problemen, Sorgen, aber auch Emotionen und Freude gespickt. Dabei sorgen vor allem die Kinder für Aufregung.',NULL,'DEU','Familie Dr. Kleist','https://json.schedulesdirect.org/20141201/image/assets/p10432439_i_v5_aa.jpg',4,NULL),('SH019763560000','`Kunscht!\' ist das wöchentliche Kulturmagazin des SWR Fernsehens: Kabarettist Lars Reichow präsentiert jeden Donnerstag Aktuelles aus dem vielfältigen Kulturgeschehen im Südwesten.',NULL,'DEU','Kunscht!','https://json.schedulesdirect.org/20141201/image/assets/p10986379_i_h12_aa.jpg',4,NULL),('SH018388210000','Im Mittelpunkt der Sendung stehen mutige Ersthelfer sowie professionelle Retter.',NULL,'DEU','Lebensretter','https://s3.amazonaws.com/schedulesdirect/assets/p10397339_b_h12_aa.jpg',4,NULL),('SH016398190000','Die wöchentliche Nachrichtensendung wirft einem Blick auf das aktuelle Geschehen in Europa mit Meldungen von Politik, Wirtschaft, Sport und Kultur.',NULL,'DEU','heute - in Europa','https://json.schedulesdirect.org/20141201/image/assets/p9563644_i_h3_aa.jpg',4,NULL),('SH026148690000','In einem verschlafenen Fischerdorf an der isländischen Küste fischt der örtliche Polizeichef eine männliche Leiche aus dem Wasser. Gleichzeitig legt eine Touristenfähre mit 300 Passagieren am Hafen an. In der kleinen Stadt bricht bald das Chaos aus, denn jeder der Neuankömmlinge und jeder Inselbewohner gilt als potenziell verdächtig, den Mann ermordet zu haben. Zusätzlich erschwert ein Schnee