9_b_h12_aa.jpg',4,NULL),('SH033534970000','Die aktuellsten Nachrichten und Ereignisse aus den norddeutschen Bundesländern; Niedersachen, Schleswig- Holstein, Hamburg und Mecklenburg- Vorpommern.',NULL,'DEU','NDR Info','https://s3.amazonaws.com/schedulesdirect/assets/p10911204_i_h12_ac.jpg',4,NULL),('SH025495960000','Björn Freitag kocht clevere Gerichte, die nicht viel Geld kosten und garantiert satt machen.',NULL,'DEU','Viel für wenig - Clever kochen mit Björn Freitag','https://json.schedulesdirect.org/20141201/image/assets/p13473480_i_h12_aa.jpg',4,NULL),('SH017720230000','Von Omas Küchenschrank bis hin zum begehrten Sammlerstück wird jede Art von Trödel verkauft. Der Moderator vermittelt zwischen den Anbietern und Händlern und stellt nicht nur die oft kuriosen Gegenstände, sondern auch deren Besitzer vor.',NULL,'DEU','Bares für Rares','https://s3.amazonaws.com/schedulesdirect/assets/p10106715_b_h3_aa.jpg',4,NULL),('SH017428590000','Die Sendung zeigt tolle Bilder sowie spannende und berührende Geschichten aus dem Tierpark Hagenbeck in Hamburg. Denn dort schreibt das Zooleben seine eigenen Geschichten und man ist der Wildnis ganz besonders nah.',NULL,'DEU','Leopard, Seebär & Co.','https://json.schedulesdirect.org/20141201/image/assets/p9987891_i_h12_aa.jpg',4,NULL),('SH015402280000','Tägliche Informations- und Bildungssendung, die im wöchentlichen Wechsel aus Baden-Baden und Dortmund sendet und den Zuschauern Informationen über aktuelle Fragestellungen unterschiedlichster Lebensbereiche liefern will.',NULL,'DEU','Planet Wissen','https://s3.amazonaws.com/schedulesdirect/assets/p9125871_b_h12_aa.jpg',4,NULL),('SH019567600000','Tief in den Wäldern von Virginia üben einige alteingesessene Bewohner ein traditionsreiches, aber illegales Handwerk aus: `Moonshining\', das Schnapsbrennen ohne Lizenz. Diese Dokumentation folgt einer Gruppe von Schwarzbrennern bei ihren Tätigkeiten.',NULL,'DEU','Moonshiners - Die Schwarzbrenner von Virginia','https://s3.amazonaws.com/schedulesdirect/assets/p8938792_b_h12_ag.jpg',4,NULL),('SH019855770000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Köln.',NULL,'DEU','Lokalzeit aus Köln','https://s3.amazonaws.com/schedulesdirect/assets/p11024414_b_h3_ab.jpg',4,NULL),('SH022087220000','Jeweils von einem prominenten Gast unterstützt, stellen sich die Teamkapitäne Bernhard Hoëcker und Elton den Fragen von Moderator Kai Pflaume. Es gilt, Fragen aus Wissenschaft, Tierwelt und dem täglichen Leben zu beantworten, um Geld zu erspielen.',NULL,'DEU','Wer weiß denn sowas?','https://s3.amazonaws.com/schedulesdirect/assets/p11873328_b_h12_aa.jpg',4,NULL),('SH030754520000','Die kraftvollen Sauger der britischen Top-Marke `Dyson\' mit patentierter Zyklon-Technologie. Sie haben keine Folgekosten, da keine Ersatzbeutel oder neue Filter benötigt werden. Das spart Geld und schont die Umwelt.',NULL,'DEU','DYSON - Innovative Technologien erleben','https://s3.amazonaws.com/schedulesdirect/assets/p11695222_st_h12_ab.jpg',4,NULL),('SH003331930000','In der Kölner Schillerallee 10, einem Wohn- und Geschäftshaus im Stadtteil Ehrenfeld, findet das ereignisreiche Alltagsleben mehrerer Generationen statt. Ausgehend von der Bäckerei und Konditorei der Familie Weigel nehmen die Geschichten um Freundschaft, Liebe, Intrigen und geplatzte Träume ihren Lauf. Dabei steht die Familie Weigel, die eine Konditorei im Erdgeschoss betreibt und mit drei Generationen im Haus lebt, im Mittelpunkt. Unterschiedliche Familien ziehen in das Haus in der Schillerallee ein und aus, vor allem die jungen Bewohner des Dachgeschosses wechseln oft.',NULL,'DEU','Unter uns','https://s3.amazonaws.com/schedulesdirect/assets/p522053_b_h12_ac.jpg',4,NULL),('SH019560670000','Alexander Hold ist Richter am Amtsgericht in Kempten. Täglich muss er Entscheidungen treffen, die das Leben verschiedener Menschen beeinflussen und verändern. Dabei ist er für das ganze Spektrum der Strafbarkeit zuständig.',NULL,'DEU','Richter Alexander Hold','https://json.schedulesdirect.org/20141201/image/assets/p881803_st_h12_aa.jpg',4,NULL),('SH019885670000','In der Literatursendung stellen Autoren im Gespräch mit den Moderatoren ihre Bücher vor.',NULL,'DEU','lesenswert','https://s3.amazonaws.com/schedulesdirect/assets/p11035008_b_h3_aa.jpg',4,NULL),('SH030672130000','Die achtjährigen Freunde Mats und Malika kommen jeden Tag zu spät zur Schule. Dafür erleben sie auf ihrem Schulweg witzige Abenteuer. Fraglich ist, ob ihre Lehrer ihnen die Begegnungen mit Monstern, Geheimagenten und wilden Tieren abnehmen?',NULL,'DEU','Voll zu spät!','https://s3.amazonaws.com/schedulesdirect/assets/p15427924_i_h12_aa.jpg',4,NULL),('SH006839480000','`Um Himmels Willen\' spielt im fiktiven niederbayerischen Städtchen Kaltenthal. Hier dreht sich alles um die Dauerfehde zwischen Oberbürgermeister Wolfgang Wöller und der Nonne Schwester Lotte aus dem örtlichen Kloster.',NULL,'DEU','Um Himmels Willen','https://json.schedulesdirect.org/20141201/image/assets/p520236_i_h12_ab.jpg',4,NULL),('SH019580550000','Die Rundschau informiert täglich über Nachrichten, Wetter, Sport, Verkehr und Regionales für Bayern und Umgebung und fasst die wichtigsten und aktuellsten Nachrichten zusammen.',NULL,'DEU','Rundschau','https://json.schedulesdirect.org/20141201/image/assets/p10911702_i_h12_aa.jpg',4,NULL),('SH019001930000','Zusammen mit Woozle, einem zotteligen Beuteltier, geht Benedikt Weber sämtlichen Alltagsfragen auf den Grund. Während er versucht, seine Antworten wissenschaftlich zu begründen, bevorzugt Woozle kreativere Lösungsansätze.',NULL,'DEU','Woozle Goozle','https://s3.amazonaws.com/schedulesdirect/assets/p10672039_st_h12_aa.jpg',4,NULL),('SH029209210000','Es werden die unterschiedlichsten sehenswerten Urlaubsziele im Südwesten vorgestellt.',NULL,'DEU','Reisetipp Südwest','https://json.schedulesdirect.org/20141201/image/assets/p15275420_st_h12_aa.jpg',4,NULL),('SH028289630000','Diese Sendung berichtet über die aktuellsten und wichtigsten Nachrichten der Bundesrepublik.',NULL,'DEU','Tagesschau','https://s3.amazonaws.com/schedulesdirect/assets/p10414016_b_v5_aa.jpg',4,NULL),('SH019562930000','Um 1870 in Walnut Grove, einem kleinen Städtchen im Norden Amerikas: Die Ingalls - das sind Vater Charles, Mutter Caroline und die drei Kinder Mary, Laura und Carrie - bewirtschaften eine kleine Farm, die die Familie mal recht, mal schlecht ernährt. Doch auch wenn es wirtschaftlich nicht so gut läuft, die Ingalls lassen sich davon nicht unterkriegen. Auch nicht durch Rückschläge im Privatleben, denn sie wissen: Solange die Familie zusammenhält, kann nicht wirklich etwas schiefgehen.',NULL,'DEU','Unsere kleine Farm','https://s3.amazonaws.com/schedulesdirect/assets/p184223_b_h3_ah.jpg',4,NULL),('SH019765930000','Der Schüler Yu-Gi erhält von seinem Großvater das magische Spiel der Schatten, das seither ein großes Rätsel umgibt. Yu-Gi und seine Freunde machen sich an die Lösung des Rätsels und ahnen nicht, dass sie das Schicksal der Welt in den Händen halten.',NULL,'DEU','Yu-Gi-Oh!','https://json.schedulesdirect.org/20141201/image/assets/p534172_i_h12_aa.jpg',4,NULL),('SH031008440000','Die Dokumentation berichtet über Nazi-Führer wie Joseph Goebbels, Albert Speer und Konsorten.',NULL,'DEU','Hitlers Komplizen','https://s3.amazonaws.com/schedulesdirect/assets/p16264035_st_h12_ad.jpg',4,NULL),('SH016388730000','Das `Mittagsmagazin\' ist eine Nachrichtensendung, die über aktuelle Themen berichtet. Die Beiträge handeln von Themenbereichen wie Sport, Wissen und Kultur.',NULL,'DEU','ARD-Mittagsmagazin','https://s3.amazonaws.com/schedulesdirect/assets/p9560150_b_h3_ab.jpg',4,NULL),('SH019576340000','Die Jagd nach Verbrechern aus zwei Perspektiven - der der Polizei und der Staatsanwaltschaft. Abwechselnde Ermittlerteams sind in und um New York im Einsatz, um Verbrecher hinter Gitter zu bringen.',NULL,'DEU','Law & Order','https://s3.amazonaws.com/schedulesdirect/assets/p183983_l_h3_aa.jpg',4,NULL),('SH018581030000','Die zwölfjährige Sally sieht ihren Vater Harry, ein Meisterdetektiv, als Superhelden an. Sie möchte in seine Fußstapfen treten und ein Detektivbüro eröffnen. Spezialisiert hat sich Sally zusammen mit ihrem Freund Dowee auf die Aufträge von Kindern.',NULL,'DEU','Sally Bollywood','https://json.schedulesdirect.org/20141201/image/assets/p8355561_i_v3_aa.jpg',4,NULL),('SH019563250000','Chefinspektor Alan Banks stößt auf einen Serienmörder, der vier junge Frauen getötet hat.',NULL,'DEU','Inspector Banks','https://json.schedulesdirect.org/20141201/image/assets/p8829244_i_h12_ae.jpg',4,NULL),('SH025374390000','Die Food-Bloggerin Felicitas Then vermittelt praktisches Wissen rund ums Thema Lebensmittel. Dabei berücksichtigt sie allerlei Faktoren wie beispielsweise Herstellung, Geschmack, Nachhaltigkeit und Zubereitung. Experten geben dazu hilfreiche Tipps.',NULL,'DEU','Die Foodtruckerin','https://json.schedulesdirect.org/20141201/image/assets/p13412980_st_h12_aa.jpg',4,NULL),('SH018573510000','Ausführliche Wettervorhersage für Deutschland in den kommenden Tagen.',NULL,'DEU','RTL Nachtjournal - Das Wetter','https://s3.amazonaws.com/schedulesdirect/assets/p10463864_i_h12_aa.jpg',4,NULL),('SH020358260000','Beiträge zu Lerninhalten unterschiedlicher Unterrichtsfächer für alle Schulstufen.',NULL,'DEU','Schulfernsehen','https://s3.amazonaws.com/schedulesdirect/assets/p11197088_b_h12_aa.jpg',4,NULL),('SH022161470000','Rinaldo Rinaldini bekämpft als Führer einer Räuberbande in Süditalien wohlhabende Schurken und beschützt die Armen. Der Grund dafür ist die Ermordung seines Vaters durch den Marchese Cavalcanti, der Rinaldo auch um seine Erbschaft betrog.',NULL,'DEU','Rinaldo Rinaldini','https://json.schedulesdirect.org/20141201/image/assets/p11899539_st_h12_aa.jpg',4,NULL),('SH029326570000','Molly lebt mit ihrer Familie in einer Sozialwohnung in London. In der Hoffnung auf ein besseres Leben, absolviert sie nach ihrem 18. Geburtstag eine Ausbildung beim Militär. Anschließend wird sie als Sanitäterin nach Afghanistan gesendet.',NULL,'DEU','Lost in Oz','https://s3.amazonaws.com/schedulesdirect/assets/p11877840_b_h12_aa.jpg',4,NULL),('SH020861460000','Ein unfreiwilliges und unkonventionelles Duo geht in der Kleinstadt Aarau auf Verbrecherjagd. Der Beerdigungsunternehmer Luc Conrad überschreitet dabei immer wieder Kompetenzen.',NULL,'DEU','Der Bestatter','https://s3.amazonaws.com/schedulesdirect/assets/p11355215_b_h3_aa.jpg',4,NULL),('SH023656340000','Brautprofis unterstützen zukünftige Bräute dabei, das perfekte Brautkleid zu finden. Sie beantworten Typfragen und suchen im Hochzeitsmoden-Discounter, in exklusiven Nobel-Boutiquen und Nischen-Brautläden nach dem passenden Traummodell.',NULL,'DEU','Zwischen Tüll und Tränen','https://s3.amazonaws.com/schedulesdirect/assets/p12597643_st_h12_aa.jpg',4,NULL),('SH020070080000','Gibt es Außerirdische? Wie dünn war die Ursuppe? Und wie sieht eigentlich die Zukunft des Universums aus? Manchmal wissen nur Experten wie der Astrophysiker Harald Lesch weiter.',NULL,'DEU','alpha-Centauri','https://json.schedulesdirect.org/20141201/image/assets/p11093581_i_h12_ac.jpg',4,NULL),('SH019560660000','Die Richterin Barbara Salesch entscheidet über die Schuld der Angeklagten in fiktiven Kriminalfällen, die von Laien dargestellt werden. Dabei wird der komplette Fall besprochen und auch Zeugen werden zu den Gegebenheiten befragt.',NULL,'DEU','Richterin Barbara Salesch','https://json.schedulesdirect.org/20141201/image/assets/p881807_st_h12_aa.jpg',4,NULL),('SH019733300000','In dieser bayerischen Familienserie ranken sich liebevolle Geschichten `wia ausm richtigen Lebn\' rund um das fiktive Dorf Lansing und seine Bewohner.',NULL,'DEU','Dahoam is Dahoam','https://json.schedulesdirect.org/20141201/image/assets/p10974424_b_h12_ab.jpg',4,NULL),('SH025069640000','Fünf Teenager haben einen großen Traum: sie alle wollen Profis werden, manche als Tänzer, andere als Sänger, wieder andere als Schauspieler, Comedians oder Musiker. Doch auch sie sind normale Teenager, die die erste Liebe und Freundschaften erleben.',NULL,'DEU','Spotlight','https://s3.amazonaws.com/schedulesdirect/assets/p13260407_st_h12_aa.jpg',4,NULL),('SH020985130000','Dr. Niklas Ahrend lässt sein Leben in Leipzig hinter sich und wagt einen Neustart als Oberarzt in Erfurt - mit ungeahnten Herausforderungen, neuen Kollegen und alten Freunden, und jeder von ihnen hat seine ganz eigene Geschichte.',NULL,'DEU','In aller Freundschaft - Die jungen Ärzte','https://s3.amazonaws.com/schedulesdirect/assets/p11390058_i_h12_aa.jpg',4,NULL),('SH030477540000','In dieser Sendung unterhält sich Jörg Thadeusz mit Menschen, die den Tag mitgeprägt oder in der Woche für Gesprächsstoff gesorgt haben. Dies können beispielsweise Forscher, Politiker, Stars, Musiker oder Schriftsteller sein.',NULL,'DEU','Talk aus Berlin','https://json.schedulesdirect.org/20141201/image/assets/p15916579_b_h12_aa.jpg',4,NULL),('SH019370400000','Im Jahr 2030 entscheidet Ted Mosby sich, seinen Kindern Penny und Luke in allen Details zu erzählen, wie er ihre Mutter kennengelernt hat. Sein Rückblick beginnt im Jahr 2005, als er als 27-Jähriger gerade sein Architekturstudium abgeschlossen hat. Er lebt zusammen mit seinem besten Freund Marshall, der seit neun Jahren mit der Kindergärtnerin Lily liiert ist. Die Drei sind außerdem mit dem notorischen aber liebenswerten Frauenheld und Anzugträger Barney Stinson befreundet, der Ted dabei helfen soll, die Frau seines Lebens zu finden. Durch Barney lernen die Freunde Robin Scherbatsky kennenlernen, in die Ted sich sofort verliebt. Aber das Schicksal scheint es nicht gut mit ihm zu meinen, denn Robin will keine feste Beziehung.',NULL,'DEU','How I Met Your Mother','https://s3.amazonaws.com/schedulesdirect/assets/p185124_l_h3_aa.jpg',4,NULL),('SH031588790000','Das Filmteam begleitet die australischen Polizisten bei ihrer täglichen Arbeit. Für die Sicherheit in der Stadt kommen sie mit Drogendealern, Diebstählen oder auch Terroristen in Kontakt. Dabei riskieren sie oft ihr Leben.',NULL,'DEU','Police Force - Einsatz Down Under','https://s3.amazonaws.com/schedulesdirect/assets/p8204385_i_h3_aa.jpg',4,NULL),('SH024083840000','Elena Uhlig bereist die Regionen Deutschlands und sucht nach lokalen Küchenchefs, die sich ein Duell mit Johann Lafer oder Nelson Müller liefern. Dabei müssen die Promiköche Spezialitäten erschmecken und nachkochen.',NULL,'DEU','Stadt, Land, Lecker','https://s3.amazonaws.com/schedulesdirect/assets/p12794756_b_h12_aa.jpg',4,NULL),('SH028660690000','Die alleinerziehende Tierpflegerin Eva wird von ihrer Schwester Toni überrascht, die bei Eva einziehen will. Da die beiden dank ihrer unterschiedlichen Lebensvorstellungen immer wieder ins Chaos rutschen, muss Mutter Gabriele gelegentlich eingreifen.',NULL,'DEU','Beste Schwestern','https://s3.amazonaws.com/schedulesdirect/assets/p15020520_st_h12_aa.jpg',4,NULL),('SH019138540000','Der kleine Angelo ist gerne mit seinen Freunden unterwegs. Sie treffen sich und kreieren die besten Strategien, um gegen ihre Rivalen antreten zu können. Nicht immer klappt es, doch die Kids haben dennoch jede Menge Spaß.',NULL,'DEU','Angelo!','https://s3.amazonaws.com/schedulesdirect/assets/p8180581_i_h12_aa.jpg',4,NULL),('SH034191820000',NULL,NULL,'DEU','Blutige Anfänger','https://s3.amazonaws.com/schedulesdirect/assets/p17832226_st_h12_aa.jpg',4,NULL),('SH015933320000','Geschichten aus dem Arbeitsalltag des 21. Hamburger Polizeikommissariats unter der Leitung von Polizeioberrat Martin Berger und des mit diesem eng kooperierenden Elbkrankenhauses, in welchem Bergers Nichte Jasmin Jonas sich um die Patienten kümmert.',NULL,'DEU','Notruf Hafenkante','https://json.schedulesdirect.org/20141201/image/assets/p9370356_i_v5_aa.jpg',4,NULL),('SH016398180000','Nachrichten aus den Bundesländern mit Themen aus der Politik, Wirtschaft und Gesellschaft.',NULL,'DEU','heute - in deutschland','https://s3.amazonaws.com/schedulesdirect/assets/p9563640_b_h3_ab.jpg',4,NULL),('SH019383930000','Eric Miller erkrankt auf einmal und wird ins Krankenhaus eingeliefert, wo er kurz darauf stirbt. Die Ursache lautet Gift; Megan fährt nach einer Feier mit dem Auto nach Hause, als auf ihren Wagen geschossen wird. Seit dem fehlt von Megan jede Spur.',NULL,'DEU','Medical Detectives - Geheimnisse der Gerichtsmedizin','https://s3.amazonaws.com/schedulesdirect/assets/p439881_b_h3_ag.jpg',4,NULL),('SH018566090000','Auslandskorrespondenten berichten über aktuelle Ereignisse auf dem Globus.',NULL,'DEU','Weltspiegel extra','https://s3.amazonaws.com/schedulesdirect/assets/p10461191_b_v3_aa.jpg',4,NULL),('SH019569760000','Jake und seine Freunde Izzy, Cubby und der Papagei Skully leben auf einer Insel nahe bei Nimmerland. Die Kinder sind dem berüchtigten Captain Hook ein Dorn im Auge und er versucht alles, um ihnen das Leben so schwer wie möglich zu machen, wie etwa ihre Sachen zu stehlen. Um ein Abenteuer abzuschließen, müssen Jake und seine Freunde stets drei Aufgaben lösen, nach deren Erfüllung sie Golddublonen bekommen, die sie am Ende in ihre Teamschatztruhe legen.',NULL,'DEU','Jake und die Nimmerland Piraten','https://json.schedulesdirect.org/20141201/image/assets/p8492050_i_h3_ab.jpg',4,NULL),('SH030218130000','Die Therapeuten und Sozialarbeiter der Klinik am Südring unterstützen Patienten, die Verhaltensauffälligkeiten zeigen oder sonstige emotionale Herausforderungen zu bewältigen haben. Außerdem stehen sie den betroffenen Familien zur Seite.',NULL,'DEU','Klinik am Südring - Die Familienhelfer','https://s3.amazonaws.com/schedulesdirect/assets/p15791050_i_h12_ae.jpg',4,NULL),('SH016982900000','Die toughe und sehr selbstbewusste Max arbeitet in einem schmierigen Diner in New York. Durch Zufall lernt sie Caroline kennen, deren Vater seine Millionen verloren hat, nimmt sie bei sich auf und lernt sie im Diner ein, damit diese wenigstens die Miete bezahlen kann. Zwischen den beiden entwickelt sich eine ungewöhnliche Freundschaft und die Hoffnung, zusammen ein eigenes Cupcake-Unternehmen aufzubauen - wenn sie das nötige Geld dafür aufbringen können. So wird am Ende jeder Folge der gesparte Betrag eingeblendet.',NULL,'DEU','2 Broke Girls','https://s3.amazonaws.com/schedulesdirect/assets/p8680648_l_h3_aa.jpg',4,NULL),('SH031693340000','Präsentiert wird ein Kollektiv aus Stand-Up-Comedy-Künstlern mit mulitikulturellem Hintergrund. Im Jahr 2005 unter dem Namen `RebellComedy` gegründet, teilen sich Comedians mit marokkanischen, iranischen, türkischen und schweizer Wurzeln die Bühne.',NULL,'DEU','RebellComedy - Hoch ansteckend','https://s3.amazonaws.com/schedulesdirect/assets/p11133730_i_h12_aa.jpg',4,NULL),('SH015402360000','Die Reportage- und Dokumentationsreihe zeigt unerforschte Gebiete, reist zu unentdeckten Traumzielen auf der ganzen Welt, und besucht fremde Völker, um über ihre Kultur und ihre Bräuche zu berichten.',NULL,'DEU','Länder - Menschen - Abenteuer','https://json.schedulesdirect.org/20141201/image/assets/p9125881_i_h12_aa.jpg',4,NULL),('SH003332650000','Das Nachtjournal zeigt zu später Stunde noch umfassende Nachrichten des Tages aus Deutschland und der Welt. Mit den aktuellsten Ereignissen aus der Politik, Wirtschaft und Kultur können sich die Zuschauer nachts noch auf dem Laufenden halten. Das Markenzeichen des Magazins umfasst Fakten, Hintergrundberichterstattungen sowie Meinungen zu den aktuellen globalen sowie regionalen Themen. Mit der Rubrik `100 Tage danach\' greift die Sendung schlagzeilenträchtige Ereignisse aus der Vergangenheit auf, zeigt deren Folgen und Entwicklungen und fragt nach den Konsequenzen.',NULL,'DEU','RTL-Nachtjournal','https://s3.amazonaws.com/schedulesdirect/assets/p472490_b_h12_aa.jpg',4,NULL),('SH019461950000','Magazin mit Schlagzeilen aus der Region, interessanten Gästen im Studio und Verbrauchertipps. Die Moderatoren berichten über alles, was in Sachsen, Sachsen-Anhalt und Thüringen für Schlagzeilen sorgt und informieren über Aktuelles.',NULL,'DEU','MDR um 4: Neues von hier','https://json.schedulesdirect.org/20141201/image/assets/p10869377_i_h12_aa.jpg',4,NULL),('SH022939820000','Drei Bärenbrüdern Grizz, Panda und Eisbär versuchen, in der menschlichen Gesellschaft Anschluss zu finden und Freunde zu gewinnen. Immer wieder wird das Trio mit den Herausforderungen der digitalen Welt und der modernen Gesellschaft konfrontiert.',NULL,'DEU','We Bare Bears - Bären wie wir','https://s3.amazonaws.com/schedulesdirect/assets/p11921875_i_h12_aa.jpg',4,NULL),('SH026358110000','Im Jahr 2275 führt Dante Montana ein Team von Kopfgeldjägern an, die im Universum Jagd auf Verbrecher machen. Dazu müssen sie verhindern, dass das `Divinity Cluster\' in falsche Hände gerät. Doch Dante verfolgt noch ein privates Ziel.',NULL,'DEU','Starhunter','https://s3.amazonaws.com/schedulesdirect/assets/p493717_st_h12_aa.jpg',4,NULL),('SH031760630000',NULL,NULL,'DEU','Arthur und die Freunde der Tafelrunde','https://s3.amazonaws.com/schedulesdirect/assets/p15847422_i_s2_aa.jpg',4,NULL),('SH028204940000','Musiksendung.',NULL,'DEU','MTV Most Wanted','https://s3.amazonaws.com/schedulesdirect/assets/p14809119_st_h12_aa.jpg',4,NULL),('SH019672240000','Die siebenteilige Reihe zeigt die Schweiz von ihrer unbekannten und schönsten Seite.',NULL,'DEU','Wunderland','https://s3.amazonaws.com/schedulesdirect/assets/p10950586_st_h12_aa.jpg',4,NULL),('SH019559880000','Alpenpanorama zeigt Livebilder aus ausgewählten Urlaubsorten.',NULL,'DEU','Alpenpanorama','https://s3.amazonaws.com/schedulesdirect/assets/p10903564_b_h3_aa.jpg',4,NULL),('SH015402790000','Die Sendung informiert über ein breites Themenspektrum, angefangen bei den großen aktuellen Themen bis hin zu alltäglichen wirtschaftlichen Ereignissen. Dabei werden die Vorgänge aus der Perspektive des Normalbürgers und Verbrauchers gezeigt. Zusätzlich liefert die Sendung vertiefende Information über alle wirtschafts- und sozialpolitische Fragen der Zuschauer. Dabei handelt es sich um klassische Magazinbeiträge, investigative Recherchen, Tests, Tipps sowie Hinweise, wie sich aufgezeigte Probleme vermeiden lassen.',NULL,'DEU','Plusminus','https://s3.amazonaws.com/schedulesdirect/assets/p9126080_b_h3_aa.jpg',4,NULL),('SH015330760000','Kennen Sie das: Damit Sie sich im Haus richtig wohlfühlen können, muss auch der Garten auf Vordermann sein. Innovative Lösungen zur Pflege und Dekoration des Außenbereichs Ihre Zuhauses finden Sie in dieser Show.',NULL,'DEU','Haus & Garten','https://s3.amazonaws.com/schedulesdirect/assets/p9092498_st_h12_aa.jpg',4,NULL),('SH027600150000','Im regionalen Nachrichtenmagazin steht der Alltag von Menschen in NRW im Mittelpunkt. Neben aktuellen Berichten aus der Region gibt es auch Zeitreisen in die Vergangenheit und für Zuschauer die Möglichkeit, mit Studiogästen in Kontakt zu treten.',NULL,'DEU','Hier und heute','https://s3.amazonaws.com/schedulesdirect/assets/p14462037_st_h12_aa.jpg',4,NULL),('SH028582930000','Während der Nazizeit werden Tausende deutsche Jugendliche rekrutiert - vorzugsweise gute Sportler.',NULL,'DEU','Hitlerjugend - Vom Sportplatz an die Front','https://s3.amazonaws.com/schedulesdirect/assets/p14272641_st_h12_aa.jpg',4,NULL),('SH031269580000','Schönheit und Gesundheit gehen im Leben Hand in Hand. Deshalb dreht sich in dieser Show alles um Produkte, Expertentipps, Innovationen und Hintergrundwissen zu den Themen Pflege und Wohlbefinden. Es geht darum, wie man sich schön fühlt.',NULL,'DEU','KosMedic - Beratung. Gesundheit. Schönheit','https://s3.amazonaws.com/schedulesdirect/assets/p16376632_st_h12_ac.jpg',4,NULL),('SH019577060000','Star der Sitcom ist Tim Taylor, der als Moderator einer TV-Heimwerkersendung sein Geld verdient und auch zu Hause gerne selber Hand anlegt - was in der Regel zu Chaos und Verwüstung führt. Tim und seine Frau Jill haben drei aufgeweckte Söhne und einen kauzigen philosophierenden Nachbarn. Auch wenn handwerkliche (Un-)Fähigkeiten den Rahmen bilden, so geht es doch im Kern meist um ganz alltägliche Familienprobleme, die die Taylors mit Witz und Gefühl lösen.',NULL,'DEU','Hör mal, wer da hämmert','https://s3.amazonaws.com/schedulesdirect/assets/p183934_i_h12_aa.jpg',4,NULL),('SH034389740000','Zwischen Schichtdienst, Schockraum und Schwerstverletzten: In den rund 2.000 Notaufnahmen deutscher Krankenhäuser leisten Ärzte, Schwestern und Pfleger täglich ihre Arbeit - eine physische wie psychische Höchstbelastung.',NULL,'DEU','Notaufnahme Live','https://s3.amazonaws.com/schedulesdirect/assets/p17947802_st_h12_aa.jpg',4,NULL),('SH019667660000','Das Politik-Magazin mit Susanne Stichler geht Missständen nach und dokumentiert die Folgen - hintergründig, engagiert und pointiert.',NULL,'DEU','Panorama 3','https://json.schedulesdirect.org/20141201/image/assets/p10948892_b_h12_aa.jpg',4,NULL),('SH019559740000','Melinda wird von den Geistern verstorbener Menschen heimgesucht, da nur sie diese sehen und ihnen helfen kann. Doch ihre Gabe empfindet die junge Frau als Segen und als Fluch, denn ihre Beziehung zu dem Rettungssanitäter Jim Clancy leidet darunter.',NULL,'DEU','Ghost Whisperer - Stimmen aus dem Jenseits','https://s3.amazonaws.com/schedulesdirect/assets/p185120_i_v5_aa.jpg',4,NULL),('SH025783280000','Überlegene Kraft, lautloses Schleichen oder perfekte Tarnung: die Strategien, mit denen Raubtiere ihrer Beute zu Leibe rücken, sind vielfältig und immer wieder überraschend.',NULL,'DEU','Tödliches Afrika','https://s3.amazonaws.com/schedulesdirect/assets/p8834983_i_h3_aa.jpg',4,NULL),('SH019758630000','Calimero ist ein niedliches, schwarzes Küken aus Palermo mit einer Eierschale auf dem Kopf. Mit seinen Freunden Priscilla, Peter und Alexander erlebt er allerlei Abenteuer. Miteinander kämpfen sie für die Gerechtigkeit in ihrer kleinen Welt.',NULL,'DEU','Calimero','https://json.schedulesdirect.org/20141201/image/assets/p10744788_i_h12_ab.jpg',4,NULL),('SH019664380000','Wie sah die Welt vor 20 Jahren aus? Die Sendung bietet einen Einblick in die jüngere Zeitgeschichte.',NULL,'DEU','Tagesschau - Vor 20 Jahren','https://s3.amazonaws.com/schedulesdirect/assets/p10947186_b_h12_aa.jpg',4,NULL),('SH018557200000','Der Kriminalbeamte Adrian Monk wurde aufgrund seiner besonderen Fähigkeiten in seinem Beruf schnell eine kleine Berühmtheit. Er hat ein fotografisches Gedächtnis und kann selbst aus kleinsten Hinweisen eine Spur basteln. Seit dem Tod seiner geliebten Frau Trudy durch einen mysteriösen Anschlag leidet er jedoch unter starken Ängsten und Zwangsstörungen, was zu seiner Suspendierung vom Dienst beim San Fransisco Police Department führt. Nachdem er sich daraufhin drei Jahre lang in seiner Wohnung eingesperrt hat, macht er sich schließlich als Privatdetektiv selbstständig und wird von der Polizei immer wieder um Unterstützung gebeten. Mit der Hilfe seines ehemaligen Chefs Captain Leland Stottlemeyer sowie seiner persönlicher Assistentin Sharona Fleming löst Monk seitdem die Kriminalfälle, die sonst niemand lösen kann.',NULL,'DEU','Monk','https://s3.amazonaws.com/schedulesdirect/assets/p184807_i_v5_aa.jpg',4,NULL),('SH014872220000','In der Sendung werden praktische Haushaltshelfer vorgestellt und wertvolle Tipps gegeben.',NULL,'DEU','Haushaltshelfer','https://s3.amazonaws.com/schedulesdirect/assets/p8892724_st_h12_aa.jpg',4,NULL),('SH020412230000','Father Brown wird leicht unterschätzt. Als Römisch-Katholischer Priester ist er im anglikanischen England eine Seltenheit. Er verrichtet seinen Dienst in der St. Mary\'s Church in Kembleford in den frühen 1950er Jahren.',NULL,'DEU','Father Brown','https://s3.amazonaws.com/schedulesdirect/assets/p12420801_i_h12_aa.jpg',4,NULL),('SH032903410000','Eine geheim operiernde Agentur kombiniert eine neu entdeckte Substanz namens Morph-X mit tierischer DNA, um das Power Rangers Beast Morphers Team zu bilden. Die Ranger müssen einen bösen Computervirus bekämpfen, der nach Macht aus ist.',NULL,'DEU','Power Rangers: Beast Morphers','https://s3.amazonaws.com/schedulesdirect/assets/p16595885_b_v3_ab.jpg',4,NULL),('SH019384430000','Fünf Kandidaten laden sich gegenseitig nacheinander zu sich nach Hause zum Essen ein. Am Ende jeder Sendung wird der Gastgeber von den restlichen Kandidaten mit 0 bis 10 Punkten bewertet und so der Gewinner des perfekten Dinners ermittelt.',NULL,'DEU','Das perfekte Dinner','https://json.schedulesdirect.org/20141201/image/assets/p10842374_st_h12_aa.jpg',4,NULL),('SH018886850000','Der in finanzieller Hinsicht abgebrannte Ex-Ermittler Kiesewetter zieht nach Lübeck, bezieht ein Zimmer bei seinen beiden Tanten und kehrt in den Polizeidienst zurück. Die neue Vorgesetzte Elke Rasmussen ist seine ehemalige Geliebte.',NULL,'DEU','Morden im Norden','https://json.schedulesdirect.org/20141201/image/assets/p10615569_i_h12_aa.jpg',4,NULL),('SH027573120000','Die Reihe begleitet die Autobahnpolizisten in Neuseeland. Wenn es auf den insgesamt fast 11.000 Kilometer langen State Highways zu Unfällen kommt, ist Eile geboten. Die Beamten bekommen von Blechschäden bis zu Schwerverletzen einiges zu sehen.',NULL,'DEU','Highway Cops','https://json.schedulesdirect.org/20141201/image/assets/p9468037_i_h3_aa.jpg',4,NULL),('SH019563180000','Die Schweizer Nachrichtensendung informiert in Berichten, Reportagen, Porträts und Live-Gesprächen.',NULL,'DEU','10vor10','https://json.schedulesdirect.org/20141201/image/assets/p10905661_i_h12_aa.jpg',4,NULL),('SH018439280000','Yoyo und Doc Croc erleben die bekanntesten Märchen mit Hilfe eines sprechenden Märchenbuchs mit.',NULL,'DEU','SimsalaGrimm','https://s3.amazonaws.com/schedulesdirect/assets/p10415916_b_h12_aa.jpg',4,NULL),('SH027434230000','In der Dokumentation stellt sich Parker Schnabel der Herausforderung, den berühmten Dalton-Pfad bei Wintereinbruch entlang zu wandern und einen Eindruck davon zu bekommen, wie sich die Schatzsucher vor über 100 Jahren auf ihrer Reise gefühlt haben.',NULL,'DEU','Goldrausch: Parkers Klondike-Abenteuer','https://s3.amazonaws.com/schedulesdirect/assets/p13914795_i_h12_aa.jpg',4,NULL),('SH023098770000','Verbrauchermagazin, das sich auf Produkttests und die kritische Berichterstattung über Verfahrensweisen der Wirtschaft konzentriert.',NULL,'DEU','markt','https://s3.amazonaws.com/schedulesdirect/assets/p12344771_st_h12_aa.jpg',4,NULL),('SH016397950000','Kritisch, investigativ und unerschrocken - das Politmagazin bietet Reportagen, Analysen und Hintergründe zu aktuellen Themen aus Politik, Wirtschaft und Gesellschaft. Die Reporter decken Missstände auf und liefern Fakten.',NULL,'DEU','Frontal 21','https://s3.amazonaws.com/schedulesdirect/assets/p9563561_b_h12_ab.jpg',4,NULL),('SH028930250000','Die Dokumentation erkundet, wie Eisenbahnen und deren Schienennetzwerke stets Vorreiter des modernen Ingenieurswesens und Transports sind. Gezeigt werden atemberaubende Bilder, innovatives Design und unglaubliche Durchbrüche bezüglich Eisenbahnen.',NULL,'DEU','Wunder auf Schienen','https://s3.amazonaws.com/schedulesdirect/assets/p14957254_i_h12_aa.jpg',4,NULL),('SH028586800000','Immer wenn ihr Besitzer Bob das Haus verlässt, haben die Welpen Bingo und Rolly jede Menge Spaß. Bingo bestimmt dabei immer, wohin es geht. Ihre Katzenschwester Hissy leistet den beiden Gesellschaft auf ihren Abenteuern.',NULL,'DEU','Welpen Freunde','https://s3.amazonaws.com/schedulesdirect/assets/p13949191_i_h12_aa.jpg',4,NULL),('SH029400720000','Der Australier Todd Sampson, Abenteurer und menschliches Versuchskaninchen, nimmt einige der größten Herausforderungen seines Lebens auf sich, um die außergewöhnlichsten Menschen der Welt zu erforschen. Die Dokumentationsreihe zeigt seine Ausflüge.',NULL,'DEU','Die Fremdenlegion - Training mit den harten Jungs','https://s3.amazonaws.com/schedulesdirect/assets/p13365563_i_h12_aa.jpg',4,NULL),('SH021471980000','Science-Fiction-Autoren geben der Welt mit ihren Geschichten seit fast 200 Jahren einen Einblick in die Zukunft. Sie weisen Wissenschaftlern den Weg zu neuen Forschungsgebieten und inspirieren Ingenieure zur Entwicklung phantastischer Technologien.',NULL,'DEU','Die Science Fiction Propheten','https://s3.amazonaws.com/schedulesdirect/assets/p8921078_i_v5_aa.jpg',4,NULL),('SH019576050000','Die Ärztin Addison flüchtet nach Santa Monica und beginnt in der Praxis zweier Studienfreunde.',NULL,'DEU','Private Practice','https://json.schedulesdirect.org/20141201/image/assets/p185547_i_v3_ab.jpg',4,NULL),('SH017672540000','Berichtet wird in dieser Folge unter anderem von: 500 Meter der Männer, Halbfinale Hochsprung Männer, Finale 4 x 100 Meter Staffel Frauen, Vorläufe Diskuswurf Frauen, Finale 4 x 100 Meter Staffel Männer, Vorläufe 400 m Hürden Frauen.',NULL,'DEU','ZDF SPORTextra','https://s3.amazonaws.com/schedulesdirect/assets/p10086954_b_h12_aq.jpg',4,NULL),('SH019952950000','In einem geheimen US-Militärkomplex unter der Leitung von Hammond ist das Stargate aufgebaut, ein Relikt einer jahrtausendealten Zivilisation. Auf anderen Planeten stehen Stargates, mit deren Hilfe man von einem Planeten zum anderen reisen kann.',NULL,'DEU','Stargate','https://s3.amazonaws.com/schedulesdirect/assets/p184337_b_h3_ac.jpg',4,NULL),('SH025581220000','In der Serie empfängt der Kabarettist, Musiker und Schauspieler Hannes Ringlstetter wöchentlich zwei illustre Gäste. Es geht um Themen der Woche, Politik, das Leben und um das, was die Gesellschaft bewegt. Die Musik kommt von der Band Ringlstetter.',NULL,'DEU','Ringlstetter','https://json.schedulesdirect.org/20141201/image/assets/p13514504_i_v3_aa.jpg',4,NULL),('SH019395240000','Das Wissensmagazin befasst sich werktäglich mit Themen aus dem Alltag und der Naturwissenschaft.',NULL,'DEU','Xenius','https://s3.amazonaws.com/schedulesdirect/assets/p10838421_i_v5_aa.jpg',4,NULL),('SH015402140000','Die Fahrten der einzelnen Folgen gehen durch Wälder und Felder, über Viadukte die Flüsse und Täler überspannen, bis in die Wüste, oder dem hohen Norden, in den Schnee. Auch Modellbahnen und Modellbahnausstellungen kommen vor.',NULL,'DEU','Eisenbahn-Romantik','https://json.schedulesdirect.org/20141201/image/assets/p9125780_i_h12_aa.jpg',4,NULL),('SH031622240000','In der Sendung diskutiert der Moderator mit unterschiedlichen Gästen über verschiedene Themen.',NULL,'DEU','Westpol: Eins zu eins','https://s3.amazonaws.com/schedulesdirect/assets/p16582384_st_h12_ac.jpg',4,NULL),('SH018778360000','Als Mr. McGregers Neffe das Haus seines Onkels übernimmt, werden Peter Hase, seine Schwestern und sein Cousin aus dem Garten vertrieben. Peter aber ist einfallsreich und erweist sich als würdiger und schlauer Gegner.',NULL,'DEU','Peter Hase','https://s3.amazonaws.com/schedulesdirect/assets/p9628545_i_h12_aa.jpg',4,NULL),('SH019424280000','Zwei Frauen, meist aus gegensätzlichen Verhältnissen, tauschen für zehn Tage die Familien. Sie kümmern sich um die jeweiligen Familien der anderen - alles unter Begleitung der Kamera. Anschließend tauschen sie ihre Erfahrungen miteinander aus.',NULL,'DEU','Frauentausch','https://json.schedulesdirect.org/20141201/image/assets/p10855873_st_h12_aa.jpg',4,NULL),('SH019559950000','Die Nachrichtensendung informiert über die Geschehnisse des Tages und andere wichtige Themen.',NULL,'DEU','kabel eins news','https://s3.amazonaws.com/schedulesdirect/assets/p10903601_b_h12_ab.jpg',4,NULL),('SH018485480000','Physiker Vince Ebert beantwortet Zuschauerfragen mit Hilfe von naturwissenschaftlichen Experimenten.',NULL,'DEU','Wissen vor acht - Werkstatt','https://json.schedulesdirect.org/20141201/image/assets/p10432272_i_h12_ab.jpg',4,NULL),('SH023090100000','Das Nachrichtenmagazin informiert über aktuelle Meldungen aus Deutschland und der Welt.',NULL,'DEU','heute','https://s3.amazonaws.com/schedulesdirect/assets/p12339826_b_h12_az.jpg',4,NULL),('SH019462190000','Das Sandmännchen bringt die Kinder mit einer Gute-Nacht-Geschichte ins Bett und sorgt für angenehme Träume. Mit Fabelfiguren wie Schnatterinchen, Herr Fuchs oder Frau Elster werden Geschichten aus Fantasie-Welten erzählt.',NULL,'DEU','Unser Sandmännchen','https://json.schedulesdirect.org/20141201/image/assets/p10869475_i_v5_aa.jpg',4,NULL),('SH019587410000','Das Magazin für Gartenfreunde in Berlin und Brandenburg, mit praktischen Tipps und Hinweisen.',NULL,'DEU','rbb Gartenzeit','https://json.schedulesdirect.org/20141201/image/assets/p10914954_b_h12_aa.jpg',4,NULL),('SH019749900000','Die Dokumentationsreihe porträtiert Firmen aus der Region Südwest.',NULL,'DEU','made in Südwest','https://s3.amazonaws.com/schedulesdirect/assets/p10980312_b_h12_aa.jpg',4,NULL),('SH029003150000','Der Moderator macht Spitzenforschung in Deutschland erlebbar. Dazu begibt er sich in jeder Staffel zu einem anderen Forschungsort in der Republik. Dort trifft er auf Menschen, die die Wissenschaft mit ihrer Arbeit und ihren Visionen voranbringen.',NULL,'DEU','SMS - Schwanke meets Science','https://s3.amazonaws.com/schedulesdirect/assets/p15166101_st_h12_aa.jpg',4,NULL),('SH020026240000','Wenn in Sachsen, Sachsen-Anhalt und Thüringen etwas wirklich Wichtiges und Dramatisches passiert, dann berichtet `MDR extra\' kompetent und seriös.',NULL,'DEU','MDR extra','https://s3.amazonaws.com/schedulesdirect/assets/p11080465_b_h3_aa.jpg',4,NULL),('SH020611350000','Aus der Region für die Region: Von der harten Politik bis hin zu unterhaltsamen Heimatgeschichten - wir sind stets nah dran an den Menschen und ihren Themen.',NULL,'DEU','Niedersachsen 18.00 Uhr','https://json.schedulesdirect.org/20141201/image/assets/p11282815_i_h12_aa.jpg',4,NULL),('SH019994380000','Das Politikmagazin, dessen Reportagen und Interviews sich mit Themen aus Rheinland-Pfalz befassen.',NULL,'DEU','zur Sache Rheinland-Pfalz!','https://s3.amazonaws.com/schedulesdirect/assets/p11071775_b_h12_aa.jpg',4,NULL),('SH019578550000','`DAS!\' informiert täglich über das, was im Norden Gesprächsthema ist. Zeitgleich begrüßen die Moderatoren einen prominenten Gast auf dem Roten Sofa.',NULL,'DEU','DAS!','https://json.schedulesdirect.org/20141201/image/assets/p10910973_i_h12_aa.jpg',4,NULL);
